#===================================================================================================
# THE CONFIG BUNDLE BUILDER  
#===================================================================================================

sub build_configbundle {

# NOTE: setting input details

	my ($config, $configbundles_ref) = @_;

	my $configtype = $confignames{$config}{'type'};	 								# assigning config types to each config bundle
	my $serviceset = $confignames{$config}{'serviceset'} 	if (exists $confignames{$config}{'serviceset'});	# assigning config the chosen default service set
	unless (defined($serviceset) && ($serviceset ne "")) 	{ $serviceset = $configtype; }

# NOTE: Print the firewall type we are analyzing as we start up
	
	my $configtypetxt;

	if ($configtype eq 'cs') {

		$configtypetxt = 'Cisco ASA' ;
	} 

	elsif ($configtype eq 'od') {

		$configtypetxt = 'Checkpoint FW-1' ;
	} 

	elsif ($configtype eq 'ns') {

		$configtypetxt = 'Netscreen SreenOS' ;
	}
	
	print "\nBeginning Analysis of $configtypetxt Config: \n";
	print "-------------------------------------------------\n";
	print "$config...\n";
	print "-------------------------------------------------\n";
	
	
#===================================================================================================
# SETTING THE CONFIG HASHES AND ARRAYS
#===================================================================================================

# NOTE: config processing

	my %netobjects 			;
	my %netexceptions 		;
	my %srvcexceptions 		;
	my %ruleexceptions 		;
	my %portexceptions		;
	my @netobjects			;	# in order of appeareance
	my @clusterobjects		;	# in order of appeareance
	my @rangeobjects		;	# in order of appeareance
	my @orderedports		;
	my @orderedportranges		;
	my @orderedhighports		;
	my @orderedlowports		;
	my %duplnetobjects 		;
	my %srvcobjects 		;
	my %ports 			;
	my %duplports 			;
	my %netgroups 			;
	my %exclgroups 			;
	my %srvcgroups 			;
	my %objectstokeep 		;
	my %installon			;
	my %tinstallon			;	# translate install on, used to make install ons for cisco rules, with interface names from access-groups

	my %interfaces			;	# from ASA config
	my %zones			;	# derived from ASA config access-lists, or netscreen config

# NOTE: subgroup processing

	my %networkgroups		;
	my %netgroupobjs		;
	my %srvcgroupobjs		;
	my %servicegroups		;
	my %allgroups			;

# NOTE: binary ip processing

	my %ips 			;       # Called by all their 32 bits if they are hosts and by their masked bits if they are networks
	my %duplips			;	
	my @orderedfwobj		;
	my %bingroups			;	# all binary ips belonging to members all members of a group
	my %bingroupsizes		;

# NOTE: rule processing 

	my %resobjectshrd		;	# holds the last set of resolved names from the 'or' menu option
	my %rules			;
	my %drops			;	# used for masking drop rules during the policy expansion
	my $rulegroup			;	# for checkpoint to pull different rulebases and for ASAs different access-lists
	my %rulegroups			;
	my %rlgrpzones			;
	my %netgroupzones		;
	my %srvcgroupzones		;
	my %rulecsvs			;
	my %ruletypes			;	# the rule types that exist within this config bundle, rule types are written to this hash during rule building
	my %ruleactions			;	# the rule actions that exist within this config bundle, rule actions are written to this hash during rule building
	my %binrules			;
	my $aclname 			;	# for ASA ACL processing
	my $difflast			;	# compair with last rulebase made
	my %lastrashrulebase		;	# the last rulebase rationalized
	my %lastrashprintbase		;	# the last rulebase rationalized
	my %prevrashrulebase		;	# the previous rulebase rationalized
	my $sectionheader		;	# comment rules in cisco and section headers in checkpoint
	my %mergerulebases		;	# the rulebases that are the destination for merged rules
	my %mergetorulebases		;	# the rulebase used to remove rules from the rationalized rules when you are merging rulebases, rule rule rules!! 
	my %logtypes			;	# the type of loging used in the rulebase 

# NOTE: variables for rationalizing rules - to be handed between subroutines

	my $incconobjs			;
	my %rashrules			;
	my %rashrulegroups		;
	my %includeips			;
	my %excludeips			;
	my %groupsinuse			;

# NOTE: port processing

	my %portgroups			;
	my %portgroupsizes		;

# NOTE: nat rule processing

	my %nats			;

# NOTE: route processing 

	my %interfacebins 		;
	my %routes			;
	my %spoofgroups 		;

# NOTE: log processing

	my %fromstree			;
	my %deststree			;
	my %srvcstree			;
	my %actionfromstree		;
	my %actiondeststree		;
	my %servicefromstree		;
	my %servicedeststree		;
	my %actionservicefromstree	;
	my %actionservicedeststree	;
	my %daystree			;
	my %rulehits			;
	my %uniqueiphits		;
	my %logbins			;
	my %natstree			;

# NOTE: compairing logs and config

	my %rulenumberhits		;
	my %unusedrulehits 		; 
	my %foundsrvcobjects		;
	
# NOTE: setting default vaules
	
	my $aclcount		= 0	;	# for ASA ACL processing
	my $rulecount 		= 0	;
	my $rbcount		= 0	;
	my $logheaddercount 	= 0	;
	my $loglinecount 	= 0	;
	my $loglinecountquick 	= 0 	;
	my $loglinecountholder 	= 0 	;
	
# NOTE: setting default service any objects and default service definitions for each firewall type
		
	if ($serviceset eq 'od') {
	
	# NOTE: setting DEFAULT objects for CHECKPOINT FIREWALL-1 
		
		$netobjects{'Any'}{'ip'} 			= '0.0.0.0' 	;
		$netobjects{'Any'}{'nm'} 			= '0.0.0.0' 	;
		$netobjects{'Any'}{'type'} 			= 'any' 	;
		$netobjects{'Any'}{'colour'} 			= 'white' 	;
		$netobjects{'Any'}{'description'} 		= 'DefaultALL' 	;
		$netobjects{'Any'}{'ipbin'}{''}++ 				;

		$ips{''}{'name'} 				= 'Any'		;
		$interfacebins{''}{'name'} 			= "default"	;

		$srvcobjects{'Any'}{'type'} 			= 'any'		;
		$srvcobjects{'Any'}{'port'}{'any'} 		= 'any'		;
		$srvcobjects{'Any'}{'ports'}{'any'}{'any'}++			;
		$srvcobjects{'any'}{'type'} 			= 'any'		;
		$srvcobjects{'any'}{'port'}{'any'} 		= 'any'		;
		$srvcobjects{'any'}{'ports'}{'any'}{'any'}++			;

		$ports{'any'}{'any'}{'name'} 			= 'Any'		;
		$ports{'any'}{'Any'}{'name'} 			= 'Any'		;
		$ports{'any'}{'ANY'}{'name'} 			= 'Any'		;

		$netobjects{'empty'}{'ip'} 			= '255.255.255.255' ;
		$netobjects{'empty'}{'nm'} 			= '255.255.255.255' ;
		$netobjects{'empty'}{'type'} 			= 'empty' 	;

		$sectionheader = 'none'						;

		set_checkpoint_defaults(\%srvcobjects, \%ports)			;
		set_checkpoint_group_defaults(\%srvcgroups)			;
		set_new_checkpoint_defaults(\%srvcobjects, \%ports)		;
	}
	
	elsif ($serviceset eq 'ns') {

	# NOTE: setting DEFAULT objects for NETSCREEN SCREENOS

		$netobjects{'Any'}{'ip'} 			= '0.0.0.0' 	;
		$netobjects{'Any'}{'nm'} 			= '0.0.0.0' 	;
		$netobjects{'Any'}{'type'} 			= 'any' 	;
		$netobjects{'Any'}{'colour'} 			= 'white' 	;
		$netobjects{'Any'}{'description'} 		= 'DefaultALL' 	;
		$netobjects{'Any'}{'ipbin'}{''}++ 				;

		$ips{''}{'name'} 				= 'Any'		;
		$ips{''}{'zone'} 				= 'Global'	;
		$interfacebins{''}{'name'} 			= "default"	;

		$srvcobjects{'ANY'}{'type'} 			= 'any'		;
		$srvcobjects{'ANY'}{'port'}{'any'} 		= 'any'		;
		$srvcobjects{'ANY'}{'ports'}{'any'}{'any'}++			;

		$ports{'any'}{'any'}{'name'} 			= 'ANY'		;
		$ports{'any'}{'Any'}{'name'} 			= 'ANY'		;
		$ports{'any'}{'ANY'}{'name'} 			= 'ANY'		;

		set_netscreen_defaults(\%srvcobjects)				;
		set_netscreen_group_defaults(\%srvcgroups)			;
	} 

	elsif ($serviceset eq 'cs') {

	# NOTE: setting DEFAULT objects for CISCO PIX / ASA

		$sectionheader = 'none'						;

		$netobjects{'any'}{'ip'} 			= '0.0.0.0' 	;
		$netobjects{'any'}{'nm'} 			= '0.0.0.0' 	;
		$netobjects{'any'}{'type'} 			= 'any' 	;
		$netobjects{'any'}{'colour'} 			= 'white' 	;
		$netobjects{'any'}{'ipbin'}{''}++ 				;
		$netobjects{'any'}{'description'} 		= 'DefaultALL' 	;

                $netobjects{'any4'}{'ip'}                       = '0.0.0.0'     ;
                $netobjects{'any4'}{'nm'}                       = '0.0.0.0'     ;
                $netobjects{'any4'}{'type'}                     = 'any'         ;
                $netobjects{'any4'}{'colour'}                   = 'white'       ;
                $netobjects{'any4'}{'ipbin'}{''}++                              ;
                $netobjects{'any4'}{'description'}              = 'DefaultIPv4ALL' ;

                $ips{''}{'name'}                                = 'any4'        ;
                $interfacebins{''}{'name'}                      = "default"     ;
		$ips{''}{'name'} 				= 'any'		;
		$interfacebins{''}{'name'} 			= "default"	;

		$srvcobjects{'any'}{'type'} 			= 'any'		;
		$srvcobjects{'any'}{'description'} 		= 'Default Any Service'	;
		$srvcobjects{'any'}{'port'}{'any'} 		= 'any'		;
		$srvcobjects{'any'}{'ports'}{'any'}{'any'}++			;

		$ports{'any'}{'any'}{'name'} 			= 'any'		;
		$ports{'any'}{'Any'}{'name'} 			= 'any'		;
		$ports{'any'}{'ANY'}{'name'} 			= 'any'		;

		set_cisco_defaults(\%srvcobjects, \%ports)			;
	}
	
	# NOTE: adding service objects to the orderd port list BEFORE newly configured objects

	push (@orderedports, (keys %srvcobjects)) ; 


#===================================================================================================
# Building Config Groups, Objects and Rules from odumper CSV
#===================================================================================================
	
	if ($configtype eq 'od' ) {

		$rulecount = read_odumper_config(
        		\@clusterobjects,
        		$config,
        		\%duplnetobjects,
        		\%exclgroups,
        		\%installon,
        		\%logtypes,
        		\%netgroups,
        		\@netobjects,
        		\%netobjects,
        		\@orderedhighports,
        		\@orderedlowports,
        		\@orderedportranges,
        		\@orderedports,
        		\@rangeobjects,
        		$rbcount,
        		$rulecount,
        		\%rulecsvs,
        		$rulegroup,
        		\%rulegroups,
        		\%rulehits,
        		\%rules,
        		$sectionheader,
        		\%srvcgroups,
        		\%srvcobjects);
	}

#===================================================================================================
# Building Base Config from NETSCREEN config file
#===================================================================================================

	elsif ($configtype eq 'ns') {

		$rulecount = read_netscreen_config( 
			$config,
			\%configbundles, 	
			\%duplnetobjects,	
			\%installon,
			\%interfaces,
			\%ips,
			\%logtypes,
			\%nats,
			\%netgroups,
			\%netgroupzones,
			\%netobjects,	 	
			\@netobjects,
			\@orderedportranges,
			\@orderedports,
			\@rangeobjects,	
			$rbcount,
			$rulecount,
			\%rulecsvs,
			\%rulegroups,
			\%rules,
			\%srvcgroups,
			\%srvcobjects,
			\%zones);
