					}

					foreach my $rulen (sort numerically keys %{$rulegroups_ref->{$acln}}) {
						$rules_ref->{$rulen}{'natsrcip'} = $ipname;
						$rules_ref->{$rulen}{'type'}     = 'sec_nat_rule';
					}
				} 

				else {
					print "   WARNING:   Bad static nat access-list statement in $line[1] \n    $_\n";
				}
			} 

			elsif (is_ip($line[2]) && is_ip($line[3]) && is_netmask($line[5]) ) {
				my $netname;
				my $nat_name;

				if (network_is_known($line[2], $line[5], $ips_ref)) {
					$nat_name = net_to_name($line[2], $line[5], $netobjects_ref, $ips_ref);
				} else {
					$nat_name = "SNAT_Net\-$line[2]\-$line[5]";
					add_net($nat_name,$line[2], $line[5], $netobjects_aref, $netobjects_ref, $ips_ref);
				}

				if (network_is_known($line[3], $line[5], $ips_ref)) {
					$netname = net_to_name($line[3], $line[5], $netobjects_ref, $ips_ref);
				} else {
					$netname = "SNAT_Dst_Net\-$line[3]\-$line[5]";
					add_net($netname,$line[3], $line[5], $netobjects_aref, $netobjects_ref, $ips_ref);
				}

				$natcount++; 
				$nats_ref->{$natcount}{'enabled'}   = "yes"					; 
				$nats_ref->{$natcount}{'installon'} = $realifip					; 
				$nats_ref->{$natcount}{'comment'}   = 'STATIC NAT ADDED from static statement'	;

				$nats_ref->{$natcount}{'origsrc'}{$netname}++					; 
				$nats_ref->{$natcount}{'origdst'}{'Any'}++					; 
				$nats_ref->{$natcount}{'origsrvc'}{'Any'}++					; 

				$nats_ref->{$natcount}{'natsrc'}  = $nat_name					; 
				$nats_ref->{$natcount}{'natdst'}  = 'ORIGINAL'					; 
				$nats_ref->{$natcount}{'natsrvc'}  = 'ORIGINAL'					; 
			}
		}
	}

#---------------------------------------------------------------------------------------------------
# PROCESS INSTALLONS FOR RULES 
#---------------------------------------------------------------------------------------------------

# NOTE: access group interface as install on

	foreach my $rnum (sort numerically keys %{$rules_ref}) {
		my $rlgrp = $rules_ref->{$rnum}{'rulegroup'};

		if (exists $tinstallon_ref->{$rlgrp}) {
			my $installon = $tinstallon_ref->{$rlgrp} ;
			$rules_ref->{$rnum}{'installon'}{$installon}++;
			$installon_ref->{$installon}++;
		} 

		else {
			$rules_ref->{$rnum}{'installon'}{'no_Installon'}++;
			$installon_ref->{'no_Installon'}++;
		}
	}
	return $rulecount;
}
	


#===================================================================================================
# BUILD NET GROUPS AND SUBGROUPS
#===================================================================================================

sub net_builder {
        my ($group, $netobjects_ref, $netgroups_ref, $networkgroups_ref, $netgroupobjs_ref, $netsubgroupcount, $subgroup) = @_	;
	my $subgrpcount				;
	my @subgroups				;

	if (defined $subgroup) {
	        foreach my $groupmembr ( keys %{ $netgroups_ref->{$subgroup} } ) {
			$subgrpcount++		;
			$$netsubgroupcount++	;
			if ($groupmembr eq $group) {
				print "   WARNING:  CIRCULAR group DETECTED in $group - THIS GROUP WAS REFERENCED IN ITS $subgroup\n";
				next;
			} elsif ($groupmembr eq $subgroup) {
				print "   WARNING:  CIRCULAR group DETECTED in $subgroup - THIS GROUP REFERENCED ITS SELF AND IS INCLUDED IN $group\n";
				next;

			} elsif (exists($netgroups_ref->{$groupmembr})) {
       	       		        $networkgroups_ref->{$group}{$groupmembr}{'count'}++									;
				$networkgroups_ref->{$group}{$groupmembr}{'type'} 				= "subgroup.$subgrpcount"		;
				push (@subgroups								, $group) 				;
				push (@{$networkgroups_ref->{$groupmembr}{'supergroups'}}			, $group)				;

       	 			foreach my $subgroupmembr ( keys %{ $netgroups_ref->{$groupmembr} } ) {

                                        if ($subgroupmembr eq $groupmembr) {
                                                print "   WARNING:  NESTED CIRCULAR group DETECTED in $subgroupmembr - THIS GROUP REFERENCED ITS SELF AND IS INCLUDED IN $groupmembr, NESTED IN $subgroup, and: $group\n";
                                                next;
                                        } elsif ($subgroupmembr eq $subgroup) {
                                                print "   WARNING:  NESTED CIRCULAR group DETECTED in $subgroupmembr - THIS GROUP WAS REFERENCED IN ITS SUBGROUP: $subgroup, Nested IN: $groupmembr, and: $group\n";
                                                next;
                                        } elsif ($subgroupmembr eq $group) {
                                                print "   WARNING:  NESTED CIRCULAR group DETECTED in $group - THIS GROUP WAS REFERENCED IN ITS SUBGROUP: $groupmembr, Nested in: $subgroup\n";
                                                next;
                                        }

					if (exists ($netgroups_ref->{$subgroupmembr})) {
						$subgrpcount++												;
						$$netsubgroupcount++											;
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'count'}++							;
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'type'} 		= "subgroup.$subgrpcount"		;
						push (@subgroups						, $groupmembr) 				;
						push (@{$networkgroups_ref->{$subgroupmembr}{'supergroups'}}	, $group) 				;

						net_builder($group, $netobjects_ref, $netgroups_ref, $networkgroups_ref, $netgroupobjs_ref, $netsubgroupcount, $subgroupmembr);

					} elsif (exists ($netobjects_ref->{$subgroupmembr})) {
       	                 			$netgroupobjs_ref->{$group}{$subgroupmembr}{'type'} 		= $netobjects_ref->{$subgroupmembr}{'type'};		
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'count'}++							;
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'type'} 		= "subobj.$subgrpcount"			;
						push (@{$netobjects_ref->{$subgroupmembr}{'supergroups'}}	, $group) 				;
					}
				}
	
			} elsif (exists ($netobjects_ref->{$groupmembr})) {
       	                 	$netgroupobjs_ref->{$group}{$groupmembr}{'type'} 		= $netobjects_ref->{$groupmembr}{'type'}		;		
				$networkgroups_ref->{$group}{$groupmembr}{'count'}++ 									;
				$networkgroups_ref->{$group}{$groupmembr}{'type'} 		= "subobj.$subgrpcount"					;
				push (@{$netobjects_ref->{$groupmembr}{'supergroups'}}		, $group) 						;
       		       	} else {
       	                 	$netgroupobjs_ref->{$group}{$groupmembr}{'type'} 		= 'default'						;		
				$networkgroups_ref->{$group}{$groupmembr}{'count'}++ 									;
				$networkgroups_ref->{$group}{$groupmembr}{'type'} 		= "default.subobj.$subgrpcount"				;
       			       	print "WHAT THE FUCK!??? $group $groupmembr\n"										;
			}
       	         } 
	} else {
	        foreach my $groupmembr ( keys %{ $netgroups_ref->{$group} } ) {
			if ($groupmembr eq $group) {
				print "   WARNING:  CIRCULAR group DETECTED in $group - THIS GROUP REFERENCED ITS SELF\n";
				next;
				 
			} elsif (exists($netgroups_ref->{$groupmembr})) {
				$subgrpcount++														;
				$$netsubgroupcount++													;
       	                 	$networkgroups_ref->{$group}{$groupmembr}{'count'}++									;
       	                 	$networkgroups_ref->{$group}{$groupmembr}{'type'} 				= 'group'				;
				push (@subgroups								, $group) 				;
				push (@{$networkgroups_ref->{$groupmembr}{'supergroups'}}			, $group)				;

       	 			foreach my $subgroupmembr ( keys %{ $netgroups_ref->{$groupmembr} } ) {

                                        if ($subgroupmembr eq $groupmembr) {
                                                print "   WARNING:  NESTED CIRCULAR group DETECTED in $subgroupmembr - THIS GROUP REFERENCED ITS SELF AND IS INCLUDED in: $groupmembr, NESTED in: $group\n";
                                                next;
                                        } elsif ($subgroupmembr eq $group) {
                                                print "   WARNING:  NESTED CIRCULAR group DETECTED in $group - THIS GROUP WAS REFERENCED IN ITS SUBGROUP: $subgroupmembr, NESTED in: $groupmembr\n";
                                                next;
                                        }

					if (exists ($netgroups_ref->{$subgroupmembr})) {
						$subgrpcount++												;
						$$netsubgroupcount++											;
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'count'}++							;
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'type'} 		= "subgroup.$subgrpcount"		;
						push (@subgroups, $group) 										;
						push (@{$networkgroups_ref->{$subgroupmembr}{'supergroups'}}	, $group)				;

						net_builder($group, $netobjects_ref, $netgroups_ref, $networkgroups_ref, $netgroupobjs_ref, $netsubgroupcount, $subgroupmembr);

					} elsif (exists ($netobjects_ref->{$subgroupmembr})) {
       	                 			$netgroupobjs_ref->{$group}{$subgroupmembr}{'type'} 		= $netobjects_ref->{$subgroupmembr}{'type'};		
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'count'}++							;
       	                 			$networkgroups_ref->{$group}{$subgroupmembr}{'type'} 		= "subobj.$subgrpcount"			;
						push (@{$netobjects_ref->{$subgroupmembr}{'supergroups'}}	, $group) 				;
					}
				}
				$subgrpcount--														;	
	
			} elsif (exists ($netobjects_ref->{$groupmembr})) {
       	                 	$netgroupobjs_ref->{$group}{$groupmembr}{'type'} 		= $netobjects_ref->{$groupmembr}{'type'}		;		
				$networkgroups_ref->{$group}{$groupmembr}{'count'}++ 									;
				$networkgroups_ref->{$group}{$groupmembr}{'type'} 		= 'object' 						;
				push (@{$netobjects_ref->{$groupmembr}{'supergroups'}}		, $group) 						;
       		       	} else {
       	                 	$netgroupobjs_ref->{$group}{$groupmembr}{'type'} 		='default'						;		
				$networkgroups_ref->{$group}{$groupmembr}{'count'}++ 									;
				$networkgroups_ref->{$group}{$groupmembr}{'type'} 		= "default.object"					;
       			       	#print "WHAT THE FUCK!??? $group $groupmembr\n"										;
       		 	}
       		 }
	}
}

