#===================================================================================================
# BUILDING THE BINARY IP ADDRESS TO OBJECT NAME HASH FOR MATCHING AGAINST
#===================================================================================================

sub build_binary_ips {

	my ($bingroups_ref,
	$bingroupsizes_ref,
	$clusterobjects_aref,
	$duplips_ref,
	$ips_ref,
	$netexceptions_ref,
	$netgroupobjs_ref,
	$netobjects_aref,
	$netobjects_ref,
	$orderedfwobj_aref,
	$rangeobjects_aref) = @_;

# NOTE: Arrange objects in reverse order of significance (per object type) and order of appearence (within object types) so as to write over less significant objects
#	with more significant objects and older objects names with newer ones

	push (@$orderedfwobj_aref, @$rangeobjects_aref, @$netobjects_aref, @$clusterobjects_aref)  	;

# NOTE: Checking for NAT entries and adding if found

	foreach my $object (@$orderedfwobj_aref) {
		if (exists ($netobjects_ref->{$object}{'hidenat'}) ) {
			my $hnatbin 			= ip_to_bin($netobjects_ref->{$object}{'hidenat'})	;
			$ips_ref->{$hnatbin}{'name'} 	= $object						;
			$netobjects_ref->{$object}{'natbin'}{$hnatbin}++					;

		} elsif (exists ($netobjects_ref->{$object}{'staticnat'}) ) {
			my $snatbin 			= ip_to_bin($netobjects_ref->{$object}{'staticnat'})	;
			$ips_ref->{$snatbin}{'name'}	= $object						;
			$netobjects_ref->{$object}{'natbin'}{$snatbin}++					;
		}

	# NOTE: Converting decimal IP's to TEXT BINARY and adding them to the %ips hash

	    	if ($netobjects_ref->{$object}{'type'} =~ /^net$|^host$|^member$|^ss$|^idevice$|^plaingw$|^dynamic$|^cpgw$|^default$|^empty$|^cluster$/) {

		# NOTE: process INTERFACE binary IP's and ADD TO OBJECT

			if (exists $netobjects_ref->{$object}{'interface'}) {
				foreach my $intname (keys %{$netobjects_ref->{$object}{'interface'}}) {
	                		my ($inetbin) 		 		= ip_to_bin($netobjects_ref->{$object}{'interface'}{$intname}{'ip'});
	               			my ($imaskbin, $imaskbits, $imasklength) = netmask_to_bin($netobjects_ref->{$object}{'interface'}{$intname}{'nm'});
	               		 	my ($imaskedbits) 			= substr($inetbin, 0, $imasklength)		;
	
					if (exists ($ips_ref->{$imaskedbits})) {
	               		 		my $oldobject	 			= $ips_ref->{$imaskedbits}{'name'} 	;
						$duplips_ref->{$imaskedbits}{$oldobject}++					;
						$duplips_ref->{$imaskedbits}{$object}++						;
					}
					if (exists ($ips_ref->{$inetbin})) {
	              		 		my $oldobject	 			= $ips_ref->{$inetbin}{'name'} 		;
						$duplips_ref->{$inetbin}{$oldobject}++						;
						$duplips_ref->{$inetbin}{$object}++						;
					} else {
						if (exists $netobjects_ref->{$object}{'zone'}) {
							my $zone			= $netobjects_ref->{$object}{'zone'}	;
							$ips_ref->{$inetbin}{'zone'} 	= $zone					;
						}
						#$ips_ref->{$imaskedbits}{'name'} = $object					;
						$ips_ref->{$inetbin}{'name'} 		= $object				;
					}
					#$netobjects_ref->{$object}{'ipbin'}{$imaskedbits}++					;
					$netobjects_ref->{$object}{'ipbin'}{$inetbin}++						;
				}
			}

		# NOTE: process CLUSTER MEMBER IP's and ADD TO CLUSTER

			if (exists $netobjects_ref->{$object}{'member'}) {
				foreach my $member (keys %{$netobjects_ref->{$object}{'member'}}) {
	                		my ($mnetbin) 		 		= ip_to_bin($netobjects_ref->{$member}{'ip'})		;
	                		my ($mmaskbin, $mmaskbits, $mmasklength)= netmask_to_bin($netobjects_ref->{$member}{'nm'})	;
	                		my ($mmaskedbits) 			= substr($mnetbin, 0, $mmasklength)			;

					if (exists ($ips_ref->{$mmaskedbits})) {
	                			my $oldobject	 				= $ips_ref->{$mmaskedbits}{'name'} 	;
						$duplips_ref->{$mmaskedbits}{$oldobject}++						;
						$duplips_ref->{$mmaskedbits}{$object}++							;
					} else {
						if (exists $netobjects_ref->{$object}{'zone'}) {
							my $zone				= $netobjects_ref->{$object}{'zone'}	;
							$ips_ref->{$mmaskedbits}{'zone'} 	= $zone					;
						}
						$ips_ref->{$mmaskedbits}{'name'} 		= $object				;
					}
					$netobjects_ref->{$object}{'ipbin'}{$mmaskedbits}++						;
				}
			}

	                my ($netbin) 		 		= ip_to_bin($netobjects_ref->{$object}{'ip'})				;
	                my ($maskbin, $maskbits, $masklength) 	= netmask_to_bin($netobjects_ref->{$object}{'nm'})			;
	                my ($maskedbits) 			= substr($netbin, 0, $masklength)					;

			if (exists ($ips_ref->{$maskedbits}) && ($ips_ref->{$maskedbits}{'name'} ne $object)) {
	                	my $oldobject	 		= $ips_ref->{$maskedbits}{'name'} 					;
				$duplips_ref->{$maskedbits}{$oldobject}++								;
				$duplips_ref->{$maskedbits}{$object}++									;
			}

			if (exists $netobjects_ref->{$object}{'zone'}) {
				my $zone			= $netobjects_ref->{$object}{'zone'}					;
				$ips_ref->{$maskedbits}{'zone'} = $zone									;
			}

		# NOTE: write object ipbins and overwrite previous %ips details
 
			$ips_ref->{$maskedbits}{'name'} 	= $object								;
			$netobjects_ref->{$object}{'ipbin'}{$maskedbits}++								;

	# NOTE: process RANGE object

	        } elsif ($netobjects_ref->{$object}{'type'} =~ /^range$/) {
			my $checkiprangesize												;
			my @ipstart 	= split (/\./, $netobjects_ref->{$object}{'rangestart'})  					;
			my @ipend   	= split (/\./, $netobjects_ref->{$object}{'rangeend'})  					;
			if (($ipend[0] - $ipstart[0]) != 0) {
				$checkiprangesize   = ( ($ipend[3] - $ipstart[3]) * ($ipend[2] - $ipstart[2]) * ($ipend[1] - $ipstart[1]) * ($ipend[0] - $ipstart[0])) ;
				#print "CHECK-3 $checkiprangesize\n";
			} elsif (($ipend[1] - $ipstart[1]) != 0) {
				$checkiprangesize   = ( ($ipend[3] - $ipstart[3]) * ($ipend[2] - $ipstart[2]) * ($ipend[1] - $ipstart[1]) ) ;
				#print "CHECK-2 $checkiprangesize\n";
			} elsif (($ipend[2] - $ipstart[2]) != 0) {
				$checkiprangesize   = ( ($ipend[3] - $ipstart[3]) * ($ipend[2] - $ipstart[2]) )	;
				#print "CHECK-1 $checkiprangesize\n";
			} else {
				$checkiprangesize   = ( ($ipend[3] - $ipstart[3]) ) ;
				#print "CHECK-0 $checkiprangesize\n";
			}

		# NOTE: print large range WARNINGS and set object EXCEPTIONS 

			if ($checkiprangesize > 1000000) {
				print "   S-ALERT:  Large IPaddr range     \($checkiprangesize IP's\) in range object \"$object\"\n"	;
				print "   	     Ranges of this size      ^^^  are NOT processed    OBJ DROPPED\n"			;
				$netexceptions_ref->{$object} = "net_range_to_large"							;
				next													;
			}
	
			if (($checkiprangesize > 20) && ($checkiprangesize < 1000000)) {
				print "   IP-INFO:  Large IP range         \($checkiprangesize IPs\) in netobject \"$object\"\n"	;
			}
			for (my $i = $ipstart[0]; $i <= $ipend[0]; $i++) {								# first  octet
				for (my $i1 = $ipstart[1]; $i1 <= $ipend[1]; $i1++) {							# second octet
					for (my $i2 = $ipstart[2]; $i2 <= $ipend[2]; $i2++) {						# third  octet
						for (my $i3 = $ipstart[3]; $i3 <= $ipend[3]; $i3++) {					# fourth octet
							my $iptoadd 		= join (".", $i, $i1, $i2, $i3)				;
							my $ipbin 		= ip_to_bin($iptoadd) 					;
	
							if (exists ($ips_ref->{$ipbin})) {
	                					my $oldobject	 = $ips_ref->{$ipbin}{'name'} 				;
								$duplips_ref->{$ipbin}{$oldobject}++					;
								$duplips_ref->{$ipbin}{$object}++					;
								$netobjects_ref->{$object}{'ipbin'}{$ipbin}++				;
							} else {
								if (exists $netobjects_ref->{$object}{'zone'}) {
									my $zone			= $netobjects_ref->{$object}{'zone'};
									$ips_ref->{$ipbin}{'zone'} 	= $zone				;
								}
						                $ips_ref->{$ipbin}{'name'} 		= $object			;
								$netobjects_ref->{$object}{'ipbin'}{$ipbin}++				;
							}
						}
					}
				}
			}
	        } else {

		# NOTE: print unknown object WARNING

			print "   WARNING:  Object: $object UNKNOWN\n";
		}
	}

# NOTE: build binary groups

	foreach my $groupn (keys %{$netgroupobjs_ref}) {
		foreach my $groupmem (keys %{$netgroupobjs_ref->{$groupn}}) {
			foreach my $groupmembin (keys %{$netobjects_ref->{$groupmem}{'ipbin'}}) {
				#print "MADE IT: $groupn, $groupmem, $groupmembin\n";
				$bingroups_ref->{$groupn}{$groupmembin}++	;
			}
		}
	}
	foreach my $groupn (keys %{$bingroups_ref}) {
		my $groupsize = scalar keys %{$bingroups_ref->{$groupn}} 	;
		$bingroupsizes_ref->{$groupn} = $groupsize		;
	}
}

#===================================================================================================
# BUILDING THE PORT ADDRESS TO SERVICE OBJECT NAME HASH FOR MATCHING AGAINST
#===================================================================================================

sub build_service_ports {

	my ($duplports_ref,
	$orderedhighports_aref,
	$orderedlowports_aref,
	$orderedportranges_aref,
	$orderedports_aref,
	$portgroups_ref,
	$ports_ref,
	$srvcexceptions_ref,
	$srvcgroupobjs_ref,
	$srvcobjects_ref) 	= @_;

	my %rangesizes		;
	my @smalltolargeranges	;

# NOTE: organizing GREATER THAN ports

	foreach my $srvcobject (@$orderedhighports_aref) {
		foreach my $proto (keys %{$srvcobjects_ref->{$srvcobject}{'port'}}) {
			my $highport 	=  $srvcobjects_ref->{$srvcobject}{'port'}{$proto}; 
                        if (defined($highport)) {
                                if ($highport =~ /^\d+\-\d+$/) {
                                        my ($startport, $endport)       = split('-', $highport)        ;
                                        my $portcount                   = ($endport - $startport)       ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($highport =~ /^\>\d+$/) {
                                        $highport =~ s/^\>//                                           ;
                                        my $portcount                   = (65536 - $highport)          ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($highport =~ /^\<\d+$/) {
                                        $highport =~ s/^\<//                                           ;
                                        $rangesizes{$highport}{$srvcobject}++                          ;
                                } elsif ($highport =~ /^\d+$/) {
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                } else {
                                        #print "NON NUMERIC PORT: $srvcobject\n"                        ;
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                }
			}
		}
	}

# NOTE: organizing LESS THAN ports

	foreach my $srvcobject (@$orderedlowports_aref) {
		foreach my $proto (keys %{$srvcobjects_ref->{$srvcobject}{'port'}}) {
			my $lowport 	=  $srvcobjects_ref->{$srvcobject}{'port'}{$proto} ; 
                        if (defined($lowport)) {
                                if ($lowport =~ /^\d+\-\d+$/) {
                                        my ($startport, $endport)       = split('-', $lowport)        ;
                                        my $portcount                   = ($endport - $startport)       ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($lowport =~ /^\>\d+$/) {
                                        $lowport =~ s/^\>//                                           ;
                                        my $portcount                   = (65536 - $lowport)          ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($lowport =~ /^\<\d+$/) {
                                        $lowport =~ s/^\<//                                           ;
                                        $rangesizes{$lowport}{$srvcobject}++                          ;
                                } elsif ($lowport =~ /^\d+$/) {
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                } else {
                                        #print "NON NUMERIC PORT: $srvcobject\n"                        ;
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                }
			}
		}
	}

# NOTE: organizing RANGE ports

	foreach my $srvcobject (@$orderedportranges_aref) {
		foreach my $proto (keys %{$srvcobjects_ref->{$srvcobject}{'port'}}) {
			my $portrange = $srvcobjects_ref->{$srvcobject}{'port'}{$proto}		;	 
                        if (defined($portrange)) {
                                if ($portrange =~ /^\d+\-\d+$/) {
                                        my ($startport, $endport)       = split('-', $portrange)        ;
                                        my $portcount                   = ($endport - $startport)       ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($portrange =~ /^\>\d+$/) {
                                        $portrange =~ s/^\>//                                           ;
                                        my $portcount                   = (65536 - $portrange)          ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($portrange =~ /^\<\d+$/) {
                                        $portrange =~ s/^\<//                                           ;
                                        $rangesizes{$portrange}{$srvcobject}++                          ;
                                } elsif ($portrange =~ /^\d+$/) {
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                } else {
                                        #print "NON NUMERIC PORT: $srvcobject\n"                        ;
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                }
			}
		}
	}

# NOTE: organising ports

	foreach my $srvcobject (@$orderedports_aref) {
		foreach my $proto (keys %{$srvcobjects_ref->{$srvcobject}{'port'}}) {
			my $portrange = $srvcobjects_ref->{$srvcobject}{'port'}{$proto}		; 
                        if (defined($portrange)) {
                                if ($portrange =~ /^\d+\-\d+$/) {
                                        my ($startport, $endport)       = split('-', $portrange)        ;
                                        my $portcount                   = ($endport - $startport)       ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($portrange =~ /^\>\d+$/) {
                                        $portrange =~ s/^\>//                                           ;
                                        my $portcount                   = (65536 - $portrange)          ;
                                        $rangesizes{$portcount}{$srvcobject}++                          ;
                                } elsif ($portrange =~ /^\<\d+$/) {
                                        $portrange =~ s/^\<//                                           ;
                                        $rangesizes{$portrange}{$srvcobject}++                          ;
                                } elsif ($portrange =~ /^\d+$/) {
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                } else {
                                        #print "NON NUMERIC PORT: $srvcobject\n"                        ;
                                        $rangesizes{1}{$srvcobject}++                                   ;
                                }
			}
		}
	}
	#push (@smalltolargeranges, @orderedports) 	;

# NOTE: process small to large ranges in order

	foreach my $rangesize (sort numerically keys %rangesizes) {
		foreach my $srvcobject (keys %{$rangesizes{$rangesize}}) {
			push (@smalltolargeranges, $srvcobject) ;
		}
	}

	#print "PORT RANGE SIZES		\n##########################################################################\n\n". Dumper(%rangesizes) . "\n\n"	;

	foreach my $srvcobject (@smalltolargeranges) {

# NOTE: check if port and proto EXIST already

		if (exists $srvcobjects_ref->{$srvcobject}{'ports'}) {
			foreach my $defaultproto (keys %{$srvcobjects_ref->{$srvcobject}{'ports'}}) {
				foreach my $defaultport (keys %{$srvcobjects_ref->{$srvcobject}{'ports'}{$defaultproto}}) {
					if (exists $ports_ref->{$defaultproto} && exists $ports_ref->{$defaultproto}{$defaultport}) {
						#print "ADDED SERVICE DEFINITION TO DUPLICATES: $proto, $defaultport, $srvcobject\n";
						$duplports_ref->{$defaultproto}{$defaultport}{'name'}{$srvcobject}++;
					} else {
						$ports_ref->{$defaultproto}{$defaultport}{'name'} = $srvcobject;
					}
				}
			}
		}

	# NOTE: get PROTO and PORT from Service Object definition

		foreach my $proto (keys %{$srvcobjects_ref->{$srvcobject}{'port'}}) {

			my $portt = $srvcobjects_ref->{$srvcobject}{'port'}{$proto} ; 

		# NOTE:  process RANGE port objects

			unless (defined($portt)) {
				print "   WARNING:  Undefined PORT for     SERVICE: $srvcobject for PROTO: $proto\n" ;
				next;
			}

			if ($portt =~ /^\d+\-\d+$/ ) {
				my ($startport, $endport) 	= split('-', $portt) 		;
				my $checkrangesize 		= ($endport - $startport)	;
				if (($checkrangesize > 1000) && ($checkrangesize < 20000)) {
					print "   PRTINFO:  Large port range       \($checkrangesize ports\) in range object \"$srvcobject\"\n";
					$srvcexceptions_ref->{$srvcobject} 					= 'port_range_to_large'	;
					$ports_ref->{"srvcexception_$proto"}{$srvcobject}{'name'} 		= $srvcobject		;
					foreach my $exproto (keys %{$srvcobjects_ref->{$srvcobject}{'ports'}}) {
						$ports_ref->{"srvcexception_$exproto"}{$srvcobject}{'name'} 	= $srvcobject		;
					}
				}
				if ($checkrangesize >= 20000) {
					print "   S-ALERT:  Large port range       \($checkrangesize ports\) in range object \"$srvcobject\"\n";
					print "   	     Ranges of this size      ^^^  should be considered    INSECURE\n";
					$srvcexceptions_ref->{$srvcobject} 					= 'port_range_to_large'	;
					$ports_ref->{"srvcexception_$proto"}{$srvcobject}{'name'} 		= $srvcobject		;
					foreach my $exproto (keys %{$srvcobjects_ref->{$srvcobject}{'ports'}}) {
						$ports_ref->{"srvcexception_$exproto"}{$srvcobject}{'name'} 	= $srvcobject	;
					}
				}
				for (my $ix = $startport; $ix <= $endport; $ix++) {
					if (exists ($ports_ref->{$proto}{$ix})) {
						$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$ix}++ ;
						$duplports_ref->{$proto}{$ix}{'name'}{$srvcobject}++	;
					} else {
						$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$ix}++ ;
						$ports_ref->{$proto}{$ix}{'name'} = $srvcobject		;
					}
				}

		# NOTE:  process GREATER THAN RANGE port objects

			} elsif ($portt =~ m/^\>\d+$/) {
				$portt =~ s/\>//								;
				#print "AM I WORKING HIGH?\n";
				my $startport 		= $portt						;
				my $checkrangesize 	= (65536 - $startport)					;
				if (($checkrangesize > 1000) && ($checkrangesize < 20000)) {
					print "   PRTINFO:  Large high port range  \($checkrangesize ports\) in range object \"$srvcobject\"\n";
					$srvcexceptions_ref->{$srvcobject} = 'high_port_range_to_large'		;
					$ports_ref->{"srvcexception_$proto"}{$srvcobject}{'name'} = $srvcobject	;
				}
				if ($checkrangesize >= 20000) {
					print "   S-ALERT:  Large high port range  \($checkrangesize ports\) in range object \"$srvcobject\"\n";
					print "   	     Ranges of this size      ^^^  should be considered    INSECURE\n";
					$srvcexceptions_ref->{$srvcobject} = 'high_port_range_to_large'		;
					$ports_ref->{"srvcexception_$proto"}{$srvcobject}{'name'} = $srvcobject	;
				}
				for (my $ix = $startport; $ix <= 65536; $ix++) {
					if (exists ($ports_ref->{$proto}{$ix})) {
						#print "HIGH YEPPER\n";
						$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$ix}++ 	;
						$duplports_ref->{$proto}{$ix}{'name'}{$srvcobject}++		;
					} else {
						#print "HIGH YEP\n";
						$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$ix}++ 	;
						$ports_ref->{$proto}{$ix}{'name'} = $srvcobject			;
					}
				}

		# NOTE:  process LESS THAN RANGE port objects

			} elsif ($portt =~ m/^\<\d+$/) {
				$portt 			=~ s/\<//;
				#print "AM I WORKING LOW?\n";
				my $startport 		= $portt;
				my $checkrangesize 	= $portt;
				if (($checkrangesize > 1000) && ($checkrangesize < 20000)) {
					print "   PRTINFO:  Large low port range   \($checkrangesize ports\) in range object \"$srvcobject\"\n";
					$srvcexceptions_ref->{$srvcobject} 				= 'low_port_range_to_large'	;
					$ports_ref->{"srvcexception_$proto"}{$srvcobject}{'name'} 	= $srvcobject			;
				}
				if ($checkrangesize >= 20000) {
					print "   S-ALERT:  Large low port range   \($checkrangesize ports\) in range object \"$srvcobject\"\n";
					print "   	     Ranges of this size      ^^^  should be considered    INSECURE\n";
					$srvcexceptions_ref->{$srvcobject} 				= 'low_port_range_to_large'	;
					$ports_ref->{"srvcexception_$proto"}{$srvcobject}{'name'} 	= $srvcobject			;
				}
				for (my $ix = $startport; $ix >= 1; $ix--) {
					if (exists ($ports_ref->{$proto}{$ix})) {
						#print "LOW YEPPER!!\n";
						$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$ix}++ ;
						$duplports_ref->{$proto}{$ix}{'name'}{$srvcobject}++	;
					} else {
						#print "LOW YEP!!\n";
						$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$ix}++ ;
						$ports_ref->{$proto}{$ix}{'name'} = $srvcobject		;
					}
				}

		# NOTE:  process PORT objects

	       		} else {
				if (exists ($ports_ref->{$proto}{$portt})) {
					$duplports_ref->{$proto}{$portt}{'name'}{$srvcobject}++		;
					$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$portt}++ 	;
				} else {
					$srvcobjects_ref->{$srvcobject}{'ports'}{$proto}{$portt}++ 	;
					$ports_ref->{$proto}{$portt}{'name'} = $srvcobject 		;
				}
			}
		}
	}

# NOTE: build port groups

	foreach my $groupns (keys %{$srvcgroupobjs_ref}) {
		foreach my $groupmm (keys %{$srvcgroupobjs_ref->{$groupns}}) {
			if (exists $srvcobjects_ref->{$groupmm}) {
				foreach my $groupmempro (keys %{$srvcobjects_ref->{$groupmm}{'ports'}}) {

					if (exists $srvcexceptions_ref->{$groupmm}) {
						$portgroups_ref->{$groupns}{"srvcexception_$groupmempro~$groupmm"}++;
					} else {
						foreach my $groupmempor (keys %{$srvcobjects_ref->{$groupmm}{'ports'}{$groupmempro}}) {
							$portgroups_ref->{$groupns}{"$groupmempro~$groupmempor"}++;
						}
					}
				}
			} else {
				$portgroups_ref->{$groupns}{"portunknown~$groupmm"}++ ;
			}
		}
	}
}

#===================================================================================================
# BUILDING THE RULEBASE BINARY HASH FOR MATCHING AGAINST
#===================================================================================================

sub build_rule_info {

	my ($binrules_ref,
	$nats_ref,
	$netgroupobjs_ref,
	$netobjects_ref,
	$ports_ref,
	$rashrules_ref,
	$ruleactions_ref,
	$rules_ref,
	$ruletypes_ref,
	$srvcexceptions_ref,
	$srvcgroupobjs_ref,
	$srvcobjects_ref) 	= @_;

	%{$rashrules_ref} 	= ()	; 
	my $rulebincount 	= 0	;
	my $rulebincountholder 	= 0	;
	my $rulebincountquick 	= 0	;

	my $natrulecount 	= 0	;

	foreach my $rulenum (sort numerically keys (%{$rules_ref})) {
		$ruletypes_ref->{$rules_ref->{$rulenum}{'type'}}++;
		$ruleactions_ref->{$rules_ref->{$rulenum}{'action'}}++;
		if (($rules_ref->{$rulenum}{'vpn'} ne 'Any') && ($rules_ref->{$rulenum}{'action'} ne 'Encrypt')) {
			$ruleactions_ref->{'Encrypt'}++;
		}
		my @rulesrcs = rule_net_obj_ungrouper($rulenum, 'src', $netobjects_ref, $netgroupobjs_ref, $rules_ref)	;
		foreach my $rulesrc (@rulesrcs) {
			foreach my $srcbin (keys (%{$netobjects_ref->{$rulesrc}{'ipbin'}})) {
				my @ruledsts = rule_net_obj_ungrouper($rulenum, 'dst', $netobjects_ref, $netgroupobjs_ref, $rules_ref)	;
				foreach my $ruledst (@ruledsts) {
					foreach my $dstbin (keys (%{$netobjects_ref->{$ruledst}{'ipbin'}})) {
						my @rulesrvcs = rule_srvc_obj_ungrouper($rulenum, $srvcobjects_ref, $srvcgroupobjs_ref, $rules_ref);
						foreach my $rulesrvc (@rulesrvcs) {
							if (exists ($srvcexceptions_ref->{$rulesrvc})) {
								foreach my $rangeproto (keys %{$srvcobjects_ref->{$rulesrvc}{'port'}}) {
									my $ruleproto = "srvcexception_$rangeproto"			; 
									my $ruleport  = $rulesrvc					;
									rule_bin_proc_add($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,$natrulecount,
												\$rulebincount,\$rulebincountquick,\$rulebincountholder,
												$netobjects_ref,$srvcobjects_ref,$rules_ref,$nats_ref,$rashrules_ref,$binrules_ref);
								}

							} elsif (exists ($srvcobjects_ref->{$rulesrvc}{'ports'})) {
								foreach my $ruleproto (keys (%{$srvcobjects_ref->{$rulesrvc}{'ports'}})) {
									foreach my $ruleport (keys (%{$srvcobjects_ref->{$rulesrvc}{'ports'}{$ruleproto}})) {
										rule_bin_proc_add($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,$natrulecount,
												\$rulebincount,\$rulebincountquick,\$rulebincountholder,
												$netobjects_ref,$srvcobjects_ref,$rules_ref,$nats_ref,$rashrules_ref,$binrules_ref);
									}
								}
							} else {
								$srvcobjects_ref->{$rulesrvc}{'ports'}{'portunknown'}{$rulesrvc}++ 	;
								$srvcobjects_ref->{$rulesrvc}{'port'}{'portunknown'} = $rulesrvc 	;
								$srvcobjects_ref->{$rulesrvc}{'type'} = 'portunknown' 			;
								$ports_ref->{'portunknown'}{$rulesrvc}{'name'} = $rulesrvc		;
								my $ruleproto = 'portunknown'						;
								my $ruleport  =  $rulesrvc   						;
								rule_bin_proc_add($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,$natrulecount,
											\$rulebincount,\$rulebincountquick,\$rulebincountholder,
											$netobjects_ref,$srvcobjects_ref,$rules_ref,$nats_ref,$rashrules_ref,$binrules_ref);
							}
						}
					}
				}
			}
		}
	}
	return ($rulebincount);
}

#===================================================================================================
# BUILDING THE NAT RULEBASE HASH from FWDOC format FOR MATCHING AGAINST
#===================================================================================================

# NOTE: I'm using fw doc format in odumper mode because I dont know how to export nat rules in odumper

sub build_natrule_info {

	my ($bingroups_ref,
	$config,
	$configtype,
	$ips_ref,
	$nats_ref,
	$netgroups_ref,
	$netobjects_ref,
	$srvcexceptions_ref,
	$srvcobjects_ref) = @_;

	my $natcount = 0					;
	my $natlinecountquick  = 0				;
	my $natlinecountholder = 0				;

	if ($configtype =~ /^od$|^cs$|^ns$/) {

	# NOTE: if file name exists read fwdoc style nats from file 

		if (exists $confignames{$config}{'natsfile'}) {

			my $routefile = $confignames{$config}{'natsfile'}			;
			open NATFILE, "$routefile" or warn "Can't open $routefile: $!\n"	; 

		# NOTE: read nats in the legendary fwdoc format

			while (<NATFILE>) {
				$_ =~ s/\n//g			;
				$_ =~ s/\r//g			;
				next if $_ =~ m/^Number/	;
				my ($number,$enabled,$origfrom,$origto,$origservice,$natfrom,$natto,$natservice,$installon,$comment) = split(/\t/, $_);
				$nats_ref->{$number}{'enabled'}   = $enabled		; 
				$nats_ref->{$number}{'installon'} = $installon		; 
				$nats_ref->{$number}{'comment'}   = $comment		; 
				$nats_ref->{$number}{'origsrc'}{$origfrom}++		; 
				$nats_ref->{$number}{'origdst'}{$origto}++		; 
				$nats_ref->{$number}{'origsrvc'}{$origservice}++	; 
				$nats_ref->{$number}{'natsrc'}   = $natfrom		; 
				$nats_ref->{$number}{'natdst'}   = $natto		; 
				$nats_ref->{$number}{'natsrvc'}  = $natservice		; 
			} 
		}

	# NOTE: in all cases process nat rules from rulebase and /or fwdoc csv nats 

		foreach my $number (sort numerically keys %{$nats_ref}) {
			my $enabled 	= $nats_ref->{$number}{'enabled'} 	;
			my $installon	= $nats_ref->{$number}{'installon'}	;
			my $comment	= $nats_ref->{$number}{'comment'}	;

			foreach my $origfrom (keys %{$nats_ref->{$number}{'origsrc'}}) {
				foreach my $origto (keys %{$nats_ref->{$number}{'origdst'}}) {
					foreach my $origservice (keys %{$nats_ref->{$number}{'origsrvc'}}) {
						my $natfrom     = $nats_ref->{$number}{'natsrc'};
						my $natto       = $nats_ref->{$number}{'natdst'};
						my $natservice  = $nats_ref->{$number}{'natsrvc'};

			
						unless (defined ($enabled) && defined ($origfrom) && defined ($origto) && defined ($origservice) && defined ($natfrom) && 
							defined ($natto) && defined ($natservice) && defined ($installon) && defined( $comment)) {

							print "   WARNING:  INCOMPLETE NAT RULE:  $number -  ";
							if (defined ($enabled)) 	{ print "ENABLED ($enabled) "		; }
							if (defined ($origfrom)) 	{ print "ORIGFROM ($origfrom) "		; }
							if (defined ($origto)) 		{ print "ORIGTO ($origto) "		; }
							if (defined ($origservice)) 	{ print "ORIGSERVICE ($origservice) "	; }
							if (defined ($natfrom)) 	{ print "NATFROM ($natfrom) "		; }
							if (defined ($natto)) 		{ print "NATTO ($natto) "		; }
							if (defined ($natservice)) 	{ print "NATSERVICE ($natservice) "	; }
							if (defined ($installon)) 	{ print "INSTALLON ($installon) "	; }
							if (defined ($comment)) 	{ print "COMMENT ($comment) "		; }
							print "\n";
							next;
						}

						if (exists $netobjects_ref->{$origfrom}) {
							$netobjects_ref->{$origfrom}{'natsrc'}{$natfrom} = $number ;
							$netobjects_ref->{$origfrom}{'natsrvc'}{$natservice} = $number ;

							foreach my $origfrombin (keys %{$netobjects_ref->{$origfrom}{'ipbin'}}) {
								$nats_ref->{$number}{'origsrcbins'}{$origfrombin}++	; 
								$natcount++					;
							}
						} elsif (exists $netgroups_ref->{$origfrom}) {
							foreach my $origfrombin (keys %{$bingroups_ref->{$origfrom}}) {
								my $origname = ipbin_to_name($origfrombin, $ips_ref);
								$netobjects_ref->{$origname}{'natsrc'}{$natfrom} = $number ;
								$netobjects_ref->{$origname}{'natsrvc'}{$natservice} = $number ;
								$nats_ref->{$number}{'origsrcbins'}{$origfrombin}++	; 
								$natcount++					;
							}
						} else {
							#print "FUCK!! $origfrom\n"				;
						}
						if (exists $netobjects_ref->{$origto}) {
							$netobjects_ref->{$origto}{'natdst'}{$natto} = $number ;
							$netobjects_ref->{$origto}{'natsrvc'}{$natservice} = $number ;

							foreach my $origtobin (keys %{$netobjects_ref->{$origto}{'ipbin'}}) {
								$nats_ref->{$number}{'origdstbins'}{$origtobin}++	; 
								$natcount++					;
							}
						} elsif (exists $netgroups_ref->{$origto}) {
							foreach my $origtobin (keys %{$bingroups_ref->{$origto}}) {
								my $origname = ipbin_to_name($origtobin, $ips_ref);
								$netobjects_ref->{$origname}{'natdst'}{$natto} = $number ;
								$netobjects_ref->{$origname}{'natsrvc'}{$natservice} = $number ;
								$nats_ref->{$number}{'origdstbins'}{$origtobin}++	; 
								$natcount++					;
							}
						} else {
							$natcount++						;
							#print "COCK!! $origto, $number\n"			;
						}
						if (exists $netgroups_ref->{$natto}) {
							$natcount++						;
							#print "OH FUCK! $natto, $number\n"			;
						}
						if (exists $netgroups_ref->{$natfrom}) {
							$natcount++						;
							#print "OH NOO! $natfrom, $number\n"			;
						}
						if (exists $srvcobjects_ref->{$origservice}) {
							#print "COOOL: $origservice\n";
							foreach my $origproto (keys %{$srvcobjects_ref->{$origservice}{'ports'}}) {
								#print "COOOL:: $origservice\n";
								foreach my $origport (keys %{$srvcobjects_ref->{$origservice}{'ports'}{$origproto}}) {

									if (exists $srvcexceptions_ref->{$origservice}) {
							
										$nats_ref->{$number}{'origsrvcports'}{"srvcexception_$origproto"}{$origservice}++;
										$natcount++			;
										last;

									} else {
							
										$nats_ref->{$number}{'origsrvcports'}{$origproto}{$origport}++;
										$natcount++			;
									}
									if ($natcount >= ($natlinecountquick + 500)) {
										print ".";
										$natlinecountquick = $natcount;
									}
									if ($natcount >= ($natlinecountholder + 25000)) {
										print ".$natcount	nat matches processed\n";
										$natlinecountholder = $natcount;
									}
								}
							}
						}
						if ($natcount >= ($natlinecountquick + 500)) {
							print ".";
							$natlinecountquick = $natcount;
						}
						if ($natcount >= ($natlinecountholder + 25000)) {
							print ".$natcount	nat matches processed\n";
							$natlinecountholder = $natcount;
						}
					}
				}
			}
		}
	}
	return $natcount;
}

