#===================================================================================================
# OPENING THE LOG FILE
#===================================================================================================
	
sub read_netscreen_logfile {

	my ($config,
	$confignames_ref,
	$configtype,
	$ports_ref,
	$daystree_ref,
       	$logfiles_aref,
	$loglinecount,
	$loglinecountholder,
	$loglinecountquick,
	$srvcstree_ref,
	$uniqueiphits_ref,
	$proccount_sref) = @_;

	foreach my $currentlogfile (@$logfiles_aref ) {

		open LOGFILE, "$currentlogfile" or warn "Can't open $currentlogfile: $!\n"	;        
	
#---------------------------------------------------------------------------------------------
# NETSCREEN LOG FILE ANALYSIS
#---------------------------------------------------------------------------------------------
	
		my %protos;
		my %actions;
		$protos{1}	= 'icmp'	;
		$protos{2}	= 'igmp'	;
		$protos{6}	= 'tcp'		;
		$protos{17}	= 'udp'		;
		$protos{47}	= 'GRE'		;
		$protos{50}	= 'AH'		;
		$protos{51}	= 'ESP'		;
		$protos{112}	= 'vrrp'	;
		$protos{115}	= 'l2tp'	;

		while (<LOGFILE>) {
		        chomp;
		        my @line 	= shellwords($_);
			my $date 	= "$line[0].$line[1]";
			my $time 	= $line[2];
			my $origin_id 	= $line[3];
			my $version	= $line[4];
			my $dev_id	= $line[6];
			my $logtype	= $line[8];
			my $functype	= $line[9];
			my ($starttime,$duration,$rbnum,$service,$proto,$srczone,$dstzone,$action,$sent,$rcvd,$src,$dst,$icmp,$srcport,$dstport,$srcxlate,$dstxlate,$xlsrcport,$xldstport);

			for (my $i = 3; $i <= $#line; $i++) {
				#if ($line[$i] 		=~ m/^start_time=/) 	{ $starttime  	= $line[$i] 		; $starttime	=~ s/^start_time=// 	; 	}	#print "starttime $starttime\n";
				#elsif ($line[$i] 	=~ m/^duration=/) 	{ $duration 	= $line[$i] 		; $duration 	=~ s/^duration=//  	; 	}	#print "duration $duration\n"; 
				   if ($line[$i] 	=~ m/^policy_id=/)	{ $rbnum 	= $line[$i] 		; $rbnum 	=~ s/^policy_id=//	; 	} 	#print "policy $rbnum\n";
				elsif ($line[$i] 	=~ m/^service=/)	{ $service	= $line[$i] 		; $service	=~ s/^service=//	; 	}	#print "service $service\n";
				elsif ($line[$i] 	=~ m/^proto=/)		{ $proto	= $line[$i]		; $proto	=~ s/^proto=//		; 	}	#print "proto $proto\n";
				elsif (($line[$i] =~ m/^src$/) && ($line[$i + 1] =~ m/^zone=/)){ $srczone = $line[$i + 1]; $srczone	=~ s/^zone=//		; $i++ ;} 	#print "src zone $srczone\n";
				elsif (($line[$i] =~ m/^dst$/) && ($line[$i + 1] =~ m/^zone=/)){ $dstzone = $line[$i + 1]; $dstzone	=~ s/^zone=//		; $i++ ;} 	#print "dst zone $dstzone\n";
				elsif ($line[$i] 	=~ m/^action=/)		{ $action	= $line[$i]		; $action	=~ s/^action=//		; 	}	#print "action $action\n";
				#elsif ($line[$i] 	=~ m/^sent=/)		{ $sent		= $line[$i]		; $sent		=~ s/^sent=//		; 	}	#print "sent $sent\n";	
				#elsif ($line[$i] 	=~ m/^rcvd=/)		{ $rcvd		= $line[$i]		; $rcvd		=~ s/^rcvd=//		; 	}	#print "rcvd $rcvd\n";
				elsif ($line[$i] 	=~ m/^src=/)		{ $src		= $line[$i]		; $src		=~ s/^src=//		; 	}	#print "src $src\n";
				elsif ($line[$i] 	=~ m/^dst=/)		{ $dst		= $line[$i]		; $dst		=~ s/^dst=//		; 	}	#print "dst $dst\n";
				elsif ($line[$i] 	=~ m/^icmp/)		{ $icmp		= $line[$i + 1]		; $icmp		=~ s/^type=//		; 	}	#print "icmp $icmp\n";
				elsif ($line[$i] 	=~ m/^src_port=/)	{ $srcport	= $line[$i]		; $srcport	=~ s/^src_port=//	; 	}	#print "src port $srcport\n";
				elsif ($line[$i] 	=~ m/^dst_port=/)	{ $dstport	= $line[$i]		; $dstport	=~ s/^dst_port=//	; 	}	#print "dst port $dstport\n";
				elsif ($line[$i] 	=~ m/^src-xlated$/)	{ $srcxlate	= $line[$i + 1]		; $srcxlate	=~ s/^ip=//		; $i++ ;	#print "src xlate $srcxlate\n"; 
					if ($line[$i + 1] =~ m/^port=/)		{ $xlsrcport 	= $line[$i + 1] 	; $xlsrcport	=~ s/^port=//		; $i++ ;} 	#print "src xlate port $xlsrcport\n"; 
				}
				elsif ($line[$i] =~ m/dst-xlated$/)		{ $dstxlate	= $line[$i + 1]		; $dstxlate	=~ s/^ip=//		; $i++ ; 	#print "dst xlate $dstxlate\n";	
					if ($line[$i + 1] =~ m/^port=/)		{ $xldstport 	= $line[$i + 1] 	; $xldstport	=~ s/^port=//		; $i++ ;} 	#print "dst xlate port $xldstport\n";
				}
			}

			my @hour 	= split ( ':', $time ) 								;
			my $hour 	= $hour[0]									;

			if ($logparsetype eq 'normal') {

				if (defined ($src) && defined($dst) && defined($proto) && ($action eq 'Permit') && (defined($dstport) || defined($service) || defined($icmp))) {

					$$proccount_sref++;

					if ($service ne "") {
						if ($service =~ '/port:')   {($proto, $service)		= split('/port:', $service)	; }
						if (exists $protos{$proto}) {$proto 			= $protos{$proto}		; }
						#print "$proto, $service, ";
						if ($proto eq 'udp') {
							if (exists $srvcstree_ref->{$src}
							 && exists $srvcstree_ref->{$src}{$dst}
							 && exists $srvcstree_ref->{$src}{$dst}{'udp'}
							 && exists $srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}) {

								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'rules'}{$rbnum}++;
								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'zones'} = "$dstzone~$srczone";

								if (defined ($dstxlate)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatdst'}{$srcxlate} = $rbnum;
								}
								if (defined ($srcxlate)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatsrc'}{$dstxlate} = $rbnum;
								}
								if (defined ($xldstport)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatsrvc'}{$xlsrcport} = $rbnum;
								}
								#print "PING2!\n $_";

							} elsif ( port_isnt_known('udp', $dstport, $ports_ref) && port_is_known('udp', $srcport, $ports_ref) ) {

								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'rules'}{$rbnum}++;
								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'zones'} = "$dstzone~$srczone";

								if (defined ($dstxlate)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatdst'}{$srcxlate} = $rbnum;
								}
								if (defined ($srcxlate)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatsrc'}{$dstxlate} = $rbnum;
								}
								if (defined ($xldstport)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatsrvc'}{$xlsrcport} = $rbnum;
								}
								#print "WANGER2!\n $_";

							} else {

								$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'rules'}{$rbnum}++			;
								$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'zones'} = "$srczone~$dstzone"		;

								if (defined ($dstxlate)) {
									$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'lognatdst'}{$dstxlate} = $rbnum;
								}
								if (defined ($srcxlate)) {
									$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'lognatsrc'}{$srcxlate} = $rbnum;
								}
								if (defined ($xldstport)) {
									$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'lognatsrvc'}{$xldstport} = $rbnum;
								}
							}
						} else {

							if (defined($srcport) && $srcport eq '20') {	$service = $srcport; }
							$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'rules'}{$rbnum}++			;
							$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'zones'} = "$srczone~$dstzone"		;

							if (defined ($dstxlate)) {
								$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'lognatdst'}{$dstxlate} = $rbnum;
							}
							if (defined ($srcxlate)) {
								$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'lognatsrc'}{$srcxlate} = $rbnum;
							}
							if (defined ($xldstport)) {
								$srvcstree_ref->{$dst}{$src}{$proto}{$service}{'lognatsrvc'}{$xldstport} = $rbnum;
							}
						}
					}

					if (defined $dstport && $dstport ne "") {
						if (exists $protos{$proto}) {$proto 				= $protos{$proto}	; }
						#print "2nd: $proto, $dstport, ";
						if ($proto eq 'udp') {
							if (exists $srvcstree_ref->{$src}
							 && exists $srvcstree_ref->{$src}{$dst}
							 && exists $srvcstree_ref->{$src}{$dst}{'udp'}
							 && exists $srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}) {

								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'rules'}{$rbnum}++;
								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'zones'} = "$dstzone~$srczone";

								if (defined ($dstxlate)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatdst'}{$srcxlate} = $rbnum;
								}
								if (defined ($srcxlate)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatsrc'}{$dstxlate} = $rbnum;
								}
								if (defined ($xldstport)) {
									$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'lognatsrvc'}{$xlsrcport} = $rbnum;
								}
								#print "PING2!\n $_";

							} elsif ( port_isnt_known('udp', $dstport, $ports_ref) && port_is_known('udp', $srcport, $ports_ref) ) {

								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'rules'}{$rbnum}++;
								$srvcstree_ref->{$src}{$dst}{'udp'}{$srcport}{'zones'} = "$dstzone~$srczone";

								if (defined ($dstxlate)) {
