#===================================================================================================
# CISCO SYSLOG ENTRY LOG READERS
#===================================================================================================

sub read_cisco_logs {
	
	my ($config,
	$confignames_ref,
	$ports_ref,
	$daystree_ref,
       	$logfiles_aref,
	$loglinecount,
	$loglinecountholder,
	$loglinecountquick,
	$srvcstree_ref,
	$proccount_sref) = @_;

	foreach my $currentlogfile (@$logfiles_aref ) {

		open LOGFILE, "$currentlogfile" or warn "Can't open $currentlogfile: $!\n"	;        
	
		while (<LOGFILE>) {

			my $hitcount = 1;

			if ($logparsetype eq 'normal') {

				if (/You have an error in your SQL syntax/) {
					print "\n    WARNING:  $_";
					next;
				}

				if (/\%ASA-6-302013/) {
					next if /last message repeated/;
					$$proccount_sref++;
					
				# NOTE: Read Build TCP connection log entry

					my @line     = split(/\s+/, $_);
					my $i        = 0;
					my $offset   = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-6-302013:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourceintip, $sourceint, $sourceip, $sourceport);
					my ($dest, $destintip, $destint, $destip, $destport);

					if ($line[2 + $offset] eq 'inbound') {

						($source, $dest) = ($line[7 + $offset], $line[10 + $offset]) ;

					} elsif ($line[2 + $offset] eq 'outbound') {

						($dest, $source) = ($line[7 + $offset], $line[10 + $offset]) ;

					} else {
						#print "Error: $_\n";
					}
					#print "SRC: $source, DST: $dest\n";

					($sourceintip, $sourceport)     = split(/\//, $source);
					($destintip, $destport)         = split(/\//, $dest);

					($sourceint, $sourceip)         = split(/\:/, $sourceintip);
					($destint, $destip)             = split(/\:/, $destintip);

					if ($sourceport eq '20') {	$destport = $sourceport; }

					$srvcstree_ref->{$destip}{$sourceip}{'tcp'}{$destport}{'rules'}{'0'} += $hitcount;

				} elsif (/\%ASA-6-302015/) {
					next if /last message repeated/;
					$$proccount_sref++;
					
				# NOTE: Read Build UDP connection log entry

					my @line = split(/\s+/, $_);
					my $i = 0;
					my $offset = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-6-302015:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourceintip, $sourceint, $sourceip, $sourceport);
					my ($dest, $destintip, $destint, $destip, $destport);

					if ($line[2 + $offset] eq 'inbound') {

						($source, $dest) = ($line[7 + $offset], $line[10 + $offset]) ;

					} elsif ($line[2 + $offset] eq 'outbound') {

						($dest, $source) = ($line[7 + $offset], $line[10 + $offset]) ;

					} else {
						#print "Error: $_\n";
					}
					#print "SRC: $source, DST: $dest\n";

					($sourceintip, $sourceport)     = split(/\//, $source);
					($destintip, $destport)         = split(/\//, $dest);

					($destint, $destip)             = split(/\:/, $destintip);
					($sourceint, $sourceip)         = split(/\:/, $sourceintip);


					if (exists $srvcstree_ref->{$sourceip}
					 && exists $srvcstree_ref->{$sourceip}{$destip}
					 && exists $srvcstree_ref->{$sourceip}{$destip}{'udp'}
					 && exists $srvcstree_ref->{$sourceip}{$destip}{'udp'}{$sourceport}) {

						$srvcstree_ref->{$sourceip}{$destip}{'udp'}{$sourceport}{'rules'}{'0'} += $hitcount;

					} elsif ( port_isnt_known('udp', $destport, $ports_ref) && port_is_known('udp', $sourceport, $ports_ref) ) {

						$srvcstree_ref->{$sourceip}{$destip}{'udp'}{$sourceport}{'rules'}{'0'} += $hitcount;

					} else {

						$srvcstree_ref->{$destip}{$sourceip}{'udp'}{$destport}{'rules'}{'0'} += $hitcount;
					}


				} elsif (/\%ASA-6-302020/) {
					next if /last message repeated/;
					$$proccount_sref++;

				# NOTE: Read Built ICMP connection log entry

					my @line = split(/\s+/, $_);
					my $i = 0;
					my $offset = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-6-302020:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourceip, $seqnum);         # , $srcxlate );
					my ($dest, $destip, $destport);  # , $dstxlate, $xldstport);

					if ($line[2 + $offset] eq 'inbound') {

						($source, $dest) = ($line[7 + $offset], $line[9 + $offset]) ;
						#print "In SRC: $source, DST: $dest\n";

						($sourceip, $seqnum) = split(/\//, $source);
						($destip, $destport) = split(/\//, $dest);

						if (($seqnum < $destport) || ($destport > 32)) {
							$destport = $seqnum;
							my $temp  = $sourceip;
							$sourceip = $destip;
							$destip   = $temp;
						}
						#print "In Proc SRC: $sourceip  DST: $destip , $destport\n";

					} elsif ($line[2 + $offset] eq 'outbound') {

						($dest, $source) = ($line[7 + $offset], $line[9 + $offset]) ;
						#print "Out SRC: $source, DST: $dest\n";

						($sourceip, $destport) = split(/\//, $source);
						($destip, $seqnum)     = split(/\//, $dest);

						if (($seqnum < $destport) || ($destport > 32)) {
							#print "PING4!\n";
							$destport = $seqnum;
							my $temp  = $sourceip;
							$sourceip = $destip;
							$destip   = $temp;
						}
						#print "Out Proc SRC: $sourceip  DST: $destip , $destport\n";

					} else {
						#print "Error: $_\n";
					}


					$srvcstree_ref->{$destip}{$sourceip}{'icmp'}{$destport}{'rules'}{'0'} += $hitcount;

				} elsif (/\%ASA-6-106100/) {
					next if /last message repeated/;
					$$proccount_sref++;

				# NOTE: Read Built Access-List match connection log entry

					my @line = split(/\s+/, $_);
					my $i = 0;
					my $offset = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-6-106100:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourcevlan, $sourceip, $sourceport);
					my ($dest, $destvlan, $destip, $destport);
					my ($hitcnt, $action, $proto);

					($action, $proto, $source, $dest, $hitcnt) = ($line[3 + $offset], $line[4 + $offset], $line[5 + $offset], $line[7 + $offset], $line[9 + $offset]) ;

					($sourcevlan, $sourceip, $sourceport)     = split(/\/|\(|\)/, $source);
					($destvlan, $destip, $destport)         = split(/\/|\(|\)/, $dest);

					if (($logparsetype eq 'normal') && ($action eq 'permitted')) {
						$srvcstree_ref->{$destip}{$sourceip}{$proto}{$destport}{'rules'}{'0'} += ($hitcnt * $hitcount);
					}

				}

				$loglinecount++	;
				if ($loglinecount >= ($loglinecountquick + 10000)) {
					print "." ;
					$loglinecountquick = $loglinecount;
				}
				if ($loglinecount >= ($loglinecountholder + 500000)) {
					print "\r...................................................$loglinecount	lines read\n";
					$loglinecountholder = $loglinecount;
				}

			} else {

				if (/You have an error in your SQL syntax/) {
					print "\n    WARNING:  $_";
					next;
				}

				if (/\%ASA-4-106023/) {
					#print "$_";

					next if /last message repeated/;
					$$proccount_sref++;
					
				# NOTE: Read Deny TCP connection log entry

					my @line = split(/\s+/, $_);
					my $i = 0;
					my $offset = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-4-106023:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourceintip, $sourceint, $sourceip, $sourceport);
					my ($dest, $destintip, $destint, $destip, $destport);
					my ($accesslist, $protocol);

					#print "SRC: $source, DST: $dest\n";

					if ($line[2 + $offset] =~ /^tcp$|^udp$/) {
						
						($protocol, $source, $dest, $accesslist) = ($line[2 + $offset], $line[4 + $offset], $line[6 + $offset], $line[9 + $offset]) ;

						($sourceintip, $sourceport)     = split(/\//, $source);
						($destintip, $destport)         = split(/\//, $dest);

						($sourceint, $sourceip)         = split(/\:/, $sourceintip);
						($destint, $destip)             = split(/\:/, $destintip);

