						#print "$hitcount\n";
					}

					my ($source, $sourceintip, $sourceint, $sourceip, $sourceport);
					my ($dest, $destintip, $destint, $destip, $destport);
					my $proto;

					($proto, $source, $dest) = ($line[3 + $offset], $line[5 + $offset], $line[7 + $offset]) ;
					
					$proto = lc($proto);

					#print "SRC: $source, DST: $dest\n";

					($sourceip, $sourceport)     = split(/\//, $source);
					($destip, $destport)         = split(/\//, $dest);

					if (exists $srvcstree_ref->{$sourceip}
					 && exists $srvcstree_ref->{$sourceip}{$destip}
					 && exists $srvcstree_ref->{$sourceip}{$destip}{$proto}
					 && exists $srvcstree_ref->{$sourceip}{$destip}{$proto}{$sourceport}) {

						$srvcstree_ref->{$sourceip}{$destip}{$proto}{$sourceport}{'rules'}{'0'} += $hitcount;
						$srvcstree_ref->{$sourceip}{$destip}{$proto}{$sourceport}{'denypolicy'}{"$line[1 + $offset] $line[2 + $offset] $line[3 + $offset] $line[8 + $offset] $line[9 + $offset] $line[10 + $offset] $line[11 + $offset]"} += $hitcount;

					} elsif ( (port_isnt_known($proto, $destport, $ports_ref) && port_is_known($proto, $sourceport, $ports_ref)) || ($sourceport =~ /^135$|^139$|^445$/) ) {

						$srvcstree_ref->{$sourceip}{$destip}{$proto}{$sourceport}{'rules'}{'0'} += $hitcount;
						$srvcstree_ref->{$sourceip}{$destip}{$proto}{$sourceport}{'denypolicy'}{"$line[1 + $offset] $line[2 + $offset] $line[3 + $offset] $line[8 + $offset] $line[9 + $offset] $line[10 + $offset] $line[11 + $offset]"} += $hitcount;

					} else {

						$srvcstree_ref->{$destip}{$sourceip}{$proto}{$destport}{'rules'}{'0'} += $hitcount;
						$srvcstree_ref->{$destip}{$sourceip}{$proto}{$destport}{'denypolicy'}{"$line[1 + $offset] $line[2 + $offset] $line[3 + $offset] $line[8 + $offset] $line[9 + $offset] $line[10 + $offset] $line[11 + $offset]"} += $hitcount;
					}

				} elsif (/\%ASA-3-106014/) {
					#print "$_";

					next if /last message repeated/;
					$$proccount_sref++;
					
				# NOTE: Read Build UDP connection log entry

					my @line = split(/\s+/, $_);
					my $i = 0;
					my $offset = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-3-106014:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourceintip, $sourceint, $sourceip, $sourceport);
					my ($dest, $destintip, $destint, $destip, $destport);
					my ($protocol, $type, $code);


					#print "SRC: $source, DST: $dest\n";

					($protocol, $source, $dest, $type, $code) = ($line[3 + $offset], $line[5 + $offset], $line[7 + $offset], $line[9 + $offset], $line[11 + $offset]) ;

					($sourceint, $sourceip)         = split(/\:/, $source);
					($destint, $destip)             = split(/\:/, $dest);

					$type =~ s/,//;
					$destport = $type;

					$srvcstree_ref->{$destip}{$sourceip}{$protocol}{$destport}{'rules'}{'0'} += $hitcount;
					$srvcstree_ref->{$destip}{$sourceip}{$protocol}{$destport}{'denypolicy'}{"$line[1 + $offset] $line[2 + $offset] $line[3 + $offset] $line[8 + $offset] $line[9 + $offset] $line[10 + $offset] $line[11 + $offset]"} += $hitcount;

				} elsif (/\%ASA-6-106100/) {
					#print "$_";

					next if /last message repeated/;
					$$proccount_sref++;

				# NOTE: Read Built Access-List match connection log entry

					my @line = split(/\s+/, $_);
					my $i = 0;
					my $offset = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-6-106100:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourcevlan, $sourceip, $sourceport);
					my ($dest, $destvlan, $destip, $destport);
					my ($hitcnt, $action, $proto);

					($action, $proto, $source, $dest, $hitcnt) = ($line[3 + $offset], $line[4 + $offset], $line[5 + $offset], $line[7 + $offset], $line[9 + $offset]) ;

					($sourcevlan, $sourceip, $sourceport)     = split(/\/|\(|\)/, $source);
					($destvlan, $destip, $destport)         = split(/\/|\(|\)/, $dest);

					if (($logparsetype ne 'normal') && ($action eq 'denied')) {
						$srvcstree_ref->{$destip}{$sourceip}{$proto}{$destport}{'rules'}{'0'} += ($hitcnt * $hitcount);
						$srvcstree_ref->{$destip}{$sourceip}{$proto}{$destport}{'denypolicy'}{"$line[7 + $offset] $line[8 + $offset] $line[9 + $offset] $line[10 + $offset] $line[11 + $offset]"} += $hitcount;
					}

				} elsif (/\%ASA-4-313004/) {
					#print "$_";

					next if /last message repeated/;
					$$proccount_sref++;

				# NOTE: Read Denied ICMP type message

					my @line = split(/\s+/, $_);
					my $i = 0;
					my $offset = 0;
					foreach my $linelem (@line) {
						if ($linelem eq '%ASA-4-313004:') {
							$offset = $i;
							last;
						}
						$i++;
					}

					if ($_ =~ /message repeated \d+ times/) {
						$offset += 5;
						$line[$#line] =~ s/\]\s*$//;
						$hitcount = $line[-2 + $offset];
						#print "$hitcount\n";
					}

					my ($source, $sourcevlan, $sourceip, $sourceport);
					my ($dest, $destvlan, $destip, $destport);
					my ($interface, $proto);

					($proto, $source, $dest, $interface, $destport) = ($line[2 + $offset], $line[6 + $offset], $line[11 + $offset], $line[9 + $offset], $line[3 + $offset]) ;
					$proto = lc($proto);
					$destport =~ s/type=//;
					$destport =~ s/,//;
					$dest     =~ s/\:$//;

					$srvcstree_ref->{$dest}{$source}{$proto}{$destport}{'rules'}{'0'} += $hitcount;
					$srvcstree_ref->{$dest}{$source}{$proto}{$destport}{'denypolicy'}{"$line[1 + $offset] $line[2 + $offset] $line[7 + $offset] $line[8 + $offset] $line[9 + $offset] $line[12 + $offset] $line[13 + $offset] $line[14 + $offset]"} += $hitcount;

				}

				$loglinecount++	;
				if ($loglinecount >= ($loglinecountquick + 10000)) {
					print "." ;
					$loglinecountquick = $loglinecount;
				}
				if ($loglinecount >= ($loglinecountholder + 500000)) {
					print "\r...................................................$loglinecount	lines read\n";
					$loglinecountholder = $loglinecount;
				}
			}
		}
		close LOGFILE;
	}
	return $loglinecount;
}


#===================================================================================================
# BUILD THE FILTER TREE OF SEEN CONNECTIONS FROM LOGS
#===================================================================================================

sub build_binary_log {
	
	my ($ips_ref,
	$logbins_ref,
	$netobjects_ref,
	$ports_ref,
	$srvcexceptions_ref,
	$srvcobjects_ref,
	$srvcstree_ref) = @_;

	print "-----------------------------------------------------------------------------------------\n";
	print " STARTING BINARY LOG OBJECT ANALYSIS:\n";
	
	my $logbincount = 0;
	my $logbincheck = 0;
	my %missedobjs;
	foreach my $logdst (keys %{$srvcstree_ref}) {
		foreach my $logsrc (keys %{$srvcstree_ref->{$logdst}}) {
			foreach my $logproto (keys %{$srvcstree_ref->{$logdst}{$logsrc}}) {
				foreach my $logport (keys %{$srvcstree_ref->{$logdst}{$logsrc}{$logproto}}) {

					my $logentry_ref = $srvcstree_ref->{$logdst}{$logsrc}{$logproto}{$logport};

					foreach my $logrule (keys %{$logentry_ref->{'rules'}}) {

						if ($logrule eq "") {
							$missedobjs{"    WARNING:  NO RULE listed for connection: $logdst, $logsrc, $logport"}++;
						}

						my $hits = $logentry_ref->{'rules'}{$logrule};
						$logbincheck++;
						#print "$logdst, $logsrc, $logproto, $logport, $logrule\n";
						my (@bindsts, @binsrcs, @portnums) ;

					# NOTE: if DESTINATION log object exists in config

						if (exists $netobjects_ref->{$logdst}) {

						# NOTE: add service and rule usage info to netobject 

							$netobjects_ref->{$logdst}{'logdstrules'}{$logrule} += $hits;
							$netobjects_ref->{$logdst}{'logdstsrvcs'}{"$logproto~$logport"} += $hits;

							if (exists $logentry_ref->{'lognatdst'}) {
								foreach my $lognatdst (keys %{$logentry_ref->{'lognatdst'}}) {
									$netobjects_ref->{$logdst}{'lognatdst'}{$lognatdst} = $logrule;
								}
							}
							if (exists $logentry_ref->{'lognatsrvc'}) {
								foreach my $lognatsrvc (keys %{$logentry_ref->{'lognatsrvc'}}) {
									$netobjects_ref->{$logdst}{'lognatsrvc'}{$lognatsrvc} = $logrule;
								}
							}
									
						# NOTE: check zone details

							if (exists $logentry_ref->{'zones'}) {
								my ($srczone, $dstzone) = split(/\~/, $logentry_ref->{'zones'});
								if (exists $netobjects_ref->{$logdst}{'zone'} && ($dstzone ne $netobjects_ref->{$logdst}{'zone'})) {
									$missedobjs{"    ZONEINF:  LOG DEST OBJECT: $logdst RESIDES IN ZONE: $dstzone WHILE THE CONFIG OBJECTS ZONE IS: $netobjects_ref->{$logdst}{'zone'}"}++;
								} else {
									unless (exists $netobjects_ref->{$logdst}{'zone'}) {
										$netobjects_ref->{$logdst}{'zone'} = $dstzone;
									}
								}
							}

							foreach my $dstbin (keys %{$netobjects_ref->{$logdst}{'ipbin'}} ) {
								if (exists $logentry_ref->{'zones'}) {
									my ($srczone, $dstzone) = split(/\~/, $logentry_ref->{'zones'});
									if (exists $ips_ref->{$dstbin}{'zone'} && ($dstzone ne $ips_ref->{$dstbin}{'zone'})) {
										$missedobjs{"    ZONEINF:  LOG DEST BIN: $logdst RESIDES IN ZONE: $dstzone WHILE THE CONFIG BINS ZONE IS: $ips_ref->{$dstbin}{'zone'}"}++;
									} else {
										unless (exists $ips_ref->{$dstbin}{'zone'}) {
											$ips_ref->{$dstbin}{'zone'} = $dstzone;
										}
									}
								}
								push (@bindsts, $dstbin);
							}

					# NOTE: if DESTINATION log object is an IP that exists in the config

						} elsif (is_ip($logdst)) {
							my $dstbin = ip_to_bin($logdst);

						# NOTE: check zone details

							if (exists $logentry_ref->{'zones'}) {
								my ($srczone, $dstzone) = split(/\~/, $logentry_ref->{'zones'});
								if (exists $ips_ref->{$dstbin} && exists $ips_ref->{$dstbin}{'zone'} && ($dstzone ne $ips_ref->{$dstbin}{'zone'})) {
									$missedobjs{"    ZONEINF:  LOG IP DEST BIN: $logdst MATCHED BIN OBJ: $ips_ref->{$dstbin}{'name'} IT RESIDES IN ZONE: $dstzone WHILE THE CONFIG BINS ZONE IS: $ips_ref->{$dstbin}{'zone'}"}++;
								} elsif (exists $ips_ref->{$dstbin}) {
									unless (exists $ips_ref->{$dstbin}{'zone'}) {
										$ips_ref->{$dstbin}{'zone'} = $dstzone;
									}
								} else {
									my $workingdstbin = $dstbin;
									until (exists $ips_ref->{$workingdstbin} || $workingdstbin eq "") {
										chop $workingdstbin;
									}
									if (($workingdstbin ne "") && exists $ips_ref->{$workingdstbin}{'zone'} && ($dstzone ne $ips_ref->{$workingdstbin}{'zone'})) {
										$missedobjs{"    ZONEINF:  LOG NET DEST BIN: $logdst MATCHED NET BIN OBJ: $ips_ref->{$workingdstbin}{'name'} IT RESIDES IN ZONE: $dstzone WHILE THE CONFIG NET BINS ZONE IS: $ips_ref->{$workingdstbin}{'zone'}"}++;
									} elsif (($workingdstbin ne "") && exists $ips_ref->{$workingdstbin}) {
										unless (exists $ips_ref->{$workingdstbin}{'zone'}) {
											$ips_ref->{$workingdstbin}{'zone'} = $dstzone;
										}
									}
								}
							}

						# NOTE: add service and rule usage info to netobject resolved via IP

							my $workingdstbin = $dstbin;
							until (exists $ips_ref->{$workingdstbin} || $workingdstbin eq "") {
								chop $workingdstbin;
							}
							if (exists $ips_ref->{$workingdstbin}) {
								my $name = $ips_ref->{$workingdstbin}{'name'};
								$netobjects_ref->{$name}{'logdstrules'}{$logrule}+= $hits;
								$netobjects_ref->{$name}{'logdstsrvcs'}{"$logproto~$logport"}+= $hits;

								if (exists $logentry_ref->{'lognatdst'}) {
									foreach my $lognatdst (keys %{$logentry_ref->{'lognatdst'}}) {
										$netobjects_ref->{$name}{'lognatdst'}{$lognatdst} = $logrule;
									}
								}
								if (exists $logentry_ref->{'lognatsrvc'}) {
									foreach my $lognatsrvc (keys %{$logentry_ref->{'lognatsrvc'}}) {
										$netobjects_ref->{$name}{'lognatsrvc'}{$lognatsrvc} = $logrule;
									}
								}
							}

							push (@bindsts, $dstbin);
						} else {
							$missedobjs{"    WARNING:  DST log object UNKNOWN: $logdst"}++;
						}

					# NOTE: if SOURCE log object exists in the config
							
						if (exists $netobjects_ref->{$logsrc}) {

						# NOTE: add service and rule usage info to netobject 

							$netobjects_ref->{$logsrc}{'logdstrules'}{$logrule}+= $hits;
							$netobjects_ref->{$logsrc}{'logdstsrvcs'}{"$logproto~$logport"}+= $hits;

							if (exists $logentry_ref->{'lognatsrc'}) {
								foreach my $lognatsrc (keys %{$logentry_ref->{'lognatsrc'}}) {
									$netobjects_ref->{$logsrc}{'lognatsrc'}{$lognatsrc} = $logrule;
								}
							}

							if (exists $logentry_ref->{'zones'}) {
								my ($srczone, $dstzone) = split(/\~/, $logentry_ref->{'zones'});
								if (exists $netobjects_ref->{$logsrc}{'zone'} && ($srczone ne $netobjects_ref->{$logsrc}{'zone'})) {
									$missedobjs{"    ZONEINF:  LOG SRC OBJECT: $logsrc RESIDES IN ZONE: $srczone WHILE THE CONFIG OBJECTS ZONE IS: $netobjects_ref->{$logsrc}{'zone'}"}++;
								} else {
									unless (exists $netobjects_ref->{$logsrc}{'zone'}) {
										$netobjects_ref->{$logsrc}{'zone'} = $srczone;
									}
								}
							}

							foreach my $srcbin (keys %{$netobjects_ref->{$logsrc}{'ipbin'}} ) {
								if (exists $logentry_ref->{'zones'}) {
									my ($srczone, $dstzone) = split(/\~/, $logentry_ref->{'zones'});
									if (exists $ips_ref->{$srcbin}{'zone'} && ($srczone ne $ips_ref->{$srcbin}{'zone'})) {
										$missedobjs{"    ZONEINF:  LOG SRC BIN: $logsrc RESIDES IN ZONE: $srczone WHILE THE CONFIG BINS ZONE IS: $ips_ref->{$srcbin}{'zone'}"}++;
									} elsif (exists $ips_ref->{$srcbin}) {
										unless (exists $ips_ref->{$srcbin}{'zone'}) {
											$ips_ref->{$srcbin}{'zone'} = $srczone;
										}
									}
								}
								push (@binsrcs, $srcbin);
							}

					# NOTE: if SOURCE log object is an IP that exists in the config

						} elsif (is_ip($logsrc)) {
							my $srcbin = ip_to_bin($logsrc);
							if (exists $logentry_ref->{'zones'}) {
								my ($srczone, $dstzone) = split(/\~/, $logentry_ref->{'zones'});
								if (exists $ips_ref->{$srcbin} && exists $ips_ref->{$srcbin}{'zone'} && ($srczone ne $ips_ref->{$srcbin}{'zone'})) {
									$missedobjs{"    ZONEINF:  LOG IP SRC BIN: $logsrc MATCHED BIN OBJ, IT RESIDES IN ZONE: $srczone WHILE THE CONFIG BINS ZONE IS: $ips_ref->{$srcbin}{'zone'}"}++;
								} elsif (exists $ips_ref->{$srcbin}) {
									unless (exists $ips_ref->{$srcbin}{'zone'}) {
										$ips_ref->{$srcbin}{'zone'} = $srczone;
									}
								} else {
									my $workingsrcbin = $srcbin;
									until (exists $ips_ref->{$workingsrcbin} || $workingsrcbin eq "") {
										chop $workingsrcbin;
									}
									if (($workingsrcbin ne "") && exists $ips_ref->{$workingsrcbin}{'zone'} && ($srczone ne $ips_ref->{$workingsrcbin}{'zone'})) {
										$missedobjs{"    ZONEINF:  LOG NET SRC BIN: $logsrc MATCHED NET BIN OBJ: $ips_ref->{$workingsrcbin}{'name'} IT RESIDES IN ZONE: $srczone WHILE THE CONFIG NET BINS ZONE IS: $ips_ref->{$workingsrcbin}{'zone'}"}++;
									} elsif (($workingsrcbin ne "") && exists $ips_ref->{$workingsrcbin}) {
										unless (exists $ips_ref->{$workingsrcbin}{'zone'}) {
											$ips_ref->{$workingsrcbin}{'zone'} = $srczone;
										}
									}
								}
							}

						# NOTE: add service and rule usage info to netobject resolved via IP

							my $workingsrcbin = $srcbin;
							until (exists $ips_ref->{$workingsrcbin} || $workingsrcbin eq "") {
								chop $workingsrcbin;
							}
							if (exists $ips_ref->{$workingsrcbin}) {
								my $name = $ips_ref->{$workingsrcbin}{'name'};
								$netobjects_ref->{$name}{'logsrcrules'}{$logrule}+= $hits;
								$netobjects_ref->{$name}{'logsrcsrvcs'}{"$logproto~$logport"}+= $hits;

								if (exists $logentry_ref->{'lognatsrc'}) {
									foreach my $lognatsrc (keys %{$logentry_ref->{'lognatsrc'}}) {
										$netobjects_ref->{$name}{'lognatsrc'}{$lognatsrc} = $logrule;
									}
								}
								if (exists $logentry_ref->{'lognatsrvc'}) {
									foreach my $lognatsrvc (keys %{$logentry_ref->{'lognatsrvc'}}) {
										$netobjects_ref->{$name}{'lognatsrvc'}{$lognatsrvc} = $logrule;
									}
								}
							}

							push (@binsrcs, $srcbin);
						} else {
							$missedobjs{"    WARNING:  SRC log object UNKNOWN: $logsrc"}++;
						}

					# NOTE: if SERVICE log object exists in the config or is a known protocol or a service exception (like large port ranges that would eat all the good info)

						if (exists $srvcobjects_ref->{$logport}) {
							if (exists $srvcexceptions_ref->{$logport} ) {
								if (exists $srvcobjects_ref->{$logport}{'port'}{$logproto}) {
									$logproto = "srvcexception_$logproto";
									push (@portnums, $logport);
								} elsif (($logproto =~ s/srvcexception_//) && (exists $srvcobjects_ref->{$logport}{'port'}{$logproto})) {
									$logproto = "srvcexception_$logproto";
									push (@portnums, $logport);
								} else {
									my ($exproto,) = keys %{$srvcobjects_ref->{$logport}{'port'}};
									$missedobjs{"    WARNING:  service exception DROPPED: PORT $logport, SRVC PROTO $exproto, LOG PROTO $logproto"}++;
								}
							
							} elsif ($srvcobjects_ref->{$logport}{'type'} =~ /^other$|^dce-rpc/) {
								$logproto = $srvcobjects_ref->{$logport}{'type'};
								foreach my $portnum (keys %{$srvcobjects_ref->{$logport}{'ports'}{$logproto}}) {
									push (@portnums, $portnum);
								}
							} else {
								if (exists $srvcobjects_ref->{$logport}{'ports'}{$logproto}) {
									foreach my $portnum (keys %{$srvcobjects_ref->{$logport}{'ports'}{$logproto}}) {
										push (@portnums, $portnum);
									}
								} elsif ($logport =~ /^\d+$/) {
									push (@portnums, $logport);

								} else {
									$missedobjs{"    WARNING:  UNKNOWN protocol DROPPED: $logproto for object $logport, rule: $logrule"}++;
								}
							}
						} elsif ($logport =~ /^\d+$/) {
							push (@portnums, $logport);
							#print "NUMERIC PORT: $logproto for object $logport, $logdst, $logsrc, rule: $logrule\n";
						} elsif (exists $ports_ref->{$logproto} && exists $ports_ref->{$logproto}{$logport}) {
							#print "WOOPS!! $ports_ref->{$logproto}{$logport}{'name'}\n";
							push (@portnums, $ports_ref->{$logproto}{$logport}{'name'});
						} else {
							push (@portnums, $logport);
							$missedobjs{"    WARNING:  UNKNOWN port USED: $logproto, $logport"}++;
						}

					# NOTE: build the log bins tree from this itteration of the current rule

						foreach my $bindst (@bindsts) {
							foreach my $binsrc (@binsrcs) {
								foreach my $portnb (@portnums) {
									$logbins_ref->{$bindst}{$binsrc}{$logproto}{$portnb}{$logrule} += $hits;
									$logbincount++;
								}
							}
						}
					}
				}
			}
		}
	}
	if (scalar keys %missedobjs > 0) {
		print "-----------------------------------------------------------------------------------------\n";
		print " SOME OBJECTS COULD NOT BE RESOLVED FROM THE LOGS, DETAILS BELOW:\n";
		print "-----------------------------------------------------------------------------------------\n";
	
		foreach my $missedobj (sort keys %missedobjs) {
			print "$missedobj - $missedobjs{$missedobj} instances\n";
		}
	}
	if ($logbincheck > $logbincount) {
		print "   WARNING:  Binary log smaller than original log\n";
	} else {
		print "   BINARY LOG CHECK GOOD!!\n";
	} 
	return $logbincount;
}

