HERE
		print $print_fltprint_mode_header;
	} elsif ($typ eq 'fltprint') {
		my $print_fltprint_mode_header = <<'HERE';

  ___ _ _            _     _       _             _         _      __  __         _     
 | __| | |_ _ __ _ _(_)_ _| |_    /_\  _ _  __ _| |_  _ __(_)___ |  \/  |___  __| |___ 
 | _|| |  _| '_ \ '_| | ' \  _|  / _ \| ' \/ _` | | || (_-< (_-< | |\/| / _ \/ _` / -_)
 |_| |_|\__| .__/_| |_|_||_\__| /_/ \_\_||_\__,_|_|\_, /__/_/__/ |_|  |_\___/\__,_\___|
           |_|                                     |__/                                
HERE
		print $print_fltprint_mode_header;
	}

	if ($typ =~ /^print$|^fltprint$/) {
		print "-----------------------------------------------------------------------------------------\n";
		if ($logparsetype eq 'normal') {
			print " OUTOUT OBJECTS DETTAILS AND RULE USAGE INFO SPREADSHEET:\n";
		} else {
			print " OUTOUT OBJECTS DETTAILS AND DROP PROFILE INFO SPREADSHEET:\n";
		}
		print "-----------------------------------------------------------------------------------------\n";

		print "\n\n	Enter the name of the spreadsheet you want to print analysis to:\n\n";

		my $rulebase;
		my $verbose;

		while (<STDIN>) {
			chomp($_);
			if ($_ eq '') {
				print "\n 		ERROR: type a filename\n";
			} elsif (-e "$_") {
				print "\n		ERROR: file exists\n";
			} else {
				$rulebase = $_	;
				last;
			}
		}

		print "\n	Do you want info printed to the screen?\n";
		print " 	[yes|no] or type '.' for default (no)\n\n";

		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$verbose = $_										;
				last 											;
			} elsif ($_ eq '.') {
				$verbose = 'no';
				print "	* ADDED Option: $verbose\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"						;
			}
		}

		open (OBJANALYSIS, ">$rulebase") or warn "Can't open $rulebase: $!\n"	;        

		my %includeips;
		my %excludeips;
		my %includestr;
		my %excludestr;

	# NOTE: collect filters data for 'fltprint' mode

		if ($typ eq 'fltprint') {

			print "\n	Enter the TEXT STRINGS (without spaces) that you wish to either include or exclude in the format:\n"	;
			print " 	[IN|EX] TEXT_STRING\n"		;
			print " 	Enter '.' when done: \n\n"	;

		# NOTE: get include and exclude filter strings

			while (<STDIN>) {
				chomp;
				last if $_ eq '.'							;
				next if $_ eq ''							;
				my @incexstr = split (/\s+/, $_)					;

				if (scalar @incexstr <= 1) {
					print "		Input ERROR: no string specified\n\n";
				
				} elsif ($incexstr[0] !~ /^IN|^EX$/ ) {
					print "\n	ERROR: Unknown key word \"$_\" try again!\n"	;

				} elsif ($incexstr[0] eq 'IN') {
					my $string = $incexstr[1] 					;

					$includestr{$string}	 	= 'IN'	 			;

				} elsif ($incexstr[0] eq 'EX') {
					my $string = $incexstr[1] 					;
					
					$excludestr{$string} 	  	= 'EX'				;
				}				 
			}

			print "\n	Enter the IP ADDRESS and MASK LENGTH of networks you wish to either include or exclude in the format:\n"	;
			print " 	[IN|EX] IP MASKLENGTH\n"	;
			print " 	Enter '.' when done: \n\n"	;

		# NOTE: get include and exclude CIDR networks

			while (<STDIN>) {
				chomp;
				last if $_ eq '.'							;
				next if $_ eq ''							;
				my @incexips = split (/\s+/, $_)					;
				my ($inex, $ip, $masklength) 	= @incexips;
				unless (defined($inex) && ($inex =~ /\w/) && defined($ip) && is_ip($ip) && defined($masklength) && ($masklength =~ /\d+/) && ($masklength < 33)) {
					print "		INPUT FORMAT ERROR: enter: IN_or_EX IPADDR MASKLENGTH\n";
					next;
				}
				if ($incexips[0] !~ /^IN|^EX$/ ) {
					print "\n	ERROR: Unknown key word \"$_\" try again!\n"	;
				} elsif ($incexips[0] eq 'IN') {
					my $ipbin = ip_to_bin($incexips[1]) 				;
					my ($maskedbits) 		= substr($ipbin, 0, $incexips[2]);
					print " 	Resolved IN to Binary Match: $maskedbits\n"	;
					$includeips{$maskedbits} 	= $incexips[1] 			;
				} elsif ($incexips[0] eq 'EX') {
					my $ipbin = ip_to_bin($incexips[1]) 				;
					my ($maskedbits) 		= substr($ipbin, 0, $incexips[2]);
					print " 	Resolved EX to Binary Match: $maskedbits\n"	;
					$excludeips{$maskedbits} 	= $incexips[1]  		;
				}				 
			}
		}

		print "\n";

		foreach my $cfgfile (sort keys %configbundles) {

			output_print_mode_spreadsheet(
				$cfgfile,
				\%configbundles,
				\%excludeips,
				\%excludestr,
				\%includeips,
				\%includestr,
				$rulebase,
				$typ,
				$verbose);
		}

		#print "INCLUDE GROUPS        	\n############################################################################\n\n". Dumper(%includeips) . "\n\n";
		#print "EXCLUDE GROUPS        	\n############################################################################\n\n". Dumper(%excludeips) . "\n\n";

		print "\n\n---------------------------------------------------------------------------------------------------\n";
		print "ANALYSIS FILE: $rulebase WRITTEN  		!!WEHAYY!!!\n";
		print "---------------------------------------------------------------------------------------------------\n";
	}
}

#===================================================================================================
# OUTPUT THE PRINT MODE SPREADSHEET - INFO FOR FILTERS HANDED TO IT
#===================================================================================================

sub output_print_mode_spreadsheet {

	my ($cfgfile,
	$configbundles_ref,
	$excludeips_ref,
	$excludestr_ref,
	$includeips_ref,
	$includestr_ref,
	$rulebase,
	$typ,
	$verbose) = @_;

	my $configBUNDLE_ref = $configbundles_ref->{$cfgfile};

#---------------------------------------------------------------------------------------------------
# PRINTING THE BANNER FOR THE ANALYSIS SPREADSHEET
#---------------------------------------------------------------------------------------------------
	
	if ($verbose eq 'yes') {
		print "\n===================================================================================================\n";
		if ($logparsetype eq 'normal') {
			print "CONFIG BUNDLE: $cfgfile\n";
		} else {
			print "DROPS CONFIG BUNDLE: $cfgfile\n";
		}
		print "===================================================================================================\n";
		print "Object and Rule Analysis output using 'print' mode in 360-FAAR\n";
		print "\n";
		print "NAME, TYPE, IP, NM, SUB AND SUPERGROUP MEMBERSHIP, SUPERNETS, IP DUPLICATE OBJECTS, USED IN POLICIES, DESCRIPTION, SUBNETS of OBJECT, SUBNET HOSTS OF OBJECT\n";
	} else {
		print "	Printing $cfgfile ANALYSIS to FILE: $rulebase... this may take a few minutes\n";
	}

	print OBJANALYSIS "\n##===================================================================================================\n";

	if ($logparsetype eq 'normal') {
		print OBJANALYSIS "## CONFIG BUNDLE: $cfgfile\n";
	} else {
		print OBJANALYSIS "## DROPS CONFIG BUNDLE: $cfgfile\n";
	}

	print OBJANALYSIS "##===================================================================================================\n";
	if ($logparsetype eq 'normal') {
		print OBJANALYSIS "## Object Analysis Spreadsheet output using 'print' or 'fltprint' mode in 360-FAAR\n";
	} else {
		print OBJANALYSIS "## DROP LOG Object Analysis Spreadsheet output using 'print' or 'fltprint' mode in 360-FAAR\n";
	}
	print OBJANALYSIS "##\n";
	print OBJANALYSIS "## NAME, TYPE, IP, NM, COLOUR, CIDR, SUB OR SUPERGROUP MEMBERSHIP, SUPERNETS OF OBJECT, IP DUPLICATE OBJECTS, USED IN POLICIES, DESCRIPTION, SUBNETS OF OBJECT, SUBNET HOSTS OF OBJECT, POLICY SRC RULE USAGE, POLICY DST RULE USAGE, LOG SRC RULE HITS, LOG SRC PROTO PORT USAGE, LOG DST RULE HITS, LOG DST PROTO PORT USAGE, BINARY IPS, ASSOCIATED SRC RULE ACTIONS, ASSOCIATED DST RULE ACTIONS, USED AS SRC IN RULES, USED AS DST IN RULES, SRC NATS FROM POLICY, DST NATS FROM POLICY, SRVC NATS FROM POLICY, SRC NATS FROM LOGS, DST NATS FROM LOGS, SRVC NAT DESTS FROM LOG, SRC INSTALL ONS, DST INSTALL ONS, SRC IN VPN, DST IN VPN, SRC NEG IN POLICY, DST NEG IN POLICY, SRVC NEG AS SRC, SRVC NEG AS DST, SRC RULE COMMENTS, DST RULE COMMENTS, SRC RULE SECTION HEADDER, DST RULE SECTION HEADDER\n";

#---------------------------------------------------------------------------------------------------
# PROCESS OBJECTS FOR ANALYSIS SPREADSHEET AND FILTER IF 'fltprint' MODE
#---------------------------------------------------------------------------------------------------
	
	foreach my $obj (sort keys %{$configBUNDLE_ref->{'netobjects'}}) {

	# NOTE: set hashes and arrays for OBJECT USE in RULE details

		my %descrip;
		my %descrid;
		my %secheds;
		my %sechedd;
		my %rulegrp;
		my %rulesrvcs;
		my %ruleactions;
		my %ruleactiond;
		my %src;
		my %dst;
		my %installons;
		my %installond;
		my %vpns;
		my %vpnd;
		my %srcnegs;
		my %dstnegs;
		my %srvcnegs;
		my %srcnegd;
		my %dstnegd;
		my %srvcnegd;
		my @names;
		my @duplnames;
		my @subnames;
		my @hostnames;

	# NOTE: set variables for object 'get'

		my ($type, $ip, $nm, $colour, $cidr, $supergroups_ref, $description, $ipbins_ref, $rulesrcs_ref, $ruledsts_ref, $logsrcrules_ref, $logsrcsrvcs_ref, $logdstrules_ref, $logdstsrvcs_ref, $natsrcs_ref, $natdsts_ref, $natsrvcs_ref, $lognatsrcs_ref, $lognatdsts_ref, $lognatsrvcs_ref);

	# NOTE: get object details using get_netobj subroutine

		($type, $ip, $nm, $colour, $supergroups_ref, $cidr, $description, $ipbins_ref, $rulesrcs_ref, $ruledsts_ref, $logsrcrules_ref, $logsrcsrvcs_ref, $logdstrules_ref, $logdstsrvcs_ref, $natsrcs_ref, $natdsts_ref, $natsrvcs_ref, $lognatsrcs_ref, $lognatdsts_ref, $lognatsrvcs_ref) = get_netobj($obj, $configBUNDLE_ref->{'netobjects'});

		if ($obj =~ /^any$|^Any$|^ANY$|^any4$/) { $cidr = "0.0.0.0\/0";}
		unless ($nm eq 'none') {
			if ($cidr eq 'none') { 
				my ($maskbin, $maskbits, $masklength)		= netmask_to_bin($nm) ;
				$cidr = "$ip\/$masklength";
			}
		}

		my @srvcs;
		my @srvcd;

	# NOTE: pull details from each global rule number in which each object was used as a SOURCE

		foreach my $rlsrc (sort numerically @$rulesrcs_ref) {
			next if $rlsrc eq 'none';
			my $desc = ' ';
			my $seched = ' ';

			my $rlnum 	= $configBUNDLE_ref->{'rules'}{$rlsrc}{'rbnum'};
			my $rulegroup 	= $configBUNDLE_ref->{'rules'}{$rlsrc}{'rulegroup'};
			my $ruleaction 	= $configBUNDLE_ref->{'rules'}{$rlsrc}{'action'};
			my $vpn 	= $configBUNDLE_ref->{'rules'}{$rlsrc}{'vpn'};
			my $srcneg 	= $configBUNDLE_ref->{'rules'}{$rlsrc}{'srcneg'};
			my $dstneg 	= $configBUNDLE_ref->{'rules'}{$rlsrc}{'dstneg'};
			my $srvcneg 	= $configBUNDLE_ref->{'rules'}{$rlsrc}{'srvcneg'};

			foreach my $installon (keys %{$configBUNDLE_ref->{'rules'}{$rlsrc}{'installon'}}) {
				$installons{"$rulegroup Rl:$rlnum: $installon  "}++;
			}

			if (exists $configBUNDLE_ref->{'rules'}{$rlsrc}{'header'} && $configBUNDLE_ref->{'rules'}{$rlsrc}{'header'} ne "") {
				$seched = $configBUNDLE_ref->{'rules'}{$rlsrc}{'header'};
			} else {
				$seched = 'none';
			}
			if (exists $configBUNDLE_ref->{'rules'}{$rlsrc}{'comment'} && $configBUNDLE_ref->{'rules'}{$rlsrc}{'comment'} ne "") {
				$desc = $configBUNDLE_ref->{'rules'}{$rlsrc}{'comment'};
			} else {
				$desc = 'none';
			}
			if (exists $configBUNDLE_ref->{'rules'}{$rlsrc}{'service'} && $configBUNDLE_ref->{'rules'}{$rlsrc}{'service'} ne "") {
				push (@srvcs, " Rule: $rulegroup  No: $rlnum ");
				push (@srvcs, ( sort keys %{$configBUNDLE_ref->{'rules'}{$rlsrc}{'service'}}));
			}

			$descrip{"$rulegroup Rl:$rlnum:$desc "}++;
			$secheds{"$rulegroup Rl:$rlnum: $seched  "}++;
			$ruleactions{"$rulegroup Rl:$rlnum: $ruleaction  "}++;
			$src{"G_Rl_Num:$rlsrc Rb:$rulegroup Rl: $rlnum  "}++;
			unless ($vpn     eq 'Any') { $vpns{"$rulegroup Rl:$rlnum: $vpn  "}++;}
			unless ($srcneg  eq 'no')  { $srcnegs{"$rulegroup Rl:$rlnum: $srcneg  "}++;}
			unless ($dstneg   eq 'no')  { $dstnegs{"$rulegroup Rl:$rlnum: $dstneg  "}++;}
			unless ($srvcneg eq 'no')  { $srvcnegs{"$rulegroup Rl:$rlnum: $srvcneg  "}++;}
			$rulegrp{$rulegroup}++;
		}

	# NOTE: pull details from each global rule number in which each object was used as a DESTINATION

		foreach my $rldst (sort numerically @$ruledsts_ref) {
			next if $rldst eq 'none';
			my $des = ' ';
			my $seched = ' ';
			my $rlnum 	= $configBUNDLE_ref->{'rules'}{$rldst}{'rbnum'};
			my $rulegroup 	= $configBUNDLE_ref->{'rules'}{$rldst}{'rulegroup'};
			my $ruleactio 	= $configBUNDLE_ref->{'rules'}{$rldst}{'action'};
			my $vpn 	= $configBUNDLE_ref->{'rules'}{$rldst}{'vpn'};
			my $srcneg 	= $configBUNDLE_ref->{'rules'}{$rldst}{'srcneg'};
			my $dstneg 	= $configBUNDLE_ref->{'rules'}{$rldst}{'dstneg'};
			my $srvcneg 	= $configBUNDLE_ref->{'rules'}{$rldst}{'srvcneg'};

			foreach my $installon (keys %{$configBUNDLE_ref->{'rules'}{$rldst}{'installon'}} ) {
				$installond{"$rulegroup Rl:$rlnum: $installon  "}++;
			}
									
			if (exists $configBUNDLE_ref->{'rules'}{$rldst}{'header'} && $configBUNDLE_ref->{'rules'}{$rldst}{'header'} ne "") {
				$seched = $configBUNDLE_ref->{'rules'}{$rldst}{'header'};
			} else {
				$seched = 'none';
			}

			if (exists $configBUNDLE_ref->{'rules'}{$rldst}{'comment'} && $configBUNDLE_ref->{'rules'}{$rldst}{'comment'} ne "") {
				$des = $configBUNDLE_ref->{'rules'}{$rldst}{'comment'};
			} else {
				$des = 'none';
			}
			if (exists $configBUNDLE_ref->{'rules'}{$rldst}{'service'} && $configBUNDLE_ref->{'rules'}{$rldst}{'service'} ne "") {
				push (@srvcd, " Rule: $rulegroup  No: $rlnum ");
				push (@srvcd, ( sort keys %{$configBUNDLE_ref->{'rules'}{$rldst}{'service'}}));
			}

			$descrid{"$rulegroup Rl:$rlnum: $des  "}++;
			$sechedd{"$rulegroup Rl:$rlnum: $seched  "}++;
			$ruleactiond{"$rulegroup Rl:$rlnum: $ruleactio  "}++;
			$dst{"G_Rl_Num:$rldst Rb:$rulegroup Rl: $rlnum  "}++;
			unless ($vpn     eq 'Any') { $vpnd{"$rulegroup Rl:$rlnum: $vpn  "}++;}
			unless ($srcneg  eq 'no')  { $srcnegd{"$rulegroup Rl:$rlnum: $srcneg  "}++;}
			unless ($dstneg   eq 'no')  { $dstnegd{"$rulegroup Rl:$rlnum: $dstneg  "}++;}
			unless ($srvcneg eq 'no')  { $srvcnegd{"$rulegroup Rl:$rlnum: $srvcneg  "}++;}
			$rulegrp{$rulegroup}++;
		}

	# NOTE: sort hashes and output to arrays ready for printing

		my @rulegrp 	= sort keys %rulegrp;
		my @src 	= sort keys %src;
		my @descrip 	= sort keys %descrip;
		my @secheds 	= sort keys %secheds;
		my @dst 	= sort keys %dst;
		my @descrid 	= sort keys %descrid;
		my @sechedd 	= sort keys %sechedd;
		my @actions 	= sort keys %ruleactions;
		my @actiond 	= sort keys %ruleactiond;
		my @installons 	= sort keys %installons;
		my @installond 	= sort keys %installond;
		my @vpns 	= sort keys %vpns;
		my @vpnd 	= sort keys %vpnd;
		my @srcnegs 	= sort keys %srcnegs;
		my @srcnegd 	= sort keys %srcnegd;
		my @dstnegs 	= sort keys %dstnegs;
		my @dstnegd 	= sort keys %dstnegd;
		my @srvcnegs 	= sort keys %srvcnegs;
		my @srvcnegd 	= sort keys %srvcnegd;

	# NOTE: set include and exclude filter counts

		my $inc  = 0 ;
		my $exc  = 0 ;

	# NOTE: process binary IP's and compaire to each other

		foreach my $ipb (sort @$ipbins_ref) {

		# NOTE: filter output using CIDR 

			if ($typ eq 'fltprint') {
				my $inccount = scalar keys %{$includeips_ref};
				my $exccount = scalar keys %{$excludeips_ref};
				my $ipincbin = $ipb;
				if ($inccount > 0 ) {
					until (exists $includeips_ref->{$ipincbin} || $ipincbin eq "") {
						chop $ipincbin;
					}
					if (exists $includeips_ref->{$ipincbin}) {
						if ($exccount > 0 ) {
							my $ipexcbin = $ipb;
							until (exists $excludeips_ref->{$ipexcbin} || $ipexcbin eq "") {
								chop $ipexcbin;
							}
							if (exists $excludeips_ref->{$ipexcbin}) {
								$exc++;
							} else {
								$inc++;
							}
						} else {
							$inc++
						}
					}
				} elsif ($exccount > 0 ) {
					my $ipexcbin = $ipb;
					until (exists $excludeips_ref->{$ipexcbin} || $ipexcbin eq "") {
						chop $ipexcbin;
					}
					if (exists $excludeips_ref->{$ipexcbin}) {
						$exc++;
					} else {
						$inc++;
					}
				} else {
					$inc++
				}
			}
			my ($nam, $dupnam, $subnam, $hstnam) ;
			if (scalar(@$ipbins_ref) > 256) {

			# NOTE: SKIPPING SUBNET AND HOST PROCESSING\n";  

				($nam, $dupnam, $subnam, $hstnam) = find_supernets_and_duplicates($ipb,$configBUNDLE_ref->{'ips'},$configBUNDLE_ref->{'duplips'}) ;
			} else {
				($nam, $dupnam, $subnam, $hstnam) = find_supernets_duplicates_and_subnets($ipb,$configBUNDLE_ref->{'ips'},$configBUNDLE_ref->{'duplips'}) ;
			}
			push(@names, @$nam);
			push(@duplnames, @$dupnam);
			push(@subnames, @$subnam);
			push(@hostnames, @$hstnam);
		}
		my $incstr  = 0 ;
		my $excstr  = 0 ;

	# NOTE: filter object using STRINGS

		if ($typ eq 'fltprint') {
			my $inccount = scalar keys %{$includestr_ref};
			my $exccount = scalar keys %{$excludestr_ref};
			if ($inccount > 0 ) {
				foreach my $string (keys %{$includestr_ref}) {
					if ($obj =~ m/$string/) {
						if ($exccount > 0 ) {
							foreach my $exstring (keys %{$excludestr_ref}) {
								if ($obj =~ m/$exstring/) {
									$excstr++;
									$incstr = 0 ;
								} else {
									$incstr++;
								}
							}
						} else {
							$incstr++;
						}
					} else {
						#$exstr++;
					}
				}
			} elsif ($exccount > 0 ) {
				foreach my $exstring (keys %{$excludestr_ref}) {
					if ($obj =~ m/$exstring/) {
						$excstr++;
						$incstr = 0 ;
					} else {
						$incstr++;
					} 
				}
			} else {
				$incstr++
			}

	# NOTE: !!!!!!!!!!!!IMPORTANT!!!!!!!!!!!!!!  ...decide BOTH filters here

			unless (($inc > 0) && ($exc == 0) && ($incstr > 0) && ($excstr == 0)) {
				next;
			}
		}			

	# NOTE: assing none to output arrays if ARRAYS ARE EMPTY

		unless (@names) {
			push( @names, 'none');
		}
		unless (@duplnames) {
			push( @duplnames, 'none');
		}
		unless (@subnames) {
			push( @subnames, 'none');
		}
		unless (@hostnames) {
			push( @hostnames, 'none');
		}
		unless (@src) {
			push( @src, 'none');
		}
		unless (@descrip) {
			push( @descrip, 'none');
		}
		unless (@secheds) {
			push( @secheds, 'none');
		}
		unless (@dst) {
			push( @dst, 'none');
		}
		unless (@descrid) {
			push( @descrid, 'none');
		}
		unless (@actions) {
			push( @actions, 'none');
		}
		unless (@actiond) {
			push( @actiond, 'none');
		}
		unless (@sechedd) {
			push( @sechedd, 'none');
		}
		unless (@rulegrp) {
			push( @rulegrp, 'none');
		}
		unless (@srvcs) {
			push( @srvcs, 'none');
		}
		unless (@srvcd) {
			push( @srvcd, 'none');
		}
		unless (@$ipbins_ref) {
			push( @$ipbins_ref, 'none');
		}
		unless (defined ($description) && ($description ne "")) { 
			$description = 'none';
		}
		unless (@installons) {
			push( @installons, 'none');
		}
		unless (@installond) {
			push( @installond, 'none');
		}
		unless (@vpns) {
			push( @vpns, 'none');
		}
		unless (@vpnd) {
			push( @vpnd, 'none');
		}
		unless (@srcnegs) {
			push( @srcnegs, 'none');
		}
		unless (@srcnegd) {
			push( @srcnegd, 'none');
		}
		unless (@dstnegs) {
			push( @dstnegs, 'none');
		}
		unless (@dstnegd) {
			push( @dstnegd, 'none');
		}
		unless (@srvcnegs) {
			push( @srvcnegs, 'none');
		}
		unless (@srvcnegd) {
			push( @srvcnegd, 'none');
		}

#---------------------------------------------------------------------------------------------------
# OUTPUT ANALYSIS TO CSV AND SCREEN
#---------------------------------------------------------------------------------------------------
	
		$description =~ s/\,//;

	# NOTE: print analysis to CSV spreadsheet

		print OBJANALYSIS "$obj,$type,$ip,$nm,$colour,$cidr,@$supergroups_ref,@names,@duplnames,@rulegrp,$description,@subnames,@hostnames,@srvcs,@srvcd,@$logsrcrules_ref,@$logsrcsrvcs_ref,@$logdstrules_ref,@$logdstsrvcs_ref,@$ipbins_ref,@actions,@actiond,@src,@dst,@$natsrcs_ref,@$natdsts_ref,@$natsrvcs_ref,@$lognatsrcs_ref,@$lognatdsts_ref,@$lognatsrvcs_ref,@installons,@installond,@vpns,@vpnd,@srcnegs,@dstnegd,@srvcnegs,@srvcnegd,@descrip,@descrid,@secheds,@sechedd\n";

	# NOTE: print analysis to screen

		if ($verbose eq 'yes') {
			print  "$obj, $type, $ip, $nm, @$supergroups_ref, @names, @duplnames, @rulegrp, $description, @subnames, @hostnames\n";
		}
	}
}

