sub build_objects_for_rulebase_mode {
	
	my ($typ, $configbundles_ref) = @_;

	my $build_objects_header = <<'HERE';

  ___      _ _    _   ___      _        ___  _     _        _        __  __         _     
 | _ )_  _(_) |__| | | _ \_  _| |___   / _ \| |__ (_)___ __| |_ ___ |  \/  |___  __| |___ 
 | _ \ || | | / _` | |   / || | / -_) | (_) | '_ \| / -_) _|  _(_-< | |\/| / _ \/ _` / -_)
 |___/\_,_|_|_\__,_| |_|_\\_,_|_\___|  \___/|_.__// \___\__|\__/__/ |_|  |_\___/\__,_\___|
                                                |__/                                      
HERE

	print $build_objects_header;

	if (($typ eq 'bldobj') && (scalar keys %{$configbundles_ref} > 0)) {

		print "-----------------------------------------------------------------------------------------\n";
		print " IDENTIFY OBJECTS TO BUILD RULE DEFINITIONS:\n";
		print "-----------------------------------------------------------------------------------------\n";
		print "   Enter rule definitions in odumper format to build a policy\n";

		my %srctmpbundle;

		my %netobjs	= ();
		my %groups	= ();
		my %ipbins	= ();

		my %srvcs	= ();
		my %srvcgrps	= ();
		my %ports	= ();

		my %bingroups 	= ();
		my %portgroups	= ();

		my %rashprintbase = ();
		my $option_header;
		my $option_details;
		my $configfrom;
		my $configfrom2;
		my $configto;
		my $configout;
		my $rulebase;

		$srctmpbundle{'netobjects'}	= \%netobjs;
		$srctmpbundle{'srvcobjects'}	= \%srvcs;
		$srctmpbundle{'netgroups'}	= \%groups;
		$srctmpbundle{'netgroupobjs'}	= \%groups;
		$srctmpbundle{'srvcgroups'}	= \%srvcgrps;
		$srctmpbundle{'srvcgroupobjs'}	= \%srvcgrps;
		$srctmpbundle{'ips'} 		= \%ipbins;
		$srctmpbundle{'ports'} 		= \%ports;
		$srctmpbundle{'bingroups'} 	= \%bingroups;
		$srctmpbundle{'portgroups'} 	= \%portgroups;

		print "\n	Enter the name of the spreadsheet you want to \n	read rules from:\n\n";

		while (<STDIN>) {
			chomp($_);
			if ($_ eq '') {
				print "\n 		ERROR: type a filename\n";
			} elsif (-e "$_") {
				$rulebase = $_	;
				last;
			} else {
				print "\n		ERROR: file does not exists\n";
			}
		}
		print "\n";

		open RULEBASE, "$rulebase" or warn "Can't open $rulebase: $!\n"	;        

		print " 	Enter the type of config you would like to build [od|ns|cs]:\n\n";

		while (<STDIN>) {
			chomp($_) 								;
			if ($_ =~ /^od$|^ns$|^cs$/) {
				chomp ($_);
				$configout = $_						;
				last 								;
			} else {
				print "		ERROR: type 'od', 'ns', 'cs'\n"	;
			}
		}

		$option_header = "\n	Enter the config bundle name of the firewall you are \n	merging rules and objects from:\n\n";

		$option_details = <<'HERE';

	Which CONFIG do you want to match objects FROM?
 	Enter a CONFIG NAME or NUMBER and hit RETURN.

HERE

		hd_input_output (
			$option_header, 
			$option_details,
			$configbundles_ref,
			\$configfrom,
			'required'); 


		$option_header = "\n	Enter the secondary config bundle name of the firewall you are \n	merging rules and objects from:\n\n";

		$option_details = <<'HERE';

	Which SECONDARY CONFIG do you want to match objects FROM?
 	Enter a CONFIG NAME or NUMBER and hit RETURN.

HERE

		hd_input_output (
			$option_header, 
			$option_details,
			$configbundles_ref,
			\$configfrom2,
			'required'); 


		$option_header = "\n	Enter the config bundle name of the firewall you are \n	merging rules and objects to:\n\n";

		$option_details = <<'HERE';

	Which CONFIG do you want to translate objects TO?
 	Enter a CONFIG NAME or NUMBER and hit RETURN.

HERE

		hd_input_output (
			$option_header, 
			$option_details,
			$configbundles_ref,
			\$configto,
			'required'); 


	# NOTE: assign local ref's to config bundles
		
		my $configFROM_ref = $configbundles_ref->{$configfrom};
		my $configFROM2_ref = $configbundles_ref->{$configfrom2};
		my $configTO_ref   = $configbundles_ref->{$configto};

#---------------------------------------------------------------------------------------------------
# PRINTING THE BANNER OBJECT BUILD BIT
#---------------------------------------------------------------------------------------------------

		print "\n-----------------------------------------------------------------------------------------\n";
		print " SCANNING FILE $rulebase FOR RULE DEFINITIONS:\n";
		print "-----------------------------------------------------------------------------------------\n";

	# NOTE: assigning objects to zones

		my $rulecount		= 0;
		my $objcountfrom	= 0;
		my $objcountfrom2	= 0;
		my $objcountto		= 0;
		my $grpcountfrom	= 0;
		my $grpcountfrom2	= 0;
		my $grpcountto		= 0;
		my $srvcfrom		= 0;
		my $srvcfrom2		= 0;
		my $srvcto		= 0;
		my $grpsrvcfrom		= 0;
		my $grpsrvcfrom2	= 0;
		my $grpsrvcto		= 0;
		
		while (<RULEBASE>) {

	# NOTE: skip objects

			next unless /^security_rule|^Rule: \d+/;
			chomp($_);
			$_  =~ s/\n//g;
			$_  =~ s/\r//g;

			$_ =~ s/\, /\,/g ;

			my ($rbnum, $type, $srcs, @srcs, $dsts, @dsts, $vpn, $services, @services, $action, $track, $installon, $time, $comment, $sectionhead) ;
			my (%srcipbins, %dstipbins, %srcgroups, %dstgroups, %rlsrvcs, %rlsrvcgrps);
			my (@srcsout, @dstsout, @srvcsout, %srvcsout);

		# NOTE: identify rule text format and break up objects accordingly

			if (/^Rule: \d+/) {

			# NOTE: readable format of odumper made with numberrules helper script

				$rulecount++;
				($rbnum, $type, $srcs, $dsts, $vpn, $services, $action, $track, $installon, $time, $comment, $sectionhead) = split (/\,/, $_);
				$rbnum =~ s/Rule: //;
				unless (defined($sectionhead)) { $sectionhead = ' ';}
				$srcs =~ s/^\s+//;
				$dsts =~ s/^\s+//;
				$services =~ s/^\s+//;
				@srcs = split (/\s+/, $srcs);
				@dsts = split (/\s+/, $dsts);
				@services = split (/\s+/, $services);
			} 

			elsif (/^security_rule/) {

			# NOTE: odumper format file, objects seperated by ";"

				$rulecount++;
				$sectionhead = ' ';
				($type, $srcs, $dsts, $vpn, $services, $action, $track, $installon, $time, $comment) = split (/\,/, $_);
				$rbnum = $rulecount;
				$srcs =~ s/^\s+//;
				$dsts =~ s/^\s+//;
				$services =~ s/^\s+//;
				@srcs = split (/\;/, $srcs);
				@dsts = split (/\;/, $dsts);
				@services = split (/\;/, $services);
			}
			
			my $srcsout = join(';', @srcs);
			my $dstsout = join(';', @dsts);
			my $srvcout = join(';', @services);

			$rashprintbase{$rbnum} = "$srcsout,$dstsout,$srvcout,$comment$sectionhead";
			
		# NOTE: the next section builds a new config bundle from objects listed in the rules from the two config bundles supplied

		# NOTE: identify rule SOURCE objects from the two sorce configs supplied

			foreach my $src (@srcs) {
				if (exists $configFROM_ref->{'netobjects'}{$src}) {
					$objcountfrom++;
					$netobjs{$src} = $configFROM_ref->{'netobjects'}{$src};
				} elsif (exists $configFROM_ref->{'netgroupobjs'}{$src}) {
					$grpcountfrom++;
					$groups{$src} = $configFROM_ref->{'netgroupobjs'}{$src};
					$bingroups{$src} = $configFROM_ref->{'bingroups'}{$src};
					foreach my $netobj (keys %{$configFROM_ref->{'netgroupobjs'}{$src}}) {
						$objcountfrom++;
						$netobjs{$netobj} = $configFROM_ref->{'netobjects'}{$netobj};
					}
				} elsif (exists $configTO_ref->{'netobjects'}{$src}) {
					$objcountto++;
					$netobjs{$src} = $configTO_ref->{'netobjects'}{$src};
				} elsif (exists $configFROM2_ref->{'netobjects'}{$src}) {
					$objcountfrom2++;
					$netobjs{$src} = $configFROM2_ref->{'netobjects'}{$src};
				} elsif (exists $configTO_ref->{'netgroupobjs'}{$src}) {
					$grpcountto++;
					$groups{$src} = $configTO_ref->{'netgroupobjs'}{$src};
					$bingroups{$src} = $configTO_ref->{'bingroups'}{$src};
					foreach my $netobj (keys %{$configTO_ref->{'netgroupobjs'}{$src}}) {
						$objcountto++;
						$netobjs{$netobj} = $configTO_ref->{'netobjects'}{$netobj};
					}
				} elsif (exists $configFROM2_ref->{'netgroupobjs'}{$src}) {
					$grpcountfrom2++;
					$groups{$src} = $configFROM2_ref->{'netgroupobjs'}{$src};
					$bingroups{$src} = $configFROM2_ref->{'bingroups'}{$src};
					foreach my $netobj (keys %{$configFROM2_ref->{'netgroupobjs'}{$src}}) {
						$objcountfrom2++;
						$netobjs{$netobj} = $configFROM2_ref->{'netobjects'}{$netobj};
					}
				} else {
					print " MISSED SRC: $src\n";
				} 
			}

		# NOTE: identify rule DESTINATION objects from the two sorce configs supplied

			foreach my $dst (@dsts) {
				if (exists $configFROM_ref->{'netobjects'}{$dst}) {
					$objcountfrom++;
					$netobjs{$dst} = $configFROM_ref->{'netobjects'}{$dst};
				} elsif (exists $configFROM_ref->{'netgroupobjs'}{$dst}) {
					$grpcountfrom++;
					$groups{$dst} = $configFROM_ref->{'netgroupobjs'}{$dst};
					$bingroups{$dst} = $configFROM_ref->{'bingroups'}{$dst};
					foreach my $netobj (keys %{$configFROM_ref->{'netgroupobjs'}{$dst}}) {
						$objcountfrom++;
						$netobjs{$netobj} = $configFROM_ref->{'netobjects'}{$netobj};
					}
				} elsif (exists $configTO_ref->{'netobjects'}{$dst}) {
					$objcountto++;
					$netobjs{$dst} = $configTO_ref->{'netobjects'}{$dst};
				} elsif (exists $configFROM2_ref->{'netobjects'}{$dst}) {
					$objcountfrom2++;
					$netobjs{$dst} = $configFROM2_ref->{'netobjects'}{$dst};
				} elsif (exists $configTO_ref->{'netgroupobjs'}{$dst}) {
					$grpcountto++;
					$groups{$dst} = $configTO_ref->{'netgroupobjs'}{$dst};
					$bingroups{$dst} = $configTO_ref->{'bingroups'}{$dst};
					foreach my $netobj (keys %{$configTO_ref->{'netgroupobjs'}{$dst}}) {
						$objcountto++;
						$netobjs{$netobj} = $configTO_ref->{'netobjects'}{$netobj};
					}
				} elsif (exists $configFROM2_ref->{'netgroupobjs'}{$dst}) {
					$grpcountfrom2++;
					$groups{$dst} = $configFROM2_ref->{'netgroupobjs'}{$dst};
					$bingroups{$dst} = $configFROM2_ref->{'bingroups'}{$dst};
					foreach my $netobj (keys %{$configFROM2_ref->{'netgroupobjs'}{$dst}}) {
						$objcountfrom2++;
						$netobjs{$netobj} = $configFROM2_ref->{'netobjects'}{$netobj};
					}
				} else {
					print " MISSED DST: $dst\n";
				} 
			}

		# NOTE: identify rule SERVICE objects from the two sorce configs supplied

			foreach my $service (@services) {
				if (exists $configFROM_ref->{'srvcobjects'}{$service}) {
					$srvcfrom++;
					$srvcs{$service} = $configFROM_ref->{'srvcobjects'}{$service};
				} elsif (exists $configFROM_ref->{'srvcgroupobjs'}{$service}) {
					$grpsrvcfrom++;
					$srvcgrps{$service} = $configFROM_ref->{'srvcgroupobjs'}{$service};
					$portgroups{$service} = $configFROM_ref->{'portgroups'}{$service};
					foreach my $srvcobj (keys %{$configFROM_ref->{'srvcgroupobjs'}{$service}}) {
						$srvcfrom++;
						$srvcs{$srvcobj} = $configFROM_ref->{'srvcobjects'}{$srvcobj};
					}
				} elsif (exists $configTO_ref->{'srvcobjects'}{$service}) {
					$srvcto++;
					$srvcs{$service} = $configTO_ref->{'srvcobjects'}{$service};
				} elsif (exists $configFROM2_ref->{'srvcobjects'}{$service}) {
					$srvcfrom2++;
					$srvcs{$service} = $configFROM2_ref->{'srvcobjects'}{$service};
				} elsif (exists $configTO_ref->{'srvcgroupobjs'}{$service}) {
					$grpsrvcto++;
					$srvcgrps{$service} = $configTO_ref->{'srvcgroupobjs'}{$service};
					$portgroups{$service} = $configTO_ref->{'portgroups'}{$service};
					foreach my $srvcobj (keys %{$configTO_ref->{'srvcgroupobjs'}{$service}}) {
						$srvcto++;
						$srvcs{$srvcobj} = $configTO_ref->{'srvcobjects'}{$srvcobj};
					}
				} elsif (exists $configFROM2_ref->{'srvcgroupobjs'}{$service}) {
					$grpsrvcfrom2++;
					$srvcgrps{$service} = $configFROM2_ref->{'srvcgroupobjs'}{$service};
					$portgroups{$service} = $configFROM2_ref->{'portgroups'}{$service};
					foreach my $srvcobj (keys %{$configFROM2_ref->{'srvcgroupobjs'}{$service}}) {
						$srvcfrom2++;
						$srvcs{$srvcobj} = $configFROM2_ref->{'srvcobjects'}{$srvcobj};
					}
				} else {
					print " MISSED SRVC: $service\n";
				}
			}

		# NOTE: build the binary ip's tree for the new config bundle

			foreach my $netobj (keys %netobjs) {
				foreach my $ipbin (keys %{$netobjs{$netobj}{'ipbin'}}) {
					$ipbins{$ipbin}{'name'} = $netobj;
				}
			}

		# NOTE: build the ports tree for the new config bundle

			foreach my $srvc (keys %srvcs) {
				foreach my $proto (keys %{$srvcs{$srvc}{'ports'}}) {
					foreach my $port (keys %{$srvcs{$srvc}{'ports'}{$proto}}) {
						$ports{$proto}{$port}{'name'} = $srvc;
					}
				}
			}
		}

#---------------------------------------------------------------------------------------------------
# PRINTING NUMBERS OF OBJECTS PULLED FROM EACH CONFIG BUNDLE
#---------------------------------------------------------------------------------------------------

		print "   Found Rules Numbering: $rulecount\n\n";
		print "   POLICY PACK: $configfrom\n";
		print "    Objects:		$objcountfrom\n";
		print "    Obj Groups:		$grpcountfrom\n";
		print "    Services:		$srvcfrom\n";
		print "    Srvc Groups: 	$grpsrvcfrom\n";
		print "   POLICY PACK: $configfrom2\n";
		print "    Objects:		$objcountfrom2\n";
		print "    Obj Groups:		$grpcountfrom2\n";
		print "    Services:		$srvcfrom2\n";
		print "    Srvc Groups: 	$grpsrvcfrom2\n";
		print "   POLICY PACK: $configto\n";
		print "    Objects: 		$objcountto\n";
		print "    Obj Groups:		$grpcountto\n";
		print "    Services:		$srvcto\n";
		print "    Srvc Groups: 	$grpsrvcto\n";
		
		#print "\n\nDEST RULES\n########################################################\n\n". Dumper(%{$configTO_ref->{'rules'}});

		my  %errormessages;

		if ($configout eq 'od') {

			output_odumper_csv_file(
				\%srctmpbundle, 
				$configbundles{$configto}, 
				\%netobjs, 
				\%srvcs, 
				\%groups, 
				\%srvcgrps, 
				\%rashprintbase, 
				\%errormessages, 
				'keepcomments');
		} 

		elsif ($configout eq 'ns') {

			output_netscreen(
				\%srctmpbundle, 
				$configbundles{$configto}, 
				\%netobjs, 
				\%srvcs, 
				\%groups, 
				\%srvcgrps, 
				\%rashprintbase, 
				\%errormessages, 
				'keepcomments');
		} 

		elsif ($configout eq 'cs') {

			output_cisco_and_csv_file(
				\%srctmpbundle, 
				$configbundles{$configto}, 
				\%netobjs, 
				\%srvcs, 
				\%groups, 
				\%srvcgrps, 
				\%rashprintbase, 
				\%errormessages, 
				'keepcomments');
		}
	}
}

