		print " 	NOTE: This requires log files and can produce much larger rulebases.\n"		;	 
		print " 	[yes|no] - or '.' or default (no)\n\n"							;
	
		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$resanytoip = $_									;
				last 											;
			} elsif ($_ eq '.') {
				$resanytoip = 'no';
				print "	* ADDED Option: $resanytoip\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"						;
			}
		}

		print " 	Resolve SERVICE OBJECT \"Any\" to the speciffic services SEEN IN THE LOG FILES?\n"	;
		print " 	NOTE: This requires log files and can produce much larger rulebases.\n"		;	 
		print " 	[yes|no] - or '.' or default (no)\n\n"							;
	
		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$resanytosrvc = $_									;
				last 											;
			} elsif ($_ eq '.') {
				$resanytosrvc = 'no';
				print "	* ADDED Option: $resanytosrvc\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"						;
			}
		}

		print " 	Resolve \"Any\" to the speciffic IP seen in the logs and REVERSE LOOKUP NAME?\n"	;
		print " 	NOTE: This requires log files and can produce much larger rulebases.\n"		;	 
		print " 	NOTE: This requires network access and can take a long time.\n"		;	 
		print " 	[yes|no] - or '.' or default (no)\n\n"							;
	
		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$resnetnames = $_									;
				last 											;
			} elsif ($_ eq '.') {
				$resnetnames = 'no';
				print "	* ADDED Option: $resnetnames\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"						;
			}
		}

		print " 	Match rules and supernets aginst PREVIOUSLY EXPANDED rules?\n"				;
		print " 	Check each rule as its being expanded against alrady expanded rules\n"			; 
		print " 	[yes|no] - or '.' for default (no)\n\n"							;
	
		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$matchprevrules = $_									;
				last 											;
			} elsif ($_ eq '.') {
				$matchprevrules = 'no';
				print "	* ADDED Option: $matchprevrules\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"						;
			}
		}
	
		print " 	Match ACCEPT rules against ENCRTPYION rules FROM EARLIER in the MERGE FROM rulebase?\n"	;
		print " 	Check each rule as its being expanded against already expanded encryption rules\n"	; 
		print " 	[yes|no] - or '.' for default (no)\n\n"							;

		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$matchprevencryptrules = $_								;
				last 											;
			} elsif ($_ eq '.') {
				$matchprevencryptrules = 'no';
				print "	* ADDED Option: $matchprevencryptrules\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"						;
			}
		}
	
		print " 	Include ENCRYPTION rules from the MERGE TO rulebase in the filter match rulebase?\n"	;
		print " 	Check each accept rule against expanded accept rules AND ENCRYPTION rules?\n"		;	 
		print " 	[yes|no] - or '.' or default (yes)\n\n"							;
	
		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$addencryptrules = $_									;
				last 											;
			} elsif ($_ eq '.') {
				$addencryptrules = 'yes';
				print "	* ADDED Option: $addencryptrules\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"						;
			}
		}

		print " 	Output VERBOSE information during Rule Rationalization?\n"				;	 
		print " 	[yes|no] - or '.' or default (no)\n\n"							;

		while (<STDIN>) {
			chomp($_) 											;
			if ($_ =~ /^yes$|^no$/) {
				$verbose = $_										;
				last 											;
			} elsif ($_ eq '.') {
				$verbose = 'no';
				print "	* ADDED Option: $verbose\n\n";
				last;
			} else {
				print " 	ERROR: type 'yes' or 'no'\n"					;
			}
		}
	}

# NOTE: choose config bundle to merge rules to

	print "\n-----------------------------------------------------------------------------------------\n"	;
	print "     Choose the TYPE OF RULEASE you want to build:\n\n";
	print " 	TYPES:	ds 	= dst-src-srvc priority   - primary\n"; 
	print " 		sr 	= srvc-dst-src priority\n"; 
	print " 		cl 	= clean original rules\n"; 
	print " 		hc 	= sort rules by hit count - requires loaded logs and 'yes' in log filter\n\n"; 
	if ($logparsetype eq 'normal') {
		print " 	[ds|sr|cl|hc] - or '.' or default (ds)\n\n";
	} else {
		print " 	[ds|sr|cl|hc] - or '.' or default (hc)\n\n";
	}

	while (<STDIN>) {
		chomp($_) 											;
		if ($_ =~ /^ds$|^sr|^cl$|^hc$/) {
			$rulebasetype = $_									;
			last 											;
		} elsif ($_ eq '.') {
			if ($logparsetype eq 'normal') {
				$rulebasetype = 'ds';
			} else {
				$rulebasetype = 'hc';
			}

			print "	* ADDED Option: $rulebasetype\n\n";
			last;
		} else {
			print " 	ERROR: type 'ds' or 'sr' or 'cl' or 'hc'\n"				;
		}
	}

	if ($translatewithnats eq 'yes') {
		print "\n"												;
		print "\n-----------------------------------------------------------------------------------------\n"	;
		print " BUILDING NAT MATCH TREE:\n"									;

		if ($translatewithnats eq 'yes') {
			my $sourceNATS_ref = $configbundles{$sourceconfig}{'nats'};

			foreach my $natrule (keys %{$sourceNATS_ref}) {
				foreach my $srcnatbin (keys %{$sourceNATS_ref->{$natrule}{'origsrcbins'}}) {
					foreach my $dstnatbin (keys %{$sourceNATS_ref->{$natrule}{'origdstbins'}}) {
						foreach my $origproto (keys %{$sourceNATS_ref->{$natrule}{'origsrvcports'}}) {
							foreach my $origport (keys %{$sourceNATS_ref->{$natrule}{'origsrvcports'}{$origproto}}) {
								$nats{$dstnatbin}{$srcnatbin}{$origproto}{$origport}{$natrule}++;
							}
						}
					}
				}
			}
		}
	}

	#print "NATS			\n##########################################################################\n\n". Dumper(%nats) . "\n\n"	;

	print "\n"												;
	print "\n-----------------------------------------------------------------------------------------\n"	;
	print " STARTING FILTER MATCH ANALYSYS:\n"								;

	$rulebincount = build_dest_rules(
		$addencryptrules,
		\%configbundles,
		$destconfig,
		\%destinstallons,
		\@destrulegroups,
		\%mergetorulebases,
		\%rashrulegroups,
		$rulebincount,
		$rulebincountholder,
		$rulebincountquick,
		$verbose);

	print "\n---------------------------------------------------$rulebincount	MERGE BASE DONE\n" if defined($destconfig);

	$rulebincount 		= 0	;
	$rulebincountholder 	= 0	;
	$rulebincountquick 	= 0	;

	$rulebincount = build_filter_rules(
		$filterconfig,
		\%filterinstallons,
		\%filterruleactions,
		\@filterrulegroups,
		\%filterruletypes,
		\%mergetorulebases,
		\%rashrulegroups,
		$rulebincount,
		$rulebincountholder,
		$rulebincountquick,
		$verbose); 

	print "\n---------------------------------------------------$rulebincount	FILTER BASE DONE\n" if defined($filterconfig);

	#print "MERGE TO RULES         	\n############################################################################\n\n". Dumper(%mergetorulebases) . "\n\n";

	$rulebincount 		= 0	;
	$rulebincountholder 	= 0	;
	$rulebincountquick 	= 0	;

	$rulebincount = build_rule_groups(
        	\%configbundles,
        	\%excludeips,
        	\%exheaderstrings,
        	\%exstrings,
        	$filterwithlog,
        	$incconobjs,
        	\%incheaderstrings,
        	\%includeips,
        	\%incstrings,
        	\%logtypes,
        	$matchprevencryptrules,
        	$matchprevrules,
        	\%mergetorulebases,
        	\%nats,
		\%pulledrules,
        	\%rashlogfilter,
        	\%rashrulegroups,
        	$restype,
        	$rulebincount,
        	$rulebincountholder,
        	$rulebincountquick,
        	$sourceconfig,
        	\@sourcerulegroups,
        	\%srcinstallons,
        	\%srcruleactions,
        	\%srcruletypes,
        	$translatewithnats,
	        \%transrules,
	        $filterunloggedrulewithlog,
		$verbose);

	print "\n---------------------------------------------------$rulebincount    	RULE BASE DONE\n";

	my $config_ref = $configbundles{$sourceconfig};

	if ($translatewithnats eq 'yes') {
		print "\n\nTRANSLATION RULES IN USE:\n";
		print "-----------------------------------------------------------------------------------------\n";
		print "NAT Rule Num, Orig Source, Orig Dest, Orig Service, Associated Security Rule,\n";


		foreach my $natnum (keys %transrules) {
			my @natsrc = keys %{$transrules{$natnum}{'src'}} ;
			my @natdst = keys %{$transrules{$natnum}{'dst'}} ;
			my @natsrvc = keys %{$transrules{$natnum}{'srvc'}} ;
			my @natglobalsecrule = keys %{$transrules{$natnum}{'secrule'}} ;
			my @natsecrule;
			foreach my $secrule (@natglobalsecrule) {
				my $natsecrule = $config_ref->{'rules'}{$secrule}{'rbnum'};
				push (@natsecrule, $natsecrule) ;
			}
			print "NAT Rule: $natnum, @natsrc, @natdst, @natsrvc, @natsecrule\n";
		}
	}

	#print "\n\nTRANS RULES\n########################################################################\n\n". Dumper(%transrules);

	print "\n\n-----------------------------------------------------------------------------------------\n";
	print " ORIGINAL RULES INCLUDED IN RATIONALIZATION:\n";
	print "   These are the original rules that were evaulated:\n";
	print "   Rule marked with 'NOT PROCESSED' could not be processed.\n\n";

	foreach my $rulegp (@sourcerulegroups) {
		foreach my $rulenum (sort numerically keys (%{$config_ref->{'rulegroups'}{$rulegp}})) {
			my $printorigrule = $config_ref->{'rulecsvs'}{$rulenum};
			$printorigrule =~ tr/;/ /;
			print "Global: $rulenum, ";
			print "Rule: ";
			print "$config_ref->{'rules'}{$rulenum}{'rbnum'}";
			if (exists $pulledrules{$rulenum}) {
				print " , $printorigrule\n";
			} else {
				print " NOT PROCESSED , $printorigrule\n";
			}
		}
	}

	print "\n\n-----------------------------------------------------------------------------------------\n";
	print " RULE FILTER SECTION COMPLETE:\n";
	print "   These are the original objects and rules that matched the filters:\n\n";

	#print "RATIONALIZED RULE GROUPS       	\n#################################################################################\n\n". Dumper(%rashrulegroups) . "\n\n";
	
	my %filteredorigirules;
	foreach my $logdst (keys %rashrulegroups) {
		foreach my $logsrc (keys %{$rashrulegroups{$logdst}}) {
			foreach my $logproto (keys %{$rashrulegroups{$logdst}{$logsrc}}) {
				foreach my $logport (keys %{$rashrulegroups{$logdst}{$logsrc}{$logproto}}) {
					foreach my $filterrule (keys %{$rashrulegroups{$logdst}{$logsrc}{$logproto}{$logport}}) {
						if (exists $config_ref->{'ports'}{$logproto} && exists $config_ref->{'ports'}{$logproto}{$logport}) {
							$filteredorigirules{$filterrule}{'services'}{$config_ref->{'ports'}{$logproto}{$logport}{'name'}}++;
						} else { 
							print "EMPTY SERVICE FOR: $logproto, $logport.  ADDING $logport AS SERVICE NAME\n";
							$filteredorigirules{$filterrule}{'services'}{$logport}++;
						}
						$filteredorigirules{$filterrule}{'src'}{$config_ref->{'ips'}{$logsrc}{'name'}}++;
						$filteredorigirules{$filterrule}{'dst'}{$config_ref->{'ips'}{$logdst}{'name'}}++;
					}
				}
			}
		}
	}
	print "ORIG RULE, SRC, DST, SERVICE, ACTION, DESCRIPTION\n";
	foreach my $filternum (sort numerically keys %filteredorigirules) {
		my @services = sort keys %{$filteredorigirules{$filternum}{'services'}};
		my @sources  = sort keys %{$filteredorigirules{$filternum}{'src'}};
		my @destins  = sort keys %{$filteredorigirules{$filternum}{'dst'}};
		my $action   = $config_ref->{'rules'}{$filternum}{'action'};
		my $rbnum    = $config_ref->{'rules'}{$filternum}{'rbnum'};
		my $descrip  = 'FILTERED RULE';
		if (exists $config_ref->{'rules'}{$filternum}{'comment'}) {
			$descrip  = $config_ref->{'rules'}{$filternum}{'comment'};
		}
		print "Global:$filternum Rule:$rbnum ###, @sources , @destins , @services , $action , $descrip\n";
	}

# NOTE: log filter section
# Expand the binary log file and compair it to the expanded rules hash
# Rules in the rashed rule groups are filtered and put into the rashlogfilter hash
		
	if ($filterwithlog =~ /^yes$|^loose$/) {

		print "\n\n-----------------------------------------------------------------------------------------\n";
		if ($logparsetype eq 'normal') {
			print " STARTING LOG TO RULE COMPARISON:\n";
		} else {
			print " STARTING DROP LOG TO RULE COMPARISON:\n";
		}

		my $logconncount	= 0;
		my $logtorulehitcount	= 0;

		($logtorulehitcount, $logconncount) = filter_rr_rules_with_logs(
        		$config_ref,
			$config_ref->{'ips'},
        		$logconncount,
        		$logtorulehitcount,
        		\%rashlogfilter,
        		\%rashrulegroups,
			$resanytoip,
			$resanytosrvc,
			$resnetnames,
			$verbose);

		print "-----------------------------------------------------------------------------------------\n";
		if ($logparsetype eq 'normal') {
			print "  LOG TO RULE COMPARISON COMPLETE:\n";
		} else {
			print "  DROP LOG TO RULE COMPARISON COMPLETE:\n";
		}
		print "    Number of log connections processed	= $logconncount\n"; 
		print "    Number of rules matched by conns 	= $logtorulehitcount\n";
	}

# NOTE: if no destination config is chosen use an empty hash as the dest config in subs

	my %dummydest;
	my $destconfig_ref = \%dummydest;
	if (defined($destconfig)) {
		$destconfig_ref = $configbundles{$destconfig};
	} 

	my ($sdrulebaseout_ref, $sdprintbaseout_ref, $sdobjsout_ref, $sdsrvcsout_ref, $sdgroupsout_ref, $sdsrvcgroupsout_ref, $errormessages_ref) ;
	my %errormessages;

	if ($rulebasetype eq 'ds') {

		print "\n-----------------------------------------------------------------------------------------\n";
		print " STARTING DST SRC PRIORITY RULE BUILD: - primary rule building mode\n";

		($sdrulebaseout_ref, $sdprintbaseout_ref, $sdobjsout_ref, $sdsrvcsout_ref, $sdgroupsout_ref, $sdsrvcgroupsout_ref, $errormessages_ref) = build_dst_src_rules(
			\%rashlogfilter, 
			$configbundles{$sourceconfig}, 
			$destconfig_ref) ;
	}

	elsif  ($rulebasetype eq 'sr') {

		print "\n-----------------------------------------------------------------------------------------\n";
		print " STARTING SERVICE PRIORITY RULE BUILD: \n";

		my %protodstsrcrash;
		foreach my $rdst (keys %rashlogfilter) {
			foreach my $rsrc (keys %{$rashlogfilter{$rdst}}) {
				foreach my $rservice (keys %{$rashlogfilter{$rdst}{$rsrc}}) {
					foreach my $rnum (keys %{$rashlogfilter{$rdst}{$rsrc}{$rservice}}) {
						$protodstsrcrash{$rservice}{$rdst}{$rsrc}{$rnum}++;
					}
				}
			}
		}

		($sdrulebaseout_ref, $sdprintbaseout_ref, $sdobjsout_ref, $sdsrvcsout_ref, $sdgroupsout_ref, $sdsrvcgroupsout_ref, $errormessages_ref)  = build_rules(
			\%protodstsrcrash, 
			$configbundles{$sourceconfig}, 
			$destconfig_ref) ;
	}

	elsif ($rulebasetype eq 'cl') {
		print "\n-----------------------------------------------------------------------------------------\n";
		print " CLEAN ORIGINAL RULES AND REGROUP OBJECTS MODE: \n\n";
		print "    Filtered and Regrouped Original Rules:\n\n";

		my (%lastrashrule, %lastrashprint, %resobjec, %ressvcs, %resobjgr, %ressrvcgr);
		($sdrulebaseout_ref, $sdprintbaseout_ref, $sdobjsout_ref, $sdsrvcsout_ref, $sdgroupsout_ref, $sdsrvcgroupsout_ref) 
		 = (\%lastrashrule, \%lastrashprint, \%resobjec, \%ressvcs, \%resobjgr, \%ressrvcgr) ;

		my %origdstsrcrash;
		foreach my $rdst (keys %rashlogfilter) {
			foreach my $rsrc (keys %{$rashlogfilter{$rdst}}) {
				foreach my $rservice (keys %{$rashlogfilter{$rdst}{$rsrc}}) {
					foreach my $rnum (keys %{$rashlogfilter{$rdst}{$rsrc}{$rservice}}) {
						$origdstsrcrash{$rnum}{$rdst}{$rsrc}{$rservice}{$rnum}++;
					}
				}
			}
		}

		my ($rrgroupcount, $rrgroupcountholder, $rrcount, $rrcountholder, $rulenumber) = (0,0,0,0,0);

		foreach my $origrule (sort numerically keys %origdstsrcrash ) {

        		($rrgroupcount, $rrgroupcountholder, $rrcount, $rrcountholder, $rulenumber)  = build_orig_dst_src_rules(
				$origdstsrcrash{$origrule}, 
				$configbundles{$sourceconfig}, 
				$destconfig_ref,
				$sdrulebaseout_ref, $sdprintbaseout_ref, $sdobjsout_ref, $sdsrvcsout_ref, $sdgroupsout_ref, $sdsrvcgroupsout_ref, \%errormessages,
        			$rrgroupcount, $rrgroupcountholder, $rrcount, $rrcountholder, $origrule);
		}

		$errormessages_ref = \%errormessages;
	}

	elsif ($rulebasetype eq 'hc') {

		print "\n-----------------------------------------------------------------------------------------\n";
		print " STARTING HIT COUNT (DST SRC) PRIORITY RULE BUILD: - needs logs and filter with logs 'yes'\n";

		($sdrulebaseout_ref, $sdprintbaseout_ref, $sdobjsout_ref, $sdsrvcsout_ref, $sdgroupsout_ref, $sdsrvcgroupsout_ref, $errormessages_ref) = build_hits_dst_src_rules(
			\%rashlogfilter, 
			$configbundles{$sourceconfig}, 
			$destconfig_ref) ;
	}



	print "\n\n-----------------------------------------------------------------------------------------\n";
	if ($logparsetype eq 'normal') {
		print " RASH RULE COMPARISON COMPLETE:\n\n";
	} else {
		print " RASH DROP PROFILE COMPARISON COMPLETE:\n\n";
	}
	print " 	Would you like to print the most recent rulebase to file\n";
	print " 	[no|od|ns|cs]\n\n";
	print " 	Choose: ";

	my $printquest;
	my $destrulebase;

	while (<STDIN>) {
		chomp($_) 								;
		if ($_ =~ /^od$|^no$|^ns$|^cs$/) {
			$printquest = $_						;
			last 								;
		} else {
			print "		ERROR: type 'od', 'ns', 'cs'  or  'no'\n"	;
		}
	}

	print "\n";

	if ($printquest eq 'od') {

		print "\n-----------------------------------------------------------------------------------------\n";
		print "  Rules Built From Hit Connetions output in Odumper format\n";

		my $ruleoutswitch = 'STANDARD';

		output_odumper_csv_file(
			$configbundles{$sourceconfig}, 
			$destconfig_ref, 
			$sdobjsout_ref, 
			$sdsrvcsout_ref, 
			$sdgroupsout_ref, 
			$sdsrvcgroupsout_ref, 
			$sdprintbaseout_ref,
			$errormessages_ref,
			$ruleoutswitch);
	} 

	elsif ($printquest eq 'ns') {

		print "\n-----------------------------------------------------------------------------------------\n";
		print "  Rules Built From Hit Connetions output in Netscreen ScreenOS format\n";

		my $ruleoutswitch = 'STANDARD';

		output_netscreen(
			$configbundles{$sourceconfig}, 
			$destconfig_ref,
			$sdobjsout_ref, 
			$sdsrvcsout_ref, 
			$sdgroupsout_ref, 
			$sdsrvcgroupsout_ref, 
			$sdprintbaseout_ref,
			$errormessages_ref,
			$ruleoutswitch);
	} 

	elsif ($printquest eq 'cs') {

		print "\n-----------------------------------------------------------------------------------------\n";
		print "  Rules Built From Hit Connetions output in Cisco ASA and Odumper CSV format\n";

		my $ruleoutswitch = 'STANDARD';

		output_cisco_and_csv_file(
			$configbundles{$sourceconfig}, 
			$destconfig_ref,
			$sdobjsout_ref, 
			$sdsrvcsout_ref, 
			$sdgroupsout_ref, 
			$sdsrvcgroupsout_ref, 
			$sdprintbaseout_ref,
			$errormessages_ref,
			$ruleoutswitch);
	}
}

sub hd_input_output {

	my ($header, 
	$details,
	$optionlist_ref,
	$optionschosen_ref,
	$required) = @_;

	my %templist;
	my $optcount = 0;
	my %tempoutlist;
 
	print $header;

	foreach my $option (sort keys (%{$optionlist_ref})) {
		$optcount++;
		print "	 Option: $optcount	$option\n";
		$templist{$optcount} = $option;
	}

	print $details;

	while (<STDIN>) {
		chomp;

	# NOTE: ignore empty lines

		next if $_ eq '';

	# NOTE: exit this step of the user input if required options have been met or if it can be skipped with '.'

		if ($_ eq '.') {

			if (defined($required) && ($required eq 'required')) {

				if (ref($optionschosen_ref) eq 'HASH') {
					if (scalar keys %{$optionschosen_ref} > 0) {
						last;
					} else {
						print "		ERROR: You must choose at least one option!\n";
						next;
					}
				} 

				elsif (ref($optionschosen_ref) eq 'SCALAR') {
					if (defined($$optionschosen_ref)) {
						last;
					} else {
						print "		ERROR: You must choose at least one option!\n";
						next;
					}
				}

				elsif (ref($optionschosen_ref) eq 'ARRAY') {
					if (scalar @$optionschosen_ref > 0) {
						last;
					} else {
						print "		ERROR: You must choose at least one option!\n";
						next;
					}
				} 
			} 

			else {
				last;
			}
		}

	# NOTE: check that the option is either an option number or value

		unless (exists $optionlist_ref->{$_} || exists $templist{$_} || (((ref($optionschosen_ref) eq 'HASH') || (ref($optionschosen_ref) eq 'ARRAY')) && ($_ eq '0'))) {
			print "		ERROR: \"$_\" not option number or option value, try again...\n" ;
			next;
		}

	# NOTE: assign the values for the options to their variables:

		if (exists $templist{$_}) {

		# NOTE: translate numbers to value names and add to the chosen options

			if (ref($optionschosen_ref) eq 'SCALAR') {
				$$optionschosen_ref = $templist{$_};
				last;
			} 

			elsif (ref($optionschosen_ref) eq 'HASH') {
				$optionschosen_ref->{$templist{$_}}++;
				$tempoutlist{$templist{$_}}++;
			} 

			elsif (ref($optionschosen_ref) eq 'ARRAY') {
				push (@$optionschosen_ref, $templist{$_});
				$tempoutlist{$templist{$_}}++;
			} 

			else {
				print "WHATS that?\n";
			}

		} 

		else {

		# NOTE: add values to the chosen options

			if (ref($optionschosen_ref) eq 'SCALAR') {
				$$optionschosen_ref = $_;
				last;
			} 

			elsif (ref($optionschosen_ref) eq 'HASH') {

				if ($_ eq '0') {
					foreach my $eachoption (sort keys %{$optionlist_ref}) {
						$optionschosen_ref->{$eachoption}++;
						print "	* ADDING Option: $eachoption\n";
					}
					last;
				} 

				else {
					$optionschosen_ref->{$_}++;
					$tempoutlist{$_}++;
				}
			} 

			elsif (ref($optionschosen_ref) eq 'ARRAY') {

				if ($_ eq '0') {
					foreach my $eachoption (sort keys %{$optionlist_ref}) {
						unless (exists $tempoutlist{$eachoption}) {
							push (@$optionschosen_ref, $eachoption);
							print "	* ADDING Option: $eachoption\n";
						}
					}
					last;
				} 

				else {
					push (@$optionschosen_ref, $_);
					$tempoutlist{$_}++;
				}
			} 
			else {
				print "WHATS that?\n";
			}
		}
	}
}

sub build_dest_rules {

	my ($addencryptrules,
	$configbundles_ref,
	$destconfig,
	$destinstallons_ref,
	$destrulegroups_aref,
	$mergetorulebases_ref,
	$rashrulegroups_ref,
	$rulebincount,
	$rulebincountholder,
	$rulebincountquick,
	$verbose) 		= @_	;

	unless (defined($destconfig)) { return ''; }

	my $destconfig_ref 		= $configbundles_ref->{$destconfig};
	my $destconfigRULES_ref 	= $destconfig_ref->{'rules'};
	my $destconfigNETOBJS_ref 	= $destconfig_ref->{'netobjects'};
	my $destconfigGRPOBJS_ref 	= $destconfig_ref->{'netgroupobjs'};
	my $destconfigSRVCOBJS_ref 	= $destconfig_ref->{'srvcobjects'};
	my $destconfigGRPSRVCS_ref 	= $destconfig_ref->{'srvcgroupobjs'};

	foreach my $rulegp (@$destrulegroups_aref) {
		my %mergetodrops;

		foreach my $rulenum (sort numerically keys (%{$destconfig_ref->{'rulegroups'}{$rulegp}})) {

			my $destconfigRULE_ref = $destconfigRULES_ref->{$rulenum};

			unless (exists $destconfigRULE_ref->{'type'} ) { 
				print "   WARNING:  UNKNOWN TYPE of RULE found in Rule Group:  $rulegp, Number:  $rulenum  - SKIPPED\n";
				next;
			}
			unless (exists $destconfigRULE_ref->{'action'} ) { 
				print "   WARNING:  UNKNOWN ACTION of RULE found in Rule Group:  $rulegp, Number:  $rulenum  - SKIPPED\n";
				next;
			}
			next if $destconfigRULE_ref->{'type'} 		eq 'disabled_sec_rule'	;
			next if $destconfigRULE_ref->{'type'} 		eq 'disabled_sec_nat_rule';
			next if $destconfigRULE_ref->{'action'} 	eq 'ClientAuth'		;

		 	if (exists $destconfigRULE_ref->{'srcneg'} 	&& $destconfigRULE_ref->{'srcneg'} 	eq 'yes') { next ;}
			if (exists $destconfigRULE_ref->{'dstneg'} 	&& $destconfigRULE_ref->{'dstneg'} 	eq 'yes') { next ;}
			if (exists $destconfigRULE_ref->{'srvcneg'} 	&& $destconfigRULE_ref->{'srvcneg'} 	eq 'yes') { next ;}
			if ($addencryptrules eq 'no') {
				next if $destconfigRULE_ref->{'action'} eq 'Encrypt'		;
				if (exists $destconfigRULE_ref->{'vpn'} && $destconfigRULE_ref->{'vpn'} 	ne 'Any') { next ;}	
			}
			foreach my $installon (keys %{$destinstallons_ref}) {
				unless (exists $destconfigRULE_ref->{'installon'}{$installon}	|| 
					exists $destconfigRULE_ref->{'installon'}{'Any'} 	|| 
					exists $destconfigRULE_ref->{'installon'}{'any'}) 	{
					next ;
				}

				my @rulesrcs  = filter_rule_net_obj_ungrouper($rulenum, 'src', $destconfigNETOBJS_ref, $destconfigGRPOBJS_ref, $destconfigRULES_ref)	;
				foreach my $rulesrc (@rulesrcs) {
					foreach my $srcbin (keys (%{$destconfigNETOBJS_ref->{$rulesrc}{'ipbin'}})) {
						my @ruledsts  = filter_rule_net_obj_ungrouper($rulenum, 'dst', $destconfigNETOBJS_ref, $destconfigGRPOBJS_ref, $destconfigRULES_ref)	;
						foreach my $ruledst (@ruledsts) {
							foreach my $dstbin (keys (%{$destconfigNETOBJS_ref->{$ruledst}{'ipbin'}})) {
								my @rulesrvcs = filter_rule_srvc_obj_ungrouper($rulenum, $destconfigSRVCOBJS_ref, $destconfigGRPSRVCS_ref, $destconfigRULES_ref);
								foreach my $rulesrvc (@rulesrvcs) {
									if (exists ($destconfig_ref->{'srvcexceptions'}{$rulesrvc})) {
										foreach my $ruleproto (keys (%{$destconfigSRVCOBJS_ref->{$rulesrvc}{'port'}})) {
											my $ruleproto = "srvcexception_$ruleproto"; 
											my $ruleport  = $rulesrvc;
											build_merge_to_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,
														$destconfigRULES_ref,$rashrulegroups_ref,\%mergetodrops,$mergetorulebases_ref,
														\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose)  ;
										}
									} elsif (exists ($destconfigSRVCOBJS_ref->{$rulesrvc})) {
										foreach my $ruleproto (keys (%{$destconfigSRVCOBJS_ref->{$rulesrvc}{'ports'}})) {
											foreach my $ruleport (keys (%{$destconfigSRVCOBJS_ref->{$rulesrvc}{'ports'}{$ruleproto}})) {
												build_merge_to_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,
															$destconfigRULES_ref,$rashrulegroups_ref,\%mergetodrops,$mergetorulebases_ref,
															\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose)  ;
											}
										}
									} else {
										my $ruleproto = 'portunknown'	;
										my $ruleport  =  $rulesrvc   	;
										build_merge_to_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,  
													$destconfigRULES_ref,$rashrulegroups_ref,\%mergetodrops,$mergetorulebases_ref,
													\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose)  ;
									}
								}
							}
						}
					}
				}
			}
		}
	}
	return $rulebincount;
}

sub build_filter_rules {

	my ($filterconfig,
	$filterinstallons_ref,
	$filterruleactions_ref,
	$filterrulegroups_aref,
	$filterruletypes_ref,
	$mergetorulebases_ref,
	$rashrulegroups_ref,
	$rulebincount,
	$rulebincountholder,
	$rulebincountquick,
	$verbose) 		= @_;
	
	unless (defined($filterconfig)) { return ''; }

	my $filterconf_ref 		= $configbundles{$filterconfig};
	my $filterconfRULES_ref		= $filterconf_ref->{'rules'};
	my $filterconfNETOBJS_ref	= $filterconf_ref->{'netobjects'};
	my $filterconfGRPOBJS_ref	= $filterconf_ref->{'netgroupobjs'};
	my $filterconfSRVCOBJS_ref	= $filterconf_ref->{'srvcobjects'};
	my $filterconfGRPSRVCS_ref	= $filterconf_ref->{'srvcgroupobjs'};

       FILTERRULE:
	foreach my $rulegp (@$filterrulegroups_aref) {
		my %mergetodrops;

		foreach my $rulenum (sort numerically keys (%{$filterconf_ref->{'rulegroups'}{$rulegp}})) {

			my $filterconfRULE_ref = $filterconfRULES_ref->{$rulenum};

			unless (exists $filterconfRULE_ref->{'type'} ) { 
				print "   WARNING:  UNKNOWN TYPE of RULE found in Rule Group:  $rulegp, Number:  $rulenum  - SKIPPED\n";
				next;
			}
			unless (exists $filterconfRULE_ref->{'action'} ) { 
				print "   WARNING:  UNKNOWN ACTION of RULE found in Rule Group:  $rulegp, Number:  $rulenum  - SKIPPED\n";
				next;
			}
			next if $filterconfRULE_ref->{'action'} 	eq 'ClientAuth'		;
			next if $filterconfRULE_ref->{'srcneg'} 	eq 'yes'		;
			next if $filterconfRULE_ref->{'dstneg'} 	eq 'yes'		;
			next if $filterconfRULE_ref->{'srvcneg'} 	eq 'yes'		;

			if ((scalar keys %{$filterruletypes_ref}) > 0) {
				my $includehit	= 0;
				if (exists $filterruletypes_ref->{$filterconfRULE_ref->{'type'}}) {
					$includehit++;
				}
				next FILTERRULE if $includehit == 0;
			}

			if ((scalar keys %{$filterruleactions_ref}) > 0) {
				my $includehit	= 0;
				if (($filterconfRULE_ref->{'vpn'} ne 'Any') && (exists $filterruleactions_ref->{'Encrypt'})) {
					$includehit++;
				} elsif (exists $filterruleactions_ref->{$filterconfRULE_ref->{'action'}}) {
					$includehit++;
				}
				next FILTERRULE if $includehit == 0;
			}

			foreach my $installon (keys %{$filterinstallons_ref}) {
				unless (exists $filterconfRULE_ref->{'installon'}{$installon}||
					exists $filterconfRULE_ref->{'installon'}{'Any'} 	||
					exists $filterconfRULE_ref->{'installon'}{'any'})	{
					next 	;
				}

				my @rulesrcs  = filter_rule_net_obj_ungrouper($rulenum, 'src', $filterconfNETOBJS_ref, $filterconfGRPOBJS_ref, $filterconfRULES_ref)	;
				foreach my $rulesrc (@rulesrcs) {
					foreach my $srcbin (keys (%{$filterconfNETOBJS_ref->{$rulesrc}{'ipbin'}})) {
						my @ruledsts  = filter_rule_net_obj_ungrouper($rulenum, 'dst', $filterconfNETOBJS_ref, $filterconfGRPOBJS_ref, $filterconfRULES_ref)	;
						foreach my $ruledst (@ruledsts) {
							foreach my $dstbin (keys (%{$filterconfNETOBJS_ref->{$ruledst}{'ipbin'}})) {
								my @rulesrvcs = filter_rule_srvc_obj_ungrouper($rulenum, $filterconfSRVCOBJS_ref, $filterconfGRPSRVCS_ref, $filterconfRULES_ref);
								foreach my $rulesrvc (@rulesrvcs) {
									if (exists ($filterconf_ref->{'srvcexceptions'}{$rulesrvc})) {
										foreach my $ruleproto (keys (%{$filterconfSRVCOBJS_ref->{$rulesrvc}{'port'}})) {
											my $ruleproto = "srvcexception_$ruleproto"; 
											my $ruleport  = $rulesrvc;
											build_merge_to_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,
														$filterconfRULES_ref,$rashrulegroups_ref,\%mergetodrops,$mergetorulebases_ref,
														\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose)  ;
										}
									} elsif (exists ($filterconfSRVCOBJS_ref->{$rulesrvc})) {
										foreach my $ruleproto (keys (%{$filterconfSRVCOBJS_ref->{$rulesrvc}{'ports'}})) {
											foreach my $ruleport (keys (%{$filterconfSRVCOBJS_ref->{$rulesrvc}{'ports'}{$ruleproto}})) {
												build_merge_to_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,
															$filterconfRULES_ref,$rashrulegroups_ref,\%mergetodrops,$mergetorulebases_ref,
															\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose)  ;
											}
										}
									} else {
										my $ruleproto = 'portunknown'	;
										my $ruleport  =  $rulesrvc   	;
										build_merge_to_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,  
													$filterconfRULES_ref,$rashrulegroups_ref,\%mergetodrops,$mergetorulebases_ref,
													\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose)  ;
									}
								}
							}
						}
					}
				}
			}
		}
	}
	return $rulebincount;
}
				
sub build_rule_groups {

	my ($configbundles_ref,
	$excludeips_ref,
	$exheaderstrings_ref,
	$exstrings_ref,
	$filterwithlog,
	$incconobjs,
	$incheaderstrings_ref,
	$includeips_ref,
	$incstrings_ref,
	$logtypes_ref,
	$matchprevencryptrules,
	$matchprevrules,
	$mergetorulebases_ref,
	$nats_ref,
	$pulledrules_ref,
	$rashlogfilter_ref,
	$rashrulegroups_ref,
	$restype,
	$rulebincount,
	$rulebincountholder,
	$rulebincountquick,
	$sourceconfig,
	$sourcerulegroups_aref,
	$srcinstallons_ref,
	$srcruleactions_ref,
	$srcruletypes_ref,
	$translatewithnats,
	$transrules_ref,
	$filterunloggedrulewithlog,
	$verbose) 	= @_ ;

# NOTE:	!!IMPORTANT!!
#	Encryption rules and client encryption rules are no longer exempt from but they need both ends of a vpn to change to reconnect
#	You can enable it if you want to see how best you could simplify your VPN rules but you will need to speak to the 3rd parties at the other end 
#	before making changes, the same applies to NAT rules

	my $config_ref 		= $configbundles_ref->{$sourceconfig};
	my $configRULES_ref	= $config_ref->{'rules'};
	my $configNETOBJS_ref	= $config_ref->{'netobjects'};
	my $configGRPOBJS_ref	= $config_ref->{'netgroupobjs'};
	my $configSRVCOBJS_ref	= $config_ref->{'srvcobjects'};
	my $configGRPSRVCS_ref	= $config_ref->{'srvcgroupobjs'};

	foreach my $rulegp (@$sourcerulegroups_aref) {
		my %drops;

		RULE:
		foreach my $rulenum (sort numerically keys (%{$config_ref->{'rulegroups'}{$rulegp}})) {

			my $configRULE_ref = $configRULES_ref->{$rulenum};

			unless (exists $configRULE_ref->{'type'} ) { 
				print "   WARNING:  UNKNOWN TYPE of RULE found in Rule Group:  $rulegp, Number:  $rulenum  - SKIPPED\n";
				next;
			}
			unless (exists $configRULE_ref->{'action'} ) { 
				print "   WARNING:  UNKNOWN ACTION of RULE found in Rule Group:  $rulegp, Number:  $rulenum  - SKIPPED\n";
				next;
			}

		# NOTE: if you have an ald style checkpoint policy that needed accept rules under the encrypt rules comment out this next line
		#	this will cause the encrypt rules to be caught during the rule unwrap and added to the merge to rules, which will in turn
		#	remove the following matching accept rules

			next if $configRULE_ref->{'action'} 	eq 'ClientAuth'		;
			next if $configRULE_ref->{'srcneg'} 	eq 'yes'		;
			next if $configRULE_ref->{'dstneg'} 	eq 'yes'		;
			next if $configRULE_ref->{'srvcneg'} 	eq 'yes'		;

		# NOTE: exclude the drop and reject rules from the filters because they are all needed to ensure nothing that was dropped is now allowed

			if ($configRULE_ref->{'action'} !~ m/^drop$|^Drop$|^deny$|^Deny$|^reject$|^Reject$/) {

			# NOTE: string filters to INCLUDE rules that match the strings

				if ((scalar keys %{$incstrings_ref}) > 0) {
					my $includehit	= 0;
					foreach my $incfilter (keys %{$incstrings_ref}) {
						if ($config_ref->{'rulecsvs'}{$rulenum} =~ m/$incfilter/) {
							$includehit++;
						}
					}
					next RULE if $includehit == 0;
				}
				if ((scalar keys %{$incheaderstrings_ref}) > 0) {
					my $includehit	= 0;
					foreach my $inchedfilter (keys %{$incheaderstrings_ref}) {
						if ($configRULE_ref->{'header'} =~ m/$inchedfilter/) {
							$includehit++;
						}
					}
					next RULE if $includehit == 0;
				}
				if ((scalar keys %{$logtypes_ref}) > 0) {
					my %printwarnings;
					my $includehit	= 0;
					if (defined ($configRULE_ref->{'track'})) {
						if (exists $logtypes_ref->{$configRULE_ref->{'track'}}) {
							$includehit++;
						}
					} else {
						$printwarnings{"  NO LOG TYPE IN RULE $rulenum - RULE TREATED AS UNLOGGED"}++;
						$includehit++;
					}
					next RULE if $includehit == 0;
					foreach my $printwarning (sort keys %printwarnings) {
						print "\n$printwarning";
					}
				}

				if ((scalar keys %{$srcruletypes_ref}) > 0) {
					my $includehit	= 0;
					if (exists $srcruletypes_ref->{$configRULE_ref->{'type'}}) {
						$includehit++;
					}
					next RULE if $includehit == 0;
				}

				if ((scalar keys %{$srcruleactions_ref}) > 0) {
					my $includehit	= 0;
					if (($configRULE_ref->{'vpn'} ne 'Any') && (exists $srcruleactions_ref->{'Encrypt'})) {
						$includehit++;
					} elsif (exists $srcruleactions_ref->{$configRULE_ref->{'action'}}) {
						$includehit++;
					}
					next RULE if $includehit == 0;
				}

			# NOTE: string filters to EXCLUDE rules that match the strings

				foreach my $exstfilt (keys %{$exstrings_ref}) {
					next RULE if $config_ref->{'rulecsvs'}{$rulenum} =~ m/$exstfilt/;
				}
				foreach my $exhedstfilt (keys %{$exheaderstrings_ref}) {
					next RULE if $configRULE_ref->{'header'} =~ m/$exhedstfilt/ ;
				}
			}

			foreach my $installon (keys %{$srcinstallons_ref}) {
				unless (exists $configRULE_ref->{'installon'}{$installon} ||
					exists $configRULE_ref->{'installon'}{'Any'}  	 ||
					exists $configRULE_ref->{'installon'}{'any'}) 	 {
					next;
				}

				$pulledrules_ref->{$rulenum}++;
				my @rulesrcs  = filter_rule_net_obj_ungrouper($rulenum, 'src', $configNETOBJS_ref, $configGRPOBJS_ref, $configRULES_ref);
				foreach my $rulesrc (@rulesrcs) {
					foreach my $srcbin (keys (%{$configNETOBJS_ref->{$rulesrc}{'ipbin'}})) {
						my @ruledsts  = filter_rule_net_obj_ungrouper($rulenum, 'dst', $configNETOBJS_ref, $configGRPOBJS_ref, $configRULES_ref);
						foreach my $ruledst (@ruledsts) {
							foreach my $dstbin (keys (%{$configNETOBJS_ref->{$ruledst}{'ipbin'}})) {
								my @rulesrvcs = filter_rule_srvc_obj_ungrouper($rulenum, $configSRVCOBJS_ref, $configGRPSRVCS_ref, $configRULES_ref)	;
								foreach my $rulesrvc (@rulesrvcs) {
									if (exists ($config_ref->{'srvcexceptions'}{$rulesrvc})) {
										foreach my $ruleproto (keys (%{$configSRVCOBJS_ref->{$rulesrvc}{'port'}})) {
											my $ruleproto = "srvcexception_$ruleproto"; 
											my $ruleport  = $rulesrvc;
											if (($matchprevencryptrules eq 'yes')   &&
											   (($configRULE_ref->{'action'} 	eq 'Encrypt') ||
											    ($configRULE_ref->{'vpn'} 	 	ne 'Any') ) )  {
												add_encrypt_to_mergeto_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,
														$configRULES_ref,$mergetorulebases_ref,\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose);
											} else {
												rulegroup_bin_and_subnet_proc_add($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,
													$incconobjs,$configRULES_ref,$configNETOBJS_ref,$config_ref->{'ips'},$config_ref->{'srvcstree'},
													$includeips_ref,$excludeips_ref,$rashrulegroups_ref,$rashlogfilter_ref,\%drops,$mergetorulebases_ref,$nats_ref,
													$config_ref->{'nats'},$transrules_ref,\$rulebincount,\$rulebincountquick,\$rulebincountholder,
													\$filterwithlog,\$translatewithnats,$matchprevrules,$restype,$filterunloggedrulewithlog,$verbose);
											}
										}
									} elsif (exists ($configSRVCOBJS_ref->{$rulesrvc})) {
										foreach my $ruleproto (keys (%{$configSRVCOBJS_ref->{$rulesrvc}{'ports'}})) {
											foreach my $ruleport (keys (%{$configSRVCOBJS_ref->{$rulesrvc}{'ports'}{$ruleproto}})) {
												if (($matchprevencryptrules eq 'yes')	&&
												   (($configRULE_ref->{'action'} 	eq 'Encrypt') || 
											    	    ($configRULE_ref->{'vpn'} 		ne 'Any') ) )  {
													add_encrypt_to_mergeto_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,
														$ruleport,$configRULES_ref,$mergetorulebases_ref,\$rulebincount,\$rulebincountquick,
														\$rulebincountholder,$verbose)  ;
												} else {
													rulegroup_bin_and_subnet_proc_add($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,
														$ruleport,$incconobjs,$configRULES_ref,$configNETOBJS_ref,$config_ref->{'ips'},
														$config_ref->{'srvcstree'},$includeips_ref,$excludeips_ref,$rashrulegroups_ref,$rashlogfilter_ref,\%drops,
														$mergetorulebases_ref,$nats_ref,$config_ref->{'nats'},$transrules_ref,\$rulebincount,\$rulebincountquick,
														\$rulebincountholder,\$filterwithlog,\$translatewithnats,$matchprevrules,$restype,$filterunloggedrulewithlog,$verbose);
												}
											}
										}
									} else {
										my $ruleproto = 'portunknown'	;
										my $ruleport  =  $rulesrvc   	;
										if (($matchprevencryptrules eq 'yes')	&&
										   (($configRULE_ref->{'action'} 	eq 'Encrypt') ||
									    	    ($configRULE_ref->{'vpn'} 		ne 'Any') ) )  {
											add_encrypt_to_mergeto_rulebase($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,
														$configRULES_ref,$mergetorulebases_ref,\$rulebincount,\$rulebincountquick,\$rulebincountholder,$verbose);
										} else {
											rulegroup_bin_and_subnet_proc_add($rulenum,$rulesrc,$srcbin,$ruledst,$dstbin,$ruleproto,$rulesrvc,$ruleport,$incconobjs,
												$configRULES_ref,$configNETOBJS_ref,$config_ref->{'ips'},$config_ref->{'srvcstree'},$includeips_ref,$excludeips_ref,
												$rashrulegroups_ref,$rashlogfilter_ref,\%drops,$mergetorulebases_ref,$nats_ref,$config_ref->{'nats'},$transrules_ref,
												\$rulebincount,\$rulebincountquick,\$rulebincountholder,\$filterwithlog,\$translatewithnats,$matchprevrules,
												$restype,$filterunloggedrulewithlog,$verbose);
										}
									}
								}
							}
						}
					}
				}
			}
		}
	}
	return $rulebincount;
}

sub filter_rr_rules_with_logs {

	my ($config_ref,
	$ips_ref,
	$logconncount,
	$logtorulehitcount,
	$rashlogfilter_ref,
	$rashrulegroups_ref,
	$resanytoip,
	$resanytosrvc,
	$resnetnames,
	$verbose)		= @_ ;

	my $srvcexceps 		= $config_ref->{'srvcexceptions'};
	my $netobjects_ref 	= $config_ref->{'netobjects'};
	
	my $logconnplaceholder	= 0;

	foreach my $logdstorig (keys %{$config_ref->{'logbins'}}) {
		foreach my $logsrcorig (keys %{$config_ref->{'logbins'}{$logdstorig}}) {
			foreach my $logproto (keys %{$config_ref->{'logbins'}{$logdstorig}{$logsrcorig}}) {
				foreach my $logport (keys %{$config_ref->{'logbins'}{$logdstorig}{$logsrcorig}{$logproto}}) {
					$logconncount++;

					my @origrules 		= sort numerically keys %{$config_ref->{'logbins'}{$logdstorig}{$logsrcorig}{$logproto}{$logport}};
					my $origrulehits 	= 0 ;

					foreach my $origrulenum (@origrules) {
						$origrulehits += $config_ref->{'logbins'}{$logdstorig}{$logsrcorig}{$logproto}{$logport}{$origrulenum};
					}

					my $hitcount = 0;
					my $logdst = $logdstorig;
					for (my $i = 32 ; $i >= 0 ; $i--) {
						if (exists $rashrulegroups_ref->{$logdst}) {
							my $logsrc = $logsrcorig;
							for (my $i2 = 32 ; $i2 >= 0 ; $i2--) {
								if (exists $rashrulegroups_ref->{$logdst}{$logsrc}) {

									my $rashipshit_ref = $rashrulegroups_ref->{$logdst}{$logsrc};

									my $logsrcout = $logsrc;
									my $logdstout = $logdst;

									my ($srcname, $srcip);
									my ($dstname, $dstip);
									my $srcnetmask = '255.255.255.224';
									my $dstnetmask = '255.255.255.224';

									if ($resanytoip eq 'yes') {

										if ($logsrc eq "") {

											$logsrcout = $logsrcorig;

											until ((exists $ips_ref->{$logsrcout}) || ($logsrcout eq "")) {
												chop $logsrcout; 
											}

											if ($logsrcout eq "") {

												if ($resnetnames eq 'no') {

													$logsrcout       = substr($logsrcorig, 0, 27);

													my $logsrcippad  = $logsrcout;
													   $logsrcippad .= '00000';

													my @splitbinip   = unpack '(a8)*', $logsrcippad;

													my @decip;
													foreach my $decimalnum (@splitbinip) {
														push (@decip, oct("0b".$decimalnum));
													}

													$srcip   = join('.', @decip);
													$srcname = "Log_Net_$srcip\-255.255.255.224";
													$srcnetmask = '255.255.255.224';

												} else {
													$logsrcout = $logsrcorig;

													my @splitbinip   = unpack '(a8)*', $logsrcorig;

													my @decip;
													foreach my $decimalnum (@splitbinip) {
														push (@decip, oct("0b".$decimalnum));
													}

													$srcip   = join('.', @decip);
													my $resname = res_ip_to_name($srcip);

													if (defined($resname)) {

														$srcname = "$resname\-$srcip";
														$srcnetmask = '255.255.255.255';
														#print "PING1: $srcname\n";

													} else {

														$logsrcout       = substr($logsrcorig, 0, 27);

														my $logsrcippad  = $logsrcout;
														   $logsrcippad .= '00000';

														@splitbinip   = unpack '(a8)*', $logsrcippad;

														undef @decip;
														foreach my $decimalnum (@splitbinip) {
															push (@decip, oct("0b".$decimalnum));
														}

														$srcip   = join('.', @decip);
														$srcname = "Log_Net_$srcip\-255.255.255.224";
														$srcnetmask = '255.255.255.224';
														#print "PONG1 $srcname\n";
													}
												}
											}
										}

										if ($logdst eq "") {

											$logdstout = $logdstorig;

											until ((exists $ips_ref->{$logdstout}) || ($logdstout eq "")) {
												chop $logdstout; 
											}

											if ($logdstout eq "") {

												if ($resnetnames eq 'no') {
													$logdstout       = substr($logdstorig, 0, 27);
	
													my $logdstippad  = $logdstout;
													   $logdstippad .= '00000';
	
													my @splitbinip   = unpack '(a8)*', $logdstippad;
	
													my @decip;
													foreach my $decimalnum (@splitbinip) {
														push (@decip, oct("0b".$decimalnum));
													}

													$dstip   = join('.', @decip);
													$dstname = "Log_Net_$dstip\-255.255.255.224";
													$dstnetmask = '255.255.255.224';

												} else {
													$logdstout       = $logdstorig;

													my @splitbinip   = unpack '(a8)*', $logdstorig;

													my @decip;
													foreach my $decimalnum (@splitbinip) {
														push (@decip, oct("0b".$decimalnum));
													}

													$dstip   = join('.', @decip);
													my $resname = res_ip_to_name($dstip);

													if (defined($resname)) {

														$dstname = "$resname-$dstip";
														$dstnetmask = '255.255.255.255';
														#print "PING: $dstname\n";

													} else {

														$logdstout       = substr($logdstorig, 0, 27);

														my $logdstippad  = $logdstout;
														   $logdstippad .= '00000';

														@splitbinip      = unpack '(a8)*', $logdstippad;

														undef @decip;
														foreach my $decimalnum (@splitbinip) {
															push (@decip, oct("0b".$decimalnum));
														}

														$dstip   = join('.', @decip);
														$dstname = "Log_Net_$dstip\-255.255.255.224";
														$dstnetmask = '255.255.255.224';
														#print "PONG $dstname\n";
													}
												}
											}
										}
									}


									if (exists $rashipshit_ref->{$logproto} && exists $rashipshit_ref->{$logproto}{$logport}) {
										foreach my $rashrulenum (keys %{$rashipshit_ref->{$logproto}{$logport}}) {
											$rashlogfilter_ref->{$logdstout}{$logsrcout}{"$logproto~$logport"}{$rashrulenum} += $origrulehits;
											$hitcount++;
											$logtorulehitcount++;
										}

									} elsif ((exists $rashipshit_ref->{'any'}) && ((exists $rashipshit_ref->{'any'}{'Any'}) || (exists $rashipshit_ref->{'any'}{'any'}))) {
										foreach my $rashrulenum (keys %{$rashipshit_ref->{'any'}{'any'}}) {
											if ($resanytosrvc eq 'yes') {
												$rashlogfilter_ref->{$logdstout}{$logsrcout}{"$logproto~$logport"}{$rashrulenum} += $origrulehits;
											} else {
												$rashlogfilter_ref->{$logdstout}{$logsrcout}{"any~any"}{$rashrulenum} += $origrulehits;
											}
											$hitcount++;
											$logtorulehitcount++;
										}

									} elsif (exists $rashipshit_ref->{"srvcexception_$logproto"}) {
										$logproto =~ s/^srvcexception_//;
										foreach my $srvcobj (keys %{$rashipshit_ref->{"srvcexception_$logproto"}}) {
											if (exists $config_ref->{'srvcobjects'}{$srvcobj}{'ports'}{$logproto}) {
												if (exists $config_ref->{'srvcobjects'}{$srvcobj}{'ports'}{$logproto}{$logport}) {
													foreach my $rashrulenum (keys %{$rashipshit_ref->{"srvcexception_$logproto"}{$srvcobj}}) {
														$rashlogfilter_ref->{$logdstout}{$logsrcout}{"srvcexception_$logproto~$srvcobj"}{$rashrulenum} += $origrulehits;
														$hitcount++;
														$logtorulehitcount++;
													}
												}
											}
										}
									}
									if ($hitcount > 0) {
										if (defined($srcname)) {

											my @dummy;
											#print "POW src: $srcname, $srcip, $srcnetmask\n";
											add_net($srcname,$srcip,$srcnetmask, \@dummy, $netobjects_ref, $ips_ref);
										}

										if (defined($dstname)) {

											my @dummy;
											#print "POW dst $dstname, $dstip, $dstnetmask\n";
											add_net($dstname,$dstip,$dstnetmask, \@dummy, $netobjects_ref, $ips_ref);
										}
									}
								}
								chop($logsrc);
							}
						}
						chop($logdst);
					}
					if ($logconncount >= ($logconnplaceholder + 10000)) {
						print "....................................................$logconncount	connections processed\n";
						$logconnplaceholder = $logconncount;
					}

				# NOTE: check to see if the log matched and print details

					if ($verbose eq 'yes') {
						if ($hitcount > 0) {
							my %dummy;
							my @dstnames = find_net_object_and_supernets_and_duplicates($logdstorig,$config_ref->{'ips'},\%dummy) ;
							my @srcnames = find_net_object_and_supernets_and_duplicates($logsrcorig,$config_ref->{'ips'},\%dummy) ;
							print "   hit, src (@srcnames), dst (@dstnames), $logproto, $logport, rules:@origrules\n";
						} else {
							my %dummy;
							my @dstnames = find_net_object_and_supernets_and_duplicates($logdstorig,$config_ref->{'ips'},\%dummy) ;
							my @srcnames = find_net_object_and_supernets_and_duplicates($logsrcorig,$config_ref->{'ips'},\%dummy) ;
							print "MISSED, SRC (@srcnames), DST (@dstnames), $logproto, $logport, RULES:@origrules\n";
						}
					}
				}
			}
		}
	}	
	return ($logtorulehitcount, $logconncount);
}

sub merge_binary_logs {

	my ($configFROM_ref,
	$configTO_ref,
	$logconncount_ref,
	$logtologhitcount_ref,
	$verbose)		= @_ ;

	foreach my $logdstorig (keys %{$configFROM_ref}) {
		foreach my $logsrcorig (keys %{$configFROM_ref->{$logdstorig}}) {
			foreach my $logproto (keys %{$configFROM_ref->{$logdstorig}{$logsrcorig}}) {
				foreach my $logport (keys %{$configFROM_ref->{$logdstorig}{$logsrcorig}{$logproto}}) {
					foreach my $origrule (keys %{$configFROM_ref->{$logdstorig}{$logsrcorig}{$logproto}{$logport}}) {
						$$logconncount_ref++;
						
						if (exists $configTO_ref->{$logdstorig} &&
						    exists $configTO_ref->{$logdstorig}{$logsrcorig} &&
						    exists $configTO_ref->{$logdstorig}{$logsrcorig}{$logproto} &&
						    exists $configTO_ref->{$logdstorig}{$logsrcorig}{$logproto}{$logport} &&
						    exists $configTO_ref->{$logdstorig}{$logsrcorig}{$logproto}{$logport}{$origrule}) {

							my $FROMruleHITcount =  $configFROM_ref->{$logdstorig}{$logsrcorig}{$logproto}{$logport}{$origrule};
							$configTO_ref->{$logdstorig}{$logsrcorig}{$logproto}{$logport}{$origrule} += $FROMruleHITcount;
							$$logtologhitcount_ref++;

						} else {
							my $FROMruleHITcount =  $configFROM_ref->{$logdstorig}{$logsrcorig}{$logproto}{$logport}{$origrule};
							$configTO_ref->{$logdstorig}{$logsrcorig}{$logproto}{$logport}{$origrule} = $FROMruleHITcount;
						}
					}
				}
			}
		}
	}
	#print "CONFIG FROM\n\n" . Dumper(%{$configFROM_ref});
	#print "CONFIG TO\n\n" . Dumper(%{$configTO_ref});
}
							
sub build_rules {
	my ($rashlogfilter_ref, $srcbundle_ref, $dstbundle_ref) = @_;
	my (%lastrashrulebase, %lastrashprintbase, %resobjects, %ressrvcs, %resobjgroups, %ressrvcgroups, %errormessages);
	
	print "-----------------------------------------------------------------------------------------\n";
	print " STARTING RULE COMPARISON: \n";
	print "   rationalizing rulebase FILTERED - RULEGROUP SPECIFFIC - SUBROUTE MODE!\n";

	my (%rationizedrules, %rashizedrules, %rashizedrules2, %rashizedrules3, %rashizedrules4, %rashizedrules5, $rrgroupcount, $rrgroupcountholder, $rrcount, $rrcountholder);
	($rrgroupcount, $rrgroupcountholder, $rrcount, $rrcountholder) = (0,0,0,0);

	foreach my $rashport (keys %{$rashlogfilter_ref}) {
		foreach my $rashdst (keys %{$rashlogfilter_ref->{$rashport}}) {
			my @seengroups;
			
			foreach my $groupname (keys %{$srcbundle_ref->{'bingroups'}}) {
				my ($match, $miss) = (0,0);
				my (%match, %miss) ;
				
				foreach my $gbin (keys %{$srcbundle_ref->{'bingroups'}{$groupname}}) {
					$rrgroupcount++;
					if (exists $rashlogfilter_ref->{$rashport}{$rashdst}{$gbin}) {
						$match++ ;	 
						$match{$gbin}++ ;
					} else {
						$miss++ ;	 
						$miss{$gbin}++ ;
					}
				}
				if (($match > 0) && ($miss < 1 )) {
					push (@seengroups, $groupname) ;
				}
			}
			if ($rrgroupcount >= ($rrgroupcountholder + 1000000)) {
				print "....................................................$rrgroupcount	src group comparisons made\n";
				$rrgroupcountholder = $rrgroupcount;
			}
			my %matchgroupbins;
			for (@seengroups) {
				$resobjgroups{$_}++;
				foreach my $grpbin (keys %{$srcbundle_ref->{'bingroups'}{$_}}) {
					$matchgroupbins{$grpbin} = $_;
				}
			}

			foreach my $rashsrc (keys %{$rashlogfilter_ref->{$rashport}{$rashdst}}) {
				foreach my $rulenum (keys %{$rashlogfilter_ref->{$rashport}{$rashdst}{$rashsrc}}) {
					$rrcount++;
					if (exists $matchgroupbins{$rashsrc}) {
						$rashizedrules{$rashport}{$matchgroupbins{$rashsrc}}{$rashdst}{$rulenum}++;
					#} elsif (exists $destbundle_ref->{'ips'}{$rashsrc}) {
					#	$rashizedrules{$rashport}{$destbundle_ref->{'ips'}{$rashsrc}{'name'}}{$rashdst}{$rulenum}++;
					} elsif (exists $srcbundle_ref->{'ips'}{$rashsrc}) {
						$rashizedrules{$rashport}{$srcbundle_ref->{'ips'}{$rashsrc}{'name'}}{$rashdst}{$rulenum}++;
						$resobjects{$srcbundle_ref->{'ips'}{$rashsrc}{'name'}}++;
					} else {
						$errormessages{"Unknown Source Object: $rashsrc"}++;
					}
				}
			}
			if ($rrcount >= ($rrcountholder + 25000)) {
				print "....................................................$rrcount	rule sources simplified\n";
				$rrcountholder = $rrcount;
			}
		}
	}

	#print "RATIONALIZED RULES         	\n############################################################################\n\n". Dumper(%rashizedrules) . "\n\n";

	print "   sources rationalized.............................DONE!\n"			;
	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0)	;
	#%rashrulegroups = ();

	foreach my $rashport2 (keys %rashizedrules) {
		foreach my $rashsrc2 (keys %{$rashizedrules{$rashport2}}) {
			my @seengroups;
			
			foreach my $groupname (keys %{$srcbundle_ref->{'bingroups'}}) {
				my ($match, $miss) = (0,0);
				my (%match, %miss) ;
				
				foreach my $gbin (keys %{$srcbundle_ref->{'bingroups'}{$groupname}}) {
					$rrgroupcount++;
					if (exists $rashizedrules{$rashport2}{$rashsrc2}{$gbin}) {
						$match++ ;	 
						$match{$gbin}++ ;
					} else {
						$miss++ ;	 
						$miss{$gbin}++ ;
					}
				}
				if (($match > 0) && ($miss < 1 )) {
					push (@seengroups, $groupname) ;
				}
			}
			if ($rrgroupcount >= ($rrgroupcountholder + 1000000)) {
				print "....................................................$rrgroupcount	dst group comparisons made\n";
				$rrgroupcountholder = $rrgroupcount;
			}
			my %matchgroupbins;
			for (@seengroups) {
				$resobjgroups{$_}++;
				foreach my $grpbin (keys %{$srcbundle_ref->{'bingroups'}{$_}}) {
					$matchgroupbins{$grpbin} = $_;
				}
			}

			foreach my $rashdst2 (keys %{$rashizedrules{$rashport2}{$rashsrc2}}) {
				foreach my $rulenum2 (keys %{$rashizedrules{$rashport2}{$rashsrc2}{$rashdst2}}) {
					$rrcount++;
					if (exists $matchgroupbins{$rashdst2}) {
						$rashizedrules2{$matchgroupbins{$rashdst2}}{$rashsrc2}{$rashport2}{$rulenum2}++;
					#} elsif (exists $destbundle_ref->{'ips'}{$rashdst2}) {
					#	$rashizedrules2{$destbundle_ref->{'ips'}{$rashdst2}{'name'}}{$rashsrc2}{$rashport2}{$rulenum2}++;
					} elsif (exists $srcbundle_ref->{'ips'}{$rashdst2}) {
						$rashizedrules2{$srcbundle_ref->{'ips'}{$rashdst2}{'name'}}{$rashsrc2}{$rashport2}{$rulenum2}++;
						$resobjects{$srcbundle_ref->{'ips'}{$rashdst2}{'name'}}++;
					} else {
						$errormessages{"Unknown Destination Object: $rashdst2"}++;
					}
				}
			}
			if ($rrcount >= ($rrcountholder + 25000)) {
				print "....................................................$rrcount	rule destinations simplified\n";
				$rrcountholder = $rrcount;
			}
		}
	}

	#print "RATIONALIZED RULES         	\n############################################################################\n\n". Dumper(%rashizedrules2) . "\n\n";

	print "   dests rationalized...............................DONE!\n"		;
	%rashizedrules = ()								;
	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0)	;

	foreach my $rashdst3 (keys %rashizedrules2) {
		foreach my $rashsrc3 (keys %{$rashizedrules2{$rashdst3}}) {
			my @seengroups;
			
			foreach my $groupname (keys %{$srcbundle_ref->{'portgroups'}}) {
				my ($match, $miss) = (0,0);
				my (%match, %miss) ;
				
				foreach my $gport (keys %{$srcbundle_ref->{'portgroups'}{$groupname}}) {
					$rrgroupcount++;
					if (exists $rashizedrules2{$rashdst3}{$rashsrc3}{$gport}) {
						$match++ ;	 
						$match{$gport}++ ;
					} else {
						$miss++ ;	 
						$miss{$gport}++ ;
					}
				}
				if (($match > 0) && ($miss < 1 )) {
					push (@seengroups, $groupname) ;
				}
			}
			if ($rrgroupcount >= ($rrgroupcountholder + 1000000)) {
				print "....................................................$rrgroupcount	port group comparisons made\n"	;
				$rrgroupcountholder = $rrgroupcount;
			}
			my %matchgroupports;
			for (@seengroups) {
				$ressrvcgroups{$_}++;
				foreach my $grpport (keys %{$srcbundle_ref->{'portgroups'}{$_}}) {
					$matchgroupports{$grpport} = $_;
				}
			}

			foreach my $rashport3 (keys %{$rashizedrules2{$rashdst3}{$rashsrc3}}) {
				foreach my $rulenum3 (keys %{$rashizedrules2{$rashdst3}{$rashsrc3}{$rashport3}}) {
					$rrcount++;
					my ($protoc, $porty) = split (/\~/, $rashport3) ;

					if (exists $matchgroupports{$rashport3}) {
						$rashizedrules3{$matchgroupports{$rashport3}}{$rashdst3}{$rashsrc3}{$rulenum3}++;
					} elsif (exists $srcbundle_ref->{'ports'}{$protoc}) {
						if (exists $srcbundle_ref->{'ports'}{$protoc}{$porty}) {
							$rashizedrules3{$srcbundle_ref->{'ports'}{$protoc}{$porty}{'name'}}{$rashdst3}{$rashsrc3}{$rulenum3}++;
							$ressrvcs{$srcbundle_ref->{'ports'}{$protoc}{$porty}{'name'}}++;
						} elsif ($porty =~ /^\d+$/) {
							$rashizedrules3{"$protoc-$porty"}{$rashdst3}{$rashsrc3}{$rulenum3}++;
							$errormessages{"Known Proto but Unknown Service Used: $protoc, $porty"}++;
						} else {
							$rashizedrules3{$porty}{$rashdst3}{$rashsrc3}{$rulenum3}++;
							$errormessages{"Named but Unknown Service Used: $protoc, $porty"}++;
						}
					} elsif ($porty =~ /^\d+$/) {
						$rashizedrules3{"$protoc-$porty"}{$rashdst3}{$rashsrc3}{$rulenum3}++;
						$errormessages{"Unknown Service Used: $protoc, $porty"}++;
					} else {
						$rashizedrules3{$porty}{$rashdst3}{$rashsrc3}{$rulenum3}++;
						$errormessages{"Unknown Named Servce Used: $protoc, $porty"}++;
					}
				}
			}
			if ($rrcount >= ($rrcountholder + 25000)) {
				print "....................................................$rrcount	rule ports simplified\n";
				$rrcountholder = $rrcount;
			}
		}
	}

	#print "RATIONALIZED RULES PRE        	\n############################################################################\n\n". Dumper(%rashizedrules3) . "\n\n";

	print "   ports rationalized...............................DONE!\n"						;

	%rashizedrules2 = ()												;
	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0)					;

	foreach my $rashport4 (keys %rashizedrules3) {

		foreach my $rashdst4 (keys %{$rashizedrules3{$rashport4}}) {

			my @dstsgrouped = ($rashdst4);

			my @srcsgrouped = sort keys %{$rashizedrules3{$rashport4}{$rashdst4}};
			my $srcssorted  = join(';', @srcsgrouped);

			foreach my $rulecomp (keys %{$rashizedrules3{$rashport4}}) {

				next if $rashdst4 eq $rulecomp;

				my @srcscomp = sort keys %{$rashizedrules3{$rashport4}{$rulecomp}};

				if (compare_arrays(\@srcsgrouped, \@srcscomp)) {

					push (@dstsgrouped, $rulecomp);
				}
			}
			
			my $dstssorted = join(';', (sort @dstsgrouped));

			foreach my $rashsrc (@srcsgrouped) {

				foreach my $rulenumber (keys %{$rashizedrules3{$rashport4}{$rashdst4}{$rashsrc}}) {

					$rashizedrules4{$srcssorted}{$dstssorted}{$rashport4}{$rulenumber}++;
				}
			}

			if ($rrcount >= ($rrcountholder + 10000)) {
				print "....................................................$rrcount	ports grouped\n";
				$rrcountholder = $rrcount;
			}
		}
	}
	#print "RATIONALIZED RULES 4        	\n############################################################################\n\n". Dumper(%rashizedrules4) . "\n\n";

	%rashizedrules3 = (0,0);
	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0);

	foreach my $rashsrc5 (keys %rashizedrules4) {

		foreach my $rashdst5 (keys %{$rashizedrules4{$rashsrc5}}) {

			my @portgroups = sort keys %{$rashizedrules4{$rashsrc5}{$rashdst5}};
			my $portgroups = join(';', @portgroups);

			my (%rulenums);

			foreach my $portgroup (@portgroups) {

				foreach my $rulenum5 (keys %{$rashizedrules4{$rashsrc5}{$rashdst5}{$portgroup}}) {
					$rulenums{$rulenum5}++;
				}
			}

			my $rulenums = join(';', (sort numerically keys %rulenums));

			$rashizedrules5{$portgroups}{$rashdst5}{$rashsrc5}{$rulenums}++;
		}
	}

	#print "RATIONALIZED RULES 5        	\n############################################################################\n\n". Dumper(%rashizedrules5) . "\n\n";

	if (scalar keys %errormessages > 0) {
		print "\n\nUnknown Objects Resolved During Rule Building:\n";
		print "---------------------------------------------\n";

		foreach my $errormessage (sort keys %errormessages) {
			print "$errormessage		Instance count: $errormessages{$errormessage} \n";
		}
		print "\n";
	}

	%rashizedrules4 = (0,0)										;
	my $rulenumber = 0										;
	if ($logparsetype eq 'normal') {
		print "\n   RATIONALIZED RULES:\n\n"								;
	} else {
		print "\n   RATIONALIZED DROPS:\n\n"								;
	}
	foreach my $rashport6 (sort keys %rashizedrules5) {
		my $rashport6out = $rashport6;
		$rashport6out =~ s/\;/ /g;

		foreach my $rashdst6 (sort keys %{$rashizedrules5{$rashport6}}) {
			my $rashdst6out = $rashdst6;
			$rashdst6out =~ s/\;/ /g;

			foreach my $rashsrc6 (sort keys %{$rashizedrules5{$rashport6}{$rashdst6}}) {
				my $rashsrc6out = $rashsrc6;
				$rashsrc6out =~ s/\;/ /g;

				foreach my $rashnum6 (sort keys %{$rashizedrules5{$rashport6}{$rashdst6}{$rashsrc6}}) {
					my $rashnum6out = $rashnum6;
					$rashnum6out =~ s/\;/ /g;

					$rulenumber++								;
					if ($logparsetype eq 'normal') {
						print "Rule: $rulenumber,  src[$rashsrc6out]   dst[$rashdst6out]   port($rashport6out)   orig_rule:$rashnum6out\n"	;	
					} else {
						print "DROPS: $rulenumber,  src[$rashsrc6out]   dst[$rashdst6out]   port($rashport6out)   orig_rule:$rashnum6out\n"	;	
					}
					$lastrashrulebase{"$rashsrc6,$rashdst6,$rashport6,$rashnum6"} = $rulenumber	;
					$lastrashprintbase{$rulenumber} = "$rashsrc6,$rashdst6,$rashport6,$rashnum6"	;
				}
			}
		}
	}
	foreach my $configgroup (keys %resobjgroups) {
		foreach my $grpobj (keys %{$srcbundle_ref->{'netgroupobjs'}{$configgroup}}) {
			$resobjects{$grpobj}++;
		}
	}
	foreach my $configsrvcgroup (keys %ressrvcgroups) {
		foreach my $grpobj (keys %{$srcbundle_ref->{'srvcgroupobjs'}{$configsrvcgroup}}) {
			$ressrvcs{$grpobj}++;
		}
	}

	return (\%lastrashrulebase, \%lastrashprintbase, \%resobjects, \%ressrvcs, \%resobjgroups, \%ressrvcgroups, \%errormessages);
}

