			my $portsgrouped = join(';', @portsgrouped);

			foreach my $rulecomp (keys %{$rashizedrules3{$rashsrc}}) {

				next if $rashdst eq $rulecomp;

				my @portscomp = sort keys %{$rashizedrules3{$rashsrc}{$rulecomp}};

				if (compare_arrays(\@portsgrouped, \@portscomp)) {

					push (@dstsgrouped, $rulecomp);
