		foreach my $grpobj (keys %{$srcbundle_ref->{'srvcgroupobjs'}{$configsrvcgroup}}) {
			$ressrvcs{$grpobj}++;
		}
	}

	return (\%lastrashrulebase, \%lastrashprintbase, \%resobjects, \%ressrvcs, \%resobjgroups, \%ressrvcgroups, \%errormessages);
}

