	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0);
	%rashizedrules = ();

	foreach my $rashdst (keys %rashizedrules2) {
		foreach my $rashport (keys %{$rashizedrules2{$rashdst}}) {
			my @seengroups;
			
			foreach my $groupname (keys %{$srcbundle_ref->{'bingroups'}}) {
				my ($match, $miss) = (0,0);
				my (%match, %miss) ;
				
				foreach my $gbin (keys %{$srcbundle_ref->{'bingroups'}{$groupname}}) {
					$rrgroupcount++;
					if (exists $rashizedrules2{$rashdst}{$rashport}{$gbin}) {
						$match++ ;	 
						$match{$gbin}++ ;
					} else {
						$miss++ ;	 
						$miss{$gbin}++ ;
					}
				}
				if (($match > 0) && ($miss < 1 )) {
					push (@seengroups, $groupname) ;
				}
			}
			if ($rrgroupcount >= ($rrgroupcountholder + 1000000)) {
				print "....................................................$rrgroupcount	src group comparisons made\n"	;
				$rrgroupcountholder = $rrgroupcount;
			}
			my %matchgroupbins;
			for (@seengroups) {
				$resobjgroups{$_}++;
				foreach my $grpbin (keys %{$srcbundle_ref->{'bingroups'}{$_}}) {
					$matchgroupbins{$grpbin} = $_;
				}
			}

			foreach my $rashsrc (keys %{$rashizedrules2{$rashdst}{$rashport}}) {
				foreach my $rulenum (keys %{$rashizedrules2{$rashdst}{$rashport}{$rashsrc}}) {
					my $loghits = $rashizedrules2{$rashdst}{$rashport}{$rashsrc}{$rulenum};
					$rrcount++;
					if (exists $matchgroupbins{$rashsrc}) {
						$rashizedrules3{$matchgroupbins{$rashsrc}}{$rashdst}{$rashport}{$rulenum} += $loghits;
					} elsif (exists $srcbundle_ref->{'ips'}{$rashsrc}) {
						$rashizedrules3{$srcbundle_ref->{'ips'}{$rashsrc}{'name'}}{$rashdst}{$rashport}{$rulenum} += $loghits;
						$resobjects{$srcbundle_ref->{'ips'}{$rashsrc}{'name'}}++;
					} else {
						$errormessages{"Unknown Source Object: $rashsrc"}++;
					}
				}
			}
			if ($rrcount >= ($rrcountholder + 25000)) {
				print "....................................................$rrcount	rule sources simplified\n"	;
				$rrcountholder = $rrcount;
			}
		}
	}
	#print "RATIONALIZED RULES PRE        	\n############################################################################\n\n". Dumper(%rashizedrules3) . "\n\n";
	print "   sources rationalized.............................DONE!\n"			;

	foreach my $rashsrc (keys %rashizedrules3) {

		foreach my $rashdst (keys %{$rashizedrules3{$rashsrc}}) {

			my @dstsgrouped = ($rashdst);

			my @portsgrouped = sort keys %{$rashizedrules3{$rashsrc}{$rashdst}};
			my $portsgrouped = join(';', @portsgrouped);

			foreach my $rulecomp (keys %{$rashizedrules3{$rashsrc}}) {

				next if $rashdst eq $rulecomp;

				my @portscomp = sort keys %{$rashizedrules3{$rashsrc}{$rulecomp}};

				if (compare_arrays(\@portsgrouped, \@portscomp)) {

					push (@dstsgrouped, $rulecomp);
				}
			}

			my $dstssorted = join(';', (sort @dstsgrouped));

			foreach my $rashport (@portsgrouped) {

				foreach my $rulenum (keys %{$rashizedrules3{$rashsrc}{$rashdst}{$rashport}}) {

					$rashizedrules4{$dstssorted}{$portsgrouped}{$rashsrc}{$rulenum} += $rashizedrules3{$rashsrc}{$rashdst}{$rashport}{$rulenum};
				}
			}

			if ($rrcount >= ($rrcountholder + 10000)) {
				print "....................................................$rrcount	ports grouped\n";
				$rrcountholder = $rrcount;
			}
		}
	}
	#print "RATIONALIZED RULES 4        	\n############################################################################\n\n". Dumper(%rashizedrules4) . "\n\n";

	%rashizedrules3 = (0,0);
	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0);

	foreach my $rashdst (keys %rashizedrules4) {

		foreach my $rashport (keys %{$rashizedrules4{$rashdst}}) {

			my @srcgroups  = sort keys %{$rashizedrules4{$rashdst}{$rashport}};
			my $srcssorted = join(';', @srcgroups);

			my (%rulenums, $loghits);

			foreach my $srcgroup (@srcgroups) {

				foreach my $rulenum (sort keys %{$rashizedrules4{$rashdst}{$rashport}{$srcgroup}}) {

					$loghits += $rashizedrules4{$rashdst}{$rashport}{$srcgroup}{$rulenum};
					$rulenums{$rulenum}++;
				}
			}

			my $rulenums = join(';', (sort numerically keys %rulenums));

			$rashizedrules5{$loghits}{$rashport}{$rashdst}{$srcssorted}{$rulenums} += $loghits;;
		}
	}

	#print "RATIONALIZED RULES 5        	\n############################################################################\n\n". Dumper(%rashizedrules5) . "\n\n";

	if (scalar keys %errormessages > 0) {
		print "\n\nUnknown Objects Resolved During Rule Building:\n";
		print "---------------------------------------------\n";

		foreach my $errormessage (sort keys %errormessages) {
			print "$errormessage		Instance count: $errormessages{$errormessage} \n";
		}
		print "\n";
	}

	%rashizedrules4 = (0,0)				;
	my $rulenumber = 0				;
	if ($logparsetype eq 'normal') {
		print "\n   RATIONALIZED RULES:\n\n"								;
	} else {
		print "\n   RATIONALIZED DROPS:\n\n"								;
	}
	foreach my $rashloghits (sort rnumerically keys %rashizedrules5) {
		my $rashloghitsout = $rashloghits;
		$rashloghitsout =~ s/\;/ /g;

		foreach my $rashport (sort keys %{$rashizedrules5{$rashloghits}}) {
			my $rashportout = $rashport;
			$rashportout =~ s/\;/ /g;

			foreach my $rashdst (sort keys %{$rashizedrules5{$rashloghits}{$rashport}}) {
				my $rashdstout = $rashdst;
				$rashdstout =~ s/\;/ /g;

				foreach my $rashsrc (sort keys %{$rashizedrules5{$rashloghits}{$rashport}{$rashdst}}) {
					my $rashsrcout = $rashsrc;
					$rashsrcout =~ s/\;/ /g;

					foreach my $rashnum (sort keys %{$rashizedrules5{$rashloghits}{$rashport}{$rashdst}{$rashsrc}}) {
						my $rashnumout = $rashnum;
						$rashnumout =~ s/\;/ /g;

						$rulenumber++	;
						if ($logparsetype eq 'normal') {
							print "Rule: $rulenumber,  src[$rashsrcout]   dst[$rashdstout]   port($rashportout)   orig_rule:$rashnumout,   hits:$rashloghitsout\n"	;	
						} else {
							print "DROPS: $rulenumber,  src[$rashsrcout]   dst[$rashdstout]   port($rashportout)   orig_rule:$rashnumout,   hits:$rashloghitsout\n"	;	
						}

						$lastrashrulebase{"$rashsrc,$rashdst,$rashport,$rashnum"} = $rulenumber	;
						$lastrashprintbase{$rulenumber} = "$rashsrc,$rashdst,$rashport,$rashnum";
					}
				}
			}
		}
	}
	foreach my $configgroup (keys %resobjgroups) {
		foreach my $grpobj (keys %{$srcbundle_ref->{'netgroupobjs'}{$configgroup}}) {
			$resobjects{$grpobj}++;
		}
	}
	foreach my $configsrvcgroup (keys %ressrvcgroups) {
		foreach my $grpobj (keys %{$srcbundle_ref->{'srvcgroupobjs'}{$configsrvcgroup}}) {
			$ressrvcs{$grpobj}++;
		}
	}

	return (\%lastrashrulebase, \%lastrashprintbase, \%resobjects, \%ressrvcs, \%resobjgroups, \%ressrvcgroups, \%errormessages);
}

sub build_orig_dst_src_rules {
	my ($rashlogfilter_ref, $srcbundle_ref, $dstbundle_ref,
	$lastrashrulebase_ref, $lastrashprintbase_ref, $resobjects_ref, $ressrvcs_ref, $resobjgroups_ref, $ressrvcgroups_ref, $errormessages_ref,
	$rrgroupcount, $rrgroupcountholder, $rrcount, $rrcountholder, $rulenumber) = @_; 

	my (%rationizedrules, %rashizedrules, %rashizedrules2, %rashizedrules3, %rashizedrules4, %rashizedrules5);

	foreach my $rashdst (keys %{$rashlogfilter_ref}) {
		foreach my $rashsrc (keys %{$rashlogfilter_ref->{$rashdst}}) {
			my @seengroups;
			
			foreach my $groupname (keys %{$srcbundle_ref->{'portgroups'}}) {
				my ($match, $miss) = (0,0);
				my (%match, %miss) ;
				
				foreach my $gport (keys %{$srcbundle_ref->{'portgroups'}{$groupname}}) {
					$rrgroupcount++;
					if (exists $rashlogfilter_ref->{$rashdst}{$rashsrc}{$gport}) {
						$match++ ;	 
						$match{$gport}++ ;
					} else {
						$miss++ ;	 
						$miss{$gport}++ ;
					}
				}
				if (($match > 0) && ($miss < 1 )) {
					push (@seengroups, $groupname) ;
				}
			}
			if ($rrgroupcount >= ($rrgroupcountholder + 1000000)) {
				$rrgroupcountholder = $rrgroupcount;
			}
			my %matchgroupports;
			for (@seengroups) {
				$ressrvcgroups_ref->{$_}++;
				foreach my $grpport (keys %{$srcbundle_ref->{'portgroups'}{$_}}) {
					$matchgroupports{$grpport} = $_;
				}
			}

			foreach my $rashport (keys %{$rashlogfilter_ref->{$rashdst}{$rashsrc}}) {
				foreach my $rulenum (keys %{$rashlogfilter_ref->{$rashdst}{$rashsrc}{$rashport}}) {
					$rrcount++;
					my ($protoc, $porty) = split (/\~/, $rashport) ;

					if (exists $matchgroupports{$rashport}) {
						$rashizedrules{$rashsrc}{$matchgroupports{$rashport}}{$rashdst}{$rulenum}++;
					} elsif (exists $srcbundle_ref->{'ports'}{$protoc}) {
						if (exists $srcbundle_ref->{'ports'}{$protoc}{$porty}) {
							$rashizedrules{$rashsrc}{$srcbundle_ref->{'ports'}{$protoc}{$porty}{'name'}}{$rashdst}{$rulenum}++;
							$ressrvcs_ref->{$srcbundle_ref->{'ports'}{$protoc}{$porty}{'name'}}++;
						} elsif ($porty =~ /^\d+$/) {
							$rashizedrules{$rashsrc}{"$protoc-$porty"}{$rashdst}{$rulenum}++;
							$errormessages_ref->{"Known Proto but Unknown Service Used: $protoc, $porty"}++;
						} else {
							$rashizedrules{$rashsrc}{$porty}{$rashdst}{$rulenum}++;
							$errormessages_ref->{"Named but Unknown Service Used: $protoc, $porty"}++;
						}
					} elsif ($porty =~ /^\d+$/) {
						$rashizedrules{$rashsrc}{"$protoc-$porty"}{$rashdst}{$rulenum}++;
						$errormessages_ref->{"Unknown Service Used: $protoc, $porty"}++;
					} else {
						$rashizedrules{$rashsrc}{$porty}{$rashdst}{$rulenum}++;
						$errormessages_ref->{"Unknown Named Service Used: $protoc, $porty"}++;
					}
				}
			}
			if ($rrcount >= ($rrcountholder + 25000)) {
				$rrcountholder = $rrcount;
			}
		}
	}

	#print "RATIONALIZED RULES         	\n############################################################################\n\n". Dumper(%rashizedrules) . "\n\n";

	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0);

	foreach my $rashsrc (keys %rashizedrules) {
		foreach my $rashport (keys %{$rashizedrules{$rashsrc}}) {
			my @seengroups;
			
			foreach my $groupname (keys %{$srcbundle_ref->{'bingroups'}}) {
				my ($match, $miss) = (0,0);
				my (%match, %miss) ;
				
				foreach my $gbin (keys %{$srcbundle_ref->{'bingroups'}{$groupname}}) {
					$rrgroupcount++;
					if (exists $rashizedrules{$rashsrc}{$rashport}{$gbin}) {
						$match++ ;	 
						$match{$gbin}++ ;
					} else {
						$miss++ ;	 
						$miss{$gbin}++ ;
					}
				}
				if (($match > 0) && ($miss < 1 )) {
					push (@seengroups, $groupname) ;
				}
			}
			if ($rrgroupcount >= ($rrgroupcountholder + 1000000)) {
				$rrgroupcountholder = $rrgroupcount;
			}
			my %matchgroupbins;
			for (@seengroups) {
				$resobjgroups_ref->{$_}++;
				foreach my $grpbin (keys %{$srcbundle_ref->{'bingroups'}{$_}}) {
					$matchgroupbins{$grpbin} = $_;
				}
			}

			foreach my $rashdst (keys %{$rashizedrules{$rashsrc}{$rashport}}) {
				foreach my $rulenum (keys %{$rashizedrules{$rashsrc}{$rashport}{$rashdst}}) {
					$rrcount++;
					if (exists $matchgroupbins{$rashdst}) {
						$rashizedrules2{$matchgroupbins{$rashdst}}{$rashport}{$rashsrc}{$rulenum}++;
					#} elsif (exists $destbundle_ref->{'ips'}{$rashsrc}) {
					#	$rashizedrules{$rashport}{$destbundle_ref->{'ips'}{$rashsrc}{'name'}}{$rashdst}{$rulenum}++;
					} elsif (exists $srcbundle_ref->{'ips'}{$rashdst}) {
						$rashizedrules2{$srcbundle_ref->{'ips'}{$rashdst}{'name'}}{$rashport}{$rashsrc}{$rulenum}++;
						$resobjects_ref->{$srcbundle_ref->{'ips'}{$rashdst}{'name'}}++;
					} else {
						$errormessages_ref->{"Unknown Destination Object: $rashdst"}++;
					}
				}
			}
			if ($rrcount >= ($rrcountholder + 25000)) {
				$rrcountholder = $rrcount;
			}
		}
	}

	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0);
	%rashizedrules = ();

	foreach my $rashdst (keys %rashizedrules2) {
		foreach my $rashport (keys %{$rashizedrules2{$rashdst}}) {
			my @seengroups;
			
			foreach my $groupname (keys %{$srcbundle_ref->{'bingroups'}}) {
				my ($match, $miss) = (0,0);
				my (%match, %miss) ;
				
				foreach my $gbin (keys %{$srcbundle_ref->{'bingroups'}{$groupname}}) {
					$rrgroupcount++;
					if (exists $rashizedrules2{$rashdst}{$rashport}{$gbin}) {
						$match++ ;	 
						$match{$gbin}++ ;
					} else {
						$miss++ ;	 
						$miss{$gbin}++ ;
					}
				}
				if (($match > 0) && ($miss < 1 )) {
					push (@seengroups, $groupname) ;
				}
			}
			if ($rrgroupcount >= ($rrgroupcountholder + 1000000)) {
				$rrgroupcountholder = $rrgroupcount;
			}
			my %matchgroupbins;
			for (@seengroups) {
				$resobjgroups_ref->{$_}++;
				foreach my $grpbin (keys %{$srcbundle_ref->{'bingroups'}{$_}}) {
					$matchgroupbins{$grpbin} = $_;
				}
			}

			foreach my $rashsrc (keys %{$rashizedrules2{$rashdst}{$rashport}}) {
				foreach my $rulenum (keys %{$rashizedrules2{$rashdst}{$rashport}{$rashsrc}}) {
					$rrcount++;
					if (exists $matchgroupbins{$rashsrc}) {
						$rashizedrules3{$matchgroupbins{$rashsrc}}{$rashdst}{$rashport}{$rulenum}++;
					} elsif (exists $srcbundle_ref->{'ips'}{$rashsrc}) {
						$rashizedrules3{$srcbundle_ref->{'ips'}{$rashsrc}{'name'}}{$rashdst}{$rashport}{$rulenum}++;
						$resobjects_ref->{$srcbundle_ref->{'ips'}{$rashsrc}{'name'}}++;
					} else {
						$errormessages_ref->{"Unknown Source Object: $rashsrc"}++;
					}
				}
			}
			if ($rrcount >= ($rrcountholder + 25000)) {
				$rrcountholder = $rrcount;
			}
		}
	}

	#print "RATIONALIZED RULES PRE        	\n############################################################################\n\n". Dumper(%rashizedrules3) . "\n\n";

	foreach my $rashsrc (keys %rashizedrules3) {

		foreach my $rashdst (keys %{$rashizedrules3{$rashsrc}}) {

			my @dstsgrouped = ($rashdst);

			my @portsgrouped = sort keys %{$rashizedrules3{$rashsrc}{$rashdst}};
			my $portsgrouped = join(';', @portsgrouped);

			foreach my $rulecomp (keys %{$rashizedrules3{$rashsrc}}) {

				next if $rashdst eq $rulecomp;

				my @portscomp = sort keys %{$rashizedrules3{$rashsrc}{$rulecomp}};

				if (compare_arrays(\@portsgrouped, \@portscomp)) {

					push (@dstsgrouped, $rulecomp);
				}
			}

			my $dstssorted = join(';', (sort @dstsgrouped));

			foreach my $rashport (@portsgrouped) {

				foreach my $rulenumber (keys %{$rashizedrules3{$rashsrc}{$rashdst}{$rashport}}) {

					$rashizedrules4{$dstssorted}{$portsgrouped}{$rashsrc}{$rulenumber}++;
				}
			}
		}
	}

	#print "RATIONALIZED RULES 4        	\n############################################################################\n\n". Dumper(%rashizedrules4) . "\n\n";

	%rashizedrules3 = (0,0);
	($rrcount, $rrcountholder, $rrgroupcount, $rrgroupcountholder) = (0,0,0,0);

	foreach my $rashdst (keys %rashizedrules4) {

		foreach my $rashport (keys %{$rashizedrules4{$rashdst}}) {

			my @srcgroups = sort keys %{$rashizedrules4{$rashdst}{$rashport}};
			my $srcgroups = join(';', (@srcgroups));

			my (%rulenums);

			foreach my $srcgroup (@srcgroups) {

				foreach my $rulenum (sort keys %{$rashizedrules4{$rashdst}{$rashport}{$srcgroup}}) {
					$rulenums{$rulenum}++;
				}
			}

			my $rulenums = join(';', (sort numerically keys %rulenums));

			$rashizedrules5{$rashport}{$rashdst}{$srcgroups}{$rulenums}++;
		}
	}

	#print "RATIONALIZED RULES 5        	\n############################################################################\n\n". Dumper(%rashizedrules5) . "\n\n";

	if (scalar keys %{$errormessages_ref} > 0) {
		print "\n\nUnknown Objects Resolved During Rule Building:\n";
		print "---------------------------------------------\n";

		foreach my $errormessage (sort keys %{$errormessages_ref}) {
			print "$errormessage    	Instance count: $errormessages_ref->{$errormessage} \n";
		}
		print "\n";
	}

	my $pointnumber = 0;
	%rashizedrules4 = (0,0)				;
	foreach my $rashport (sort keys %rashizedrules5) {
		my $rashportout = $rashport;
		$rashportout =~ s/\;/ /g;

		foreach my $rashdst (sort keys %{$rashizedrules5{$rashport}}) {
			my $rashdstout = $rashdst;
			$rashdstout =~ s/\;/ /g;

			foreach my $rashsrc (sort keys %{$rashizedrules5{$rashport}{$rashdst}}) {
				my $rashsrcout = $rashsrc;
				$rashsrcout =~ s/\;/ /g;

				foreach my $rashnum (sort keys %{$rashizedrules5{$rashport}{$rashdst}{$rashsrc}}) {
					my $rashnumout = $rashnum;
					$rashnumout =~ s/\;/ /g;

					if ($logparsetype eq 'normal') {
						print "Rule: $rulenumber.$pointnumber,  src[$rashsrcout]   dst[$rashdstout]   port($rashportout)   orig_rule: $rashnumout\n"	;	
					} else {
						print "DROPS: $rulenumber.$pointnumber,  src[$rashsrcout]   dst[$rashdstout]   port($rashportout)   orig_rule: $rashnumout\n"	;	
					}

					$lastrashrulebase_ref->{"$rashsrc,$rashdst,$rashport,$rashnum"} = $rulenumber	;
					$lastrashprintbase_ref->{"$rulenumber.$pointnumber"} = "$rashsrc,$rashdst,$rashport,$rashnum";
					$pointnumber++	;
				}
			}
		}
	}
	foreach my $configgroup (keys %{$resobjgroups_ref}) {
		foreach my $grpobj (keys %{$srcbundle_ref->{'netgroupobjs'}{$configgroup}}) {
			$resobjects_ref->{$grpobj}++;
		}
	}
	foreach my $configsrvcgroup (keys %{$ressrvcgroups_ref}) {
		foreach my $grpobj (keys %{$srcbundle_ref->{'srvcgroupobjs'}{$configsrvcgroup}}) {
			$ressrvcs_ref->{$grpobj}++;
		}
	}

	return ($rrgroupcount, $rrgroupcountholder, $rrcount, $rrcountholder, $rulenumber) ; 
}

