sub load_new_config {

	my $newconfigtype;
	my $serviceset;
	my $newconfig;
	my $newlogfile;
	my $newnatsfile;
	my $load_new_config_header = <<'HERE';

     _                 _    ___           __ _        __       _                 
    | |   ___  __ _ __| |  / __|___ _ _  / _(_)__ _  / _|___  | |   ___  __ _ ___
    | |__/ _ \/ _` / _` | | (__/ _ \ ' \|  _| / _` | > _|_ _| | |__/ _ \/ _` (_-<
    |____\___/\__,_\__,_|  \___\___/_||_|_| |_\__, | \_____|  |____\___/\__, /__/
                                              |___/                     |___/    
HERE

	print $load_new_config_header;
	print "-----------------------------------------------------------------------------------------\n";
	print "    SPECIFY A NEW CONFIG BUNDLE TO LOAD:\n";

	print "\n	Enter the type of the new config to load in the format: \n";
	print " 	Odumper/Ofiller Config File 	= od\n";
	print " 	Netscreen Config File 		= ns\n";
	print " 	Cisco Config File 		= cs\n\n";

	while (<STDIN>) {
		chomp;
		next if $_ eq '';
		unless ($_ =~ /^od$|^ns$|^cs$/) {
			print " 	ERROR: \"$_\" not config type, try again\n" ;
			next;
		}
		$newconfigtype = $_;	  
		last;
	}									

	print "\n	Enter the type of the default servie set used in the config: \n";
	print " 	Odumper/Ofiller Defaults 	= od\n";
	print " 	Netscreen 	Defaults	= ns\n";
	print " 	Cisco 		Defaults 	= cs\n\n";

	while (<STDIN>) {
		chomp;
		next if $_ eq '';
		unless ($_ =~ /^od$|^ns$|^cs$/) {
			print " 	ERROR: \"$_\" not detault set type, try again\n" ;
			next;
		}
		$serviceset = $_;	  
		last;
	}									


	print "\n	Enter the name of the new config file to load\n\n"; 

	while (<STDIN>) {
		chomp($_);
		if ($_ eq '') {
			print "\n 	ERROR: type a filename\n";
		} elsif (-e "$_") {
			$newconfig = $_	;
			$confignames{$newconfig}{'type'} 	= $newconfigtype;
			$confignames{$newconfig}{'serviceset'}	= $serviceset;
			last;
		} else {
			print "\n	ERROR: file does not exists\n";
		}
	}

	print "\n	Enter the name of the new log file to load, or type '.' to skip\n\n"; 

	while (<STDIN>) {
		chomp($_);
		if ($_ eq '') {
			print "\n 	ERROR: type a filename\n";
		} elsif ($_ eq '.') {
			last;
		} elsif (-e "$_") {
			$newlogfile = $_;
			$confignames{$newconfig}{'logfile'} = $newlogfile;
			last;
		} else {
			print "\n	ERROR: file does not exists\n";
		}
	}

	print "\n	Enter the name of the new nats file to load, or type '.' to skip\n\n"; 

	while (<STDIN>) {
		chomp($_);
		if ($_ eq '') {
			print "\n 	ERROR: type a filename\n";
		} elsif ($_ eq '.') {
			last;
		} elsif (-e "$_") {
			$newnatsfile = $_;
			$confignames{$newconfig}{'natsfile'} = $newnatsfile;
			last;
		} else {
			print "\n	ERROR: file does not exists\n";
		}
	}

	build_configbundle(
		$newconfig,
		\%configbundles);
}

