sub print_help {

	my $print_help_header = <<'HERE';

     _  _     _        __  __              
    | || |___| |_ __  |  \/  |___ _ _ _  _ 
    | __ / -_) | '_ \ | |\/| / -_) ' \ || |
    |_||_\___|_| .__/ |_|  |_\___|_||_\_,_|
               |_|                         
HERE

	print $print_help_header;
	print "
    360-FAAR v0.6.3 HELP MENU: 
    ------------------------------------

	print	= Prints the details relating to all objects name, ip, rule and policy usage, group membership, supernets,
		  subnets, hosts on networks, etc to a headded CSV, and a reduced csv to the screen for info.

       fltprint = Prints the same format object analysis spreadsheet as 'print' and allows you to specify inclusive and 
		  exclusive, text and CIDR filtering of the objects output.

	rr  	= Rationalize selected rules together and filter using CIDR and strings if required
		  Pull encryption rules from a second config (if traffic is encrypted between to and from firewalls)
		  Merge to a third firewall cluster and match and filter existing connectivity out of new rules.
		  This process can also translate objects and groups and gives details in the od, cs and ns output stage
		  in the commemts section of the object definitions.
		  This mode has three rule build methods. The dst src, service, and original rule filter and regroup.
		   
	bldobj 	= Resolve rule objects from odumper format file and translate objects and rules to a new firewall cluster
		  Identify objects from the file using two of the loaded configuations and enter a third to translate
		  objects to and write details to the comments.
		  USE this mode to allow you to read modified or new rulebases and associate objects from the configs
		  before writing the dbedit to make the rules to the screen and an od format file

	load 	= Load a new config bundle.  Loading an existing config name will overwrite the existing config.
		  This mode allows you to add new config bundles to an already runing instance of 360-FAAR.
		  With this mode, and copylog mode, you can load an updated config file and associate an already loaded
		  log for use in rr mode rationalizations 

	copylog	= Associate an existing log with a different config.  The original log will be over written.
		  This mode copies log information for rr mode rationalizations only, print mode info will be unaffected.

       mergelog = Merge a binary log from one config with another config.  The FROM log entries will be merged with the
		  destination TO log entries.  Use this mode to update an existing configurations binary log info.

	exit 	= EXIT the script.

    Output Types: 
    ------------------------------------

	od	= The legendary odumper/ofiller format with rules on, defaults on, object checking off
		  and nats in the legendary fwdoc csv file format

		  rr mode	- Outputs odumper format files of its suggested policies, and at the moment uses a blank
				  field for \"Any\" rules so that the files can be read by ofiller, and you can diff
				  mine and fillers dbedit output for double consistency!!.
				  It also the dbedit to create the rulebase to the screen.
				  The dbedit objects and groups are translated, the csv file is not 

		  bldobj mode	- outputs the same file and dbedit but keeps comments and rules from the input config
				- use the numberrules helper script to make the csv's more readable, modify the csv's 
				  and then read them in this or odumper format using the bldobj mode.
				  The dbedit and the csv files objects and groups are translated, rule comments are kept 

	ns	= Netscreen ScreenOS 6 format, you need supply either a netscreen config to  merege to, or
		  ZONE IP NM statements when you output the commands to update the firewalls, or both, if you want to
		  override the configs default route zone

	cs	= Cisco.  Output objects and groups in ASA 8.4+ format, and rules as ACE's in an access list name 
		  specified during the output stage.

    ---------------------------------------------------------
";
}

