sub output_odumper_csv_file {
	my ($srcbundle_ref, 
	$dstbundle_ref, 
	$srcconfigobjs_ref, 
	$srcconfigsrvcs_ref, 
	$srcconfiggroups_ref, 
	$srcconfigsrvcgroups_ref, 
	$lastrashprintbase_ref,
	$errormessages_ref,
	$ruleoutswitch) = @_;

	my $filename			;
	my $rulefile = 'dbedit.dbedit'	;
	my $destrulebase		;
	my %netobjxlates		;
	my %srvcobjxlates		;
	my $option_header		;
	print "-----------------------------------------------------------------------------------------\n";
	print "  OUTPUT ODUMPER AND DBEDIT TEXT:\n";

	if ($logparsetype eq 'normal') {
		$option_header = "\n	Enter the NAME of the CSV file to be SAVED: "		;
	} else {
		$option_header = "\n	Enter the NAME of the CSV file to be SAVED:\n	(the string 'DROPS-' will be prepended to the name you choose)\n\n"		;
	}

	choose_output_file_name(
		$option_header,
		\$filename);

	if ($logparsetype ne 'normal') {
		$filename = "DROPS-$filename";
	}



	if ($logparsetype eq 'normal') {
		$option_header = "\n	Enter the NAME of the DBEDIT file to be SAVED:\n\n"	;
	} else {
		$option_header = "\n	Enter the NAME of the DBEDIT file to be SAVED:\n	(the string 'DROPS-' will be prepended to the name you choose)\n\n"	;
	}

	choose_output_file_name(
		$option_header,
		\$rulefile);

	if ($logparsetype ne 'normal') {
		$rulefile = "DROPS-$rulefile";
	}



	if ($logparsetype eq 'normal') {
		$option_header = "\n	Enter the name of the Checkpoint FW-1 RULEBASE to write rules to:\n\n"	;
	} else {
		$option_header = "\n	Enter the name of the Checkpoint FW-1 RULEBASE to write rules to:\n	 (the string 'DROPS-' will be prepended to the name you choose)\n\n"	;
	}

	input_string(
		$option_header,
		\$destrulebase);


	if ($logparsetype ne 'normal') {
		$destrulebase = "DROPS-$destrulebase";
	}

	print "\n\n"								;

	open (LASTRASH, ">$filename") or warn "WARNING: Cannot open FILE: $filename\n";
	open (DBEDIT, ">$rulefile") or warn "WARNING: Cannot open RULE FILE: $rulefile\n";

#---------------------------------------------------------------------------------------------------
# NOTE: WRITE NET OBJECTS
#---------------------------------------------------------------------------------------------------

	my %sourceobjprint = ()							;

	foreach my $ruleobj (sort keys %{$srcconfigobjs_ref}) {

		foreach my $ipbin (sort keys %{$srcbundle_ref->{'netobjects'}{$ruleobj}{'ipbin'}}) {
			my $ruleobjout;
			my $destobjstring = ' ';
			my $description = ' ';
			my $colour = 'blue';
			my $transout = 'no';

		# NOTE: check if the object name exists in the destination config and note it if the ip matches, no transation needed objects is the same

			if (exists $dstbundle_ref->{'netobjects'}{$ruleobj}) {
				$destobjstring = "Matching object name in dest config: $ruleobj";
				#unless (exists $dstbundle_ref->{'netobjects'}{$ruleobj}{'type'}) {
				#	print "$ruleobj}{'type'}\n";
				#}
				unless ($srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq $dstbundle_ref->{'netobjects'}{$ruleobj}{'type'}) {
					$destobjstring = "$destobjstring TYPE MISMATCH: src $srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} dst $dstbundle_ref->{'netobjects'}{$ruleobj}{'type'}";
				}
				unless (exists $dstbundle_ref->{'netobjects'}{$ruleobj}{'ipbin'}{$ipbin}) {
					$destobjstring = "$destobjstring IP MISMATCH: src $srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'} dst $dstbundle_ref->{'netobjects'}{$ruleobj}{'ip'}";
				}
			}

		# NOTE: translation  based on IP

			if ((exists $dstbundle_ref->{'ips'}{$ipbin}) && ($ruleobj ne $dstbundle_ref->{'ips'}{$ipbin}{'name'})) {
				my $destobjname = $dstbundle_ref->{'ips'}{$ipbin}{'name'};
				$netobjxlates{$ruleobj}{'xlate'} = $destobjname;
				$destobjstring = "$destobjstring TRANSLATED Object: $ruleobj matches the IP of $dstbundle_ref->{'netobjects'}{$destobjname}{'type'} $destobjname";
			} elsif (exists $dstbundle_ref->{'ips'}{$ipbin}) {
				my $destobjname = $dstbundle_ref->{'ips'}{$ipbin}{'name'};
				$netobjxlates{$ruleobj}{'xlate'} = $destobjname;
				$destobjstring = "$destobjstring TRANSLATED LOOSE Object: $ruleobj matches the IP of $dstbundle_ref->{'netobjects'}{$destobjname}{'type'} $destobjname";
			}

		# NOTE: check if its a range or translate and print

			if ($srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq 'range') {
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'} && defined($srcbundle_ref->{'netobjects'}{$ruleobj}{'description'})) {
					$description = $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'};
					$description =~ s'"''g;
					$description =~ s',''g;
				}
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'}) {
					$colour = $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'};
				}
				if (exists $netobjxlates{$ruleobj}) {
					$ruleobjout = $netobjxlates{$ruleobj}{'xlate'};
					$transout   = 'yes';
				} else {
					$ruleobjout = $ruleobj;
					$transout   = 'no';
				}
				$sourceobjprint{"$ruleobjout,$srcbundle_ref->{'netobjects'}{$ruleobj}{'type'},$srcbundle_ref->{'netobjects'}{$ruleobj}{'rangestart'},$srcbundle_ref->{'netobjects'}{$ruleobj}{'rangeend'},$colour,,,,$description $destobjstring"} = $transout; 
			} elsif ($srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq 'cluster') {
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'} && defined($srcbundle_ref->{'netobjects'}{$ruleobj}{'description'})) {
					$description = $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'};
					$description =~ s'"''g;
					$description =~ s',''g;
				}
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'}) {
					$colour = $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'};
				}
				if (exists $netobjxlates{$ruleobj}) {
					$ruleobjout = $netobjxlates{$ruleobj}{'xlate'};
					$transout   = 'yes';
				} else {
					$ruleobjout = $ruleobj;
					$transout   = 'no';
				}
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'member'} && defined($srcbundle_ref->{'netobjects'}{$ruleobj}{'member'})) {
					foreach my $membery (keys %{$srcbundle_ref->{'netobjects'}{$ruleobj}{'member'}}) {
						$sourceobjprint{"$ruleobjout,$srcbundle_ref->{'netobjects'}{$ruleobj}{'type'},$srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'},$membery,$colour,,,,$description $destobjstring"} = $transout;
					}
				} else {
					print "   MISSED: Cluster member for obj:  $ruleobj\n";
				}
			} else {
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'} && defined($srcbundle_ref->{'netobjects'}{$ruleobj}{'description'})) {
					$description = $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'};
					$description =~ s'"''g;
					$description =~ s',''g;
				}
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'}) {
					$colour = $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'};
				}
				if (exists $netobjxlates{$ruleobj}) {
					$ruleobjout = $netobjxlates{$ruleobj}{'xlate'};
					$transout   = 'yes';
				} else {
					$ruleobjout = $ruleobj;
					$transout   = 'no';
				}
				$sourceobjprint{"$ruleobjout,$srcbundle_ref->{'netobjects'}{$ruleobj}{'type'},$srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'},$srcbundle_ref->{'netobjects'}{$ruleobj}{'nm'},$colour,,,,$description $destobjstring"} = $transout;
			}
		}
	}
	foreach my $printline (sort keys %sourceobjprint) {
		print LASTRASH "$printline\n";
		my $transout = $sourceobjprint{$printline};
		if ($transout eq 'no') {
			my ($netobject, $type, $ip, $nm, $colour, $peram1, $peram2, $peram3, $description) = split(/\,/, $printline);
			if ($type eq 'host') {
				print DBEDIT "create host_plain $netobject\n";
				print DBEDIT "modify network_objects $netobject ipaddr $ip\n";
				print DBEDIT "modify network_objects $netobject comments \"$description\"\n";
				print DBEDIT "modify network_objects $netobject color $colour\n";
				print DBEDIT "update network_objects $netobject\n";
			} elsif ($type eq 'net') {
				print DBEDIT "create network $netobject\n";
				print DBEDIT "modify network_objects $netobject ipaddr $ip\n";
				print DBEDIT "modify network_objects $netobject netmask $nm\n";
				print DBEDIT "modify network_objects $netobject comments \"$description\"\n";
				print DBEDIT "modify network_objects $netobject color $colour\n";
				print DBEDIT "update network_objects $netobject\n";
			} elsif ($type eq 'range') {
				print DBEDIT "create address_range $netobject\n";
				print DBEDIT "modify network_objects $netobject ipaddr_first $ip\n";
				print DBEDIT "modify network_objects $netobject ipaddr_last $nm\n";
				print DBEDIT "modify network_objects $netobject comments \"$description\"\n";
				print DBEDIT "modify network_objects $netobject color $colour\n";
				print DBEDIT "update network_objects $netobject\n";
			} elsif ($type eq 'plaingw') {
				print DBEDIT "create gateway_plain $netobject\n";
				print DBEDIT "modify network_objects $netobject ipaddr $ip\n";
				print DBEDIT "modify network_objects $netobject comments \"$description\"\n";
				print DBEDIT "modify network_objects $netobject color $colour\n";
				print DBEDIT "update network_objects $netobject\n";
			} elsif ($type eq 'cluster') {
				print DBEDIT "create gateway_cluster $netobject\n";
				print DBEDIT "modify network_objects $netobject ipaddr $ip\n";
				print DBEDIT "modify network_objects $netobject comments \"$description\"\n";
				print DBEDIT "modify network_objects $netobject color $colour\n";
				print DBEDIT "update network_objects $netobject\n";
			} elsif ($type eq 'member') {
				print DBEDIT "create cluster_member $netobject\n";
				print DBEDIT "modify network_objects $netobject ipaddr $ip\n";
				print DBEDIT "modify network_objects $netobject comments \"$description\"\n";
				print DBEDIT "modify network_objects $netobject color $colour\n";
				print DBEDIT "update network_objects $netobject\n";
			} else {
				print "	MISSED OBJECT: $netobject, $type, $ip, $nm, $colour, $peram1, $peram2, $peram3, $description\n";
			} 
		}
	} 

#---------------------------------------------------------------------------------------------------
# NOTE: WRITE SERVICE OBJECTS
#---------------------------------------------------------------------------------------------------

	%sourceobjprint = ();

	foreach my $srvcname (sort keys %{$srcconfigsrvcs_ref}) {

		if ($srvcname eq "") { print "   ## WARNING: EMPTY SERVICE FOUND\n";}
		foreach my $proto (sort keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}}) {
			foreach my $port (sort keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}}) {
				my $srvcnameout;
				my $destobjstring = ' ';
				my $description   = 'Migrated';
				my $colour   	  = 'black';
				my $transout 	  = 'no';

				#if (port_is_known($proto,$port,$dstbundle_ref->{'ports'})) {
				#	print "PING\n";
				#	my $dstcandidate = proto_port_to_srvc_name($proto,$port,$dstbundle_ref->{'ports'});
				#	my $srcsrvcports_ref = get_srvc_ports($srvcname, $srcbundle_ref->{'srvcobjects'});
				#	my $dstsrvcports_ref = get_srvc_ports($dstcandidate, $dstbundle_ref->{'srvcobjects'});
				#	if (srvc_port_nums_match($srcsrvcports_ref, $dstsrvcports_ref)) {
				#		print "SRVC NUMS MATCH: $dstcandidate\n";
				#	} 
				#	if (srvc_ports_match($srcsrvcports_ref, $dstsrvcports_ref)) {
				#		print "SRVCS MATCH: $dstcandidate\n";
				#	} else {
				#		print "MISS!!\n";
				#	}
				#}

			# NOTE: check if this service name exists in the destination config bundle, and weather its type and ports exist in the object with the same name

				if (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}) {
					$destobjstring = "Matching object name in dest config: $srvcname";
					unless ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'type'} eq $dstbundle_ref->{'srvcobjects'}{$srvcname}{'type'}) {
						$destobjstring = "$destobjstring TYPE MISMATCH: src $srcbundle_ref->{'srvcobjects'}{$srvcname}{'type'} dst $dstbundle_ref->{'srvcobjects'}{$srvcname}{'type'}";
					}
					unless ((exists $dstbundle_ref->{'srvcobjects'}{$srvcname}) && (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}) && (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}{$port})) {
						$destobjstring = "$destobjstring PORT MISMATCH: src $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} dst $dstbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto}";
					}
				}

			# NOTE: translate port based on proto and port as well as checking that the destination object has the same number of ports

				if ((exists $dstbundle_ref->{'ports'}{$proto}) && (exists $dstbundle_ref->{'ports'}{$proto}{$port}) && ($srvcname ne $dstbundle_ref->{'ports'}{$proto}{$port}{'name'})) {
					my $destobjname = $dstbundle_ref->{'ports'}{$proto}{$port}{'name'} ;
					if ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} eq $dstbundle_ref->{'srvcobjects'}{$destobjname}{'port'}{$proto}) {
						$srvcobjxlates{$srvcname}{'xlate'} = $destobjname; 
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname and has been EXACTLY TRANSLATED";
					} elsif ((scalar keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}}) == (scalar keys %{$dstbundle_ref->{'srvcobjects'}{$destobjname}{'ports'}{$proto}})) {
						$srvcobjxlates{$srvcname}{'xlate'} = $destobjname; 
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname and has been TRANSLATED";
					} else {
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname not xlated ";
					}
				} elsif ((exists $dstbundle_ref->{'ports'}{$proto}) && (exists $dstbundle_ref->{'ports'}{$proto}{$port}) && ($srvcname eq $dstbundle_ref->{'ports'}{$proto}{$port}{'name'})) {
					$destobjstring = "$destobjstring EXACTLY";
				}

			# NOTE: copy description and colour

				if (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'} && defined($srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'})) {
					$description = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'};
					$description =~ s'"''g;
					$description =~ s',''g;
				}
				if (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'colour'}) {
					$colour = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'colour'};
				}
			# NOTE: translate object if it was matched sufficiently in the destination config

				if (exists $srvcobjxlates{$srvcname}) {
					$srvcnameout = $srvcobjxlates{$srvcname}{'xlate'};
					$transout    = 'yes';
				} else {
					$srvcnameout = $srvcname;
					$transout    = 'no';
				}
				if ($srvcnameout eq "") 		{ print "        ## WARNING: EMPTY SERVICE OUT ORIG SERVICE: $srvcname\n"; }
				unless ( defined($srvcnameout) ) 	{ print "        ## WARNING: UNDEFINED SERVICE OUT ORIG SERVICE: $srvcname\n"; }
				unless ( defined($proto) ) 		{ print "        ## WARNING: UNDEFINED PROTO OUT ORIG SERVICE: $srvcname\n"; }
				unless ( defined($colour) ) 		{ print "        ## WARNING: UNDEFINED COLOUR OUT ORIG SERVICE: $srvcname\n"; }
				unless ( defined($description) ) 	{ print "        ## WARNING: UNDEFINED DESCRIPTION OUT ORIG SERVICE: $srvcname\n"; }
				unless ( defined($destobjstring) ) 	{ print "        ## WARNING: UNDEFINED TRANSLATED OBJECT OUT ORIG SERVICE: $srvcname\n"; }
				unless ( defined($transout) ) 		{ print "        ## WARNING: UNDEFINED TRANSLATED OBJECT OUT ORIG SERVICE: $srvcname\n"; }
				unless ( exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'} ) 		{ print "        ## WARNING: PORT LIST DOES NOT EXIST IN OBJ: $srvcname\n"; }
				unless ( exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} ) 	{ print "        ## WARNING: PROTO: $proto DOES NOT EXIST IN OBJ PORT: $srvcname\n"; }
				$sourceobjprint{"$srvcnameout,$proto,$srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto},,$colour,,,,$description $destobjstring"} = $transout;
			}
		}
	}

	# NOTE: Add unknown ports to services to be output

	foreach my $errorservice (keys %{$errormessages_ref}) {

		if ($errorservice =~ /^Known Proto but Unknown Service Used:/) {

			$errorservice =~ s/^Known Proto but Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Port Used In Logfiles"} = 'no';
		}

		elsif ($errorservice =~ /^Unknown Service Used: /) {

			$errorservice =~ s/^Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Service Used In Logfiles"} = 'no';
		}

		elsif ($errorservice =~ /^Named but Unknown Service Used: /) {

			$errorservice =~ s/^Named but Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Named Service Used In Logfiles"} = 'no';
		}

		elsif ($errorservice =~ /^Unknown Named Servce Used: /) {

			$errorservice =~ s/^Unknown Named Servce Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Named Service Used In Logfiles"} = 'no';
		}
	}

	foreach my $printline (sort keys %sourceobjprint) {
		print LASTRASH "$printline\n";
		my $transout = $sourceobjprint{$printline};
		if ($transout eq 'no') {
			my ($srvcobject, $proto, $port, $blank, $colour, $peram1, $peram2, $peram3, $description) = split(/\,/, $printline);
			print DBEDIT "create $proto"."_service $srvcobject\n"; 
			print DBEDIT "modify services $srvcobject color  $colour\n"; 
			print DBEDIT "modify services $srvcobject comments \"$description\"\n"; 
			#print DBEDIT "modify services $srvcobject protocol $proto\n"; 
			print DBEDIT "modify services $srvcobject port $port\n"; 
			print DBEDIT "modify services $srvcobject include_in_any true\n"; 
			print DBEDIT "modify services $srvcobject timeout 3600\n"; 
			print DBEDIT "update services $srvcobject\n";
		}
	} 

#---------------------------------------------------------------------------------------------------
# NOTE: WRITE NET  GROIPS
#---------------------------------------------------------------------------------------------------

	%sourceobjprint = ();
	foreach my $ruleobj (sort keys %{$srcconfiggroups_ref}) {
		my $destobjstring = ' ';
		if (exists $srcbundle_ref->{'netgroups'}{$ruleobj}) {
			my $groupmiss = 0;
			my $grouphit  = 0;
			if (exists $dstbundle_ref->{'netgroups'}{$ruleobj}) {

				# NOTE: check if group with the same name exists 

				$destobjstring = "Matching group name in dest config: $ruleobj";
				my @srcnetgroup = keys %{$srcbundle_ref->{'netgroupobjs'}{$ruleobj}};
				my @dstnetgroup = keys %{$dstbundle_ref->{'netgroupobjs'}{$ruleobj}} ;

				if (compare_arrays(\@srcnetgroup, \@dstnetgroup)) {

					# NOTE: check if the all the objects are the same names and if the objects ips are the same

					my @srcbingroup = sort keys %{$srcbundle_ref->{'bingroups'}{$ruleobj}} ;                                                
					my @dstbingroup = sort keys %{$dstbundle_ref->{'bingroups'}{$ruleobj}} ;
					 
					#print "FOO FOO: @srcbingroup \nMOO MOO: @dstbingroup\n";

					if (compare_arrays(\@srcbingroup, \@dstbingroup)) {
						$destobjstring = "$destobjstring GROUP MATCH: object names and IPs correct";
						#print "$destobjstring WOOOOWOOOWOOO!!!\n";
						$grouphit++;
					} else {
						$destobjstring = "$destobjstring GROUP MATCH: all object names exactly correct but IPs differ";
						$groupmiss++;
					}
				} else {
					# NOTE: else find out whats missing, src and dst being configs not traffic
				}
			} else {
				# NOTE: get the source config group binary ips and check it against each of the destination configs groups

				my @srcbingroup = sort keys %{$srcbundle_ref->{'bingroups'}{$ruleobj}} ;                                                

				foreach my $dstgrp (keys %{$dstbundle_ref->{'bingroups'}}) {
					next if $dstgrp eq $ruleobj;
					my @dstbingroup = sort keys %{$dstbundle_ref->{'bingroups'}{$dstgrp}} ;
					if (compare_arrays(\@srcbingroup, \@dstbingroup)) {
						$destobjstring = "$destobjstring GROUP MATCH: IPs correct but object names differ $ruleobj TRANSLATED";
						#print "$destobjstring FFFFFFFFFFFFFZIP!!!\n";
						$netobjxlates{$ruleobj}{'xlate'} = $dstgrp;
						$grouphit++;
					} else {
						#print "AAAAAAAAAAAAAWWWWWWWW: $dstgrp\n";
					}
				}

			}
			
			my $objcount = scalar keys %{$srcbundle_ref->{'netgroups'}{$ruleobj}};
			my @groupobjs = keys %{$srcbundle_ref->{'netgroupobjs'}{$ruleobj}};

			# NOTE: translate the group name if a match was found

			my $ruleobjx = $ruleobj;
			if (exists $netobjxlates{$ruleobj}) {
				$ruleobjx = $netobjxlates{$ruleobj}{'xlate'};
			} 

			print DBEDIT "create network_object_group $ruleobjx\n";
			print DBEDIT "modify network_objects $ruleobjx color \"dark orchid\"\n";
			print DBEDIT "modify network_objects $ruleobjx comments \"$destobjstring\"\n";
			print DBEDIT "update network_object_group $ruleobjx\n";


			foreach my $groupobj (@groupobjs) {

			# NOTE: translate the group MEMBER name if a match was found and ready output

				if (exists $netobjxlates{$groupobj}) {
					$groupobj = $netobjxlates{$groupobj}{'xlate'};
					print DBEDIT "addelement network_objects $ruleobjx '' network_objects:$groupobj\n";
					$sourceobjprint{"$ruleobjx,group,$groupobj,,red,,,,TRANSLATED $destobjstring"}++;
				} else {
					print DBEDIT "addelement network_objects $ruleobjx '' network_objects:$groupobj\n";
					$sourceobjprint{"$ruleobjx,group,$groupobj,,blue,,,,$destobjstring"}++;
				}
			}
			print DBEDIT "update network_object_group $ruleobjx\n";
		}
	}
	foreach my $printline (sort keys %sourceobjprint) {
		print LASTRASH "$printline\n";
	} 

#---------------------------------------------------------------------------------------------------
# NOTE: WRITE SERVICE GROIPS
#---------------------------------------------------------------------------------------------------

	%sourceobjprint = ();
	foreach my $ruleobj (sort keys %{$srcconfigsrvcgroups_ref}) {
		my $destobjstring = ' ';
		if (exists $srcbundle_ref->{'srvcgroups'}{$ruleobj}) {
			if (exists $dstbundle_ref->{'srvcgroups'}{$ruleobj}) {

				# NOTE: check if group with the same name exists 

				$destobjstring = "Matching service group name in dest config: $ruleobj";
				my @srcnamegroup = keys %{$srcbundle_ref->{'srvcgroupobjs'}{$ruleobj}};
				my @dstnamegroup = keys %{$dstbundle_ref->{'srvcgroupobjs'}{$ruleobj}} ;

				if (compare_arrays(\@srcnamegroup, \@dstnamegroup)) {

					# NOTE: check if the all the objects are the same names and if the objects port and protocols are the same

					my @srcportgroup = sort keys %{$srcbundle_ref->{'portgroups'}{$ruleobj}} ;                                                
					my @dstportgroup = sort keys %{$dstbundle_ref->{'portgroups'}{$ruleobj}} ;

					if (compare_arrays(\@srcportgroup, \@dstportgroup)) {
						$destobjstring = "$destobjstring GROUP MATCH: object names correct but IPs differ";
					} else {
						$destobjstring = "$destobjstring GROUP MISMATCH: object names correct but IPs differ";
					}
				} else {

					# NOTE: else find out whats missing, src and dst being configs not traffic
				}
			} else {
				# NOTE: get the source config group binary ips and check it against each of the destination configs groups

				foreach my $dstgrp (keys %{$dstbundle_ref->{'portgroups'}}) {
					my $srvcgrouphit  = 0;
					my $srvcgroupmiss = 0;
					next if $dstgrp eq $ruleobj;
					my @srcprotogroups = sort keys %{$srcbundle_ref->{'portgroups'}{$ruleobj}} ;                                                
					my @dstprotogroups = sort keys %{$dstbundle_ref->{'portgroups'}{$dstgrp}} ;
					if (compare_arrays(\@srcprotogroups, \@dstprotogroups)) {
						$srvcgrouphit++;
					} else { 
						$srvcgroupmiss++;
					}

					if (($srvcgrouphit > 0) && ($srvcgroupmiss < 1)) {

						$destobjstring = "$destobjstring SERVICE GROUP MATCH: Protocols and Ports correct but object names differ $ruleobj TRANSLATED";
						$srvcobjxlates{$ruleobj}{'xlate'} = $dstgrp;

					} else {
						#print "AAAAAAAAAAAAAWWWWWWWW: $dstgrp\n";
					}
				}

			}
			my $objcount = scalar keys %{$srcbundle_ref->{'srvcgroupobjs'}{$ruleobj}};
			my @groupobjs = keys %{$srcbundle_ref->{'srvcgroupobjs'}{$ruleobj}};
			my $ruleobjx  = $ruleobj;
			if (exists $srvcobjxlates{$ruleobj}) {
				$ruleobjx = $srvcobjxlates{$ruleobj}{'xlate'};
			}

			print DBEDIT "create service_group $ruleobjx\n";
			print DBEDIT "modify services $ruleobjx color \"cyan\"\n";
			print DBEDIT "modify services $ruleobjx comments \"$destobjstring\"\n";
			print DBEDIT "update service_group $ruleobjx\n";
			foreach my $groupobj (@groupobjs) {
				if (exists $srvcobjxlates{$groupobj}) {
					$groupobj = $srvcobjxlates{$groupobj}{'xlate'};
					$sourceobjprint{"$ruleobjx,srvgroup,$groupobj,,red,,,,TRANSLATED $destobjstring"}++;
					print DBEDIT "addelement services $ruleobjx '' services:$groupobj\n";
				} else {
					$sourceobjprint{"$ruleobjx,srvgroup,$groupobj,,forrest green,,,,$destobjstring"}++;
					print DBEDIT "addelement services $ruleobjx '' services:$groupobj\n";
				}
			}
			print DBEDIT "update service_group $ruleobjx\n";
		}
	}
	foreach my $printline (sort keys %sourceobjprint) {
		print LASTRASH "$printline\n";
	} 

	#print "NET XLATE OBJECTS		\n##########################################################################\n\n". Dumper(%netobjxlates) . "\n\n"	;

#---------------------------------------------------------------------------------------------------
# NOTE: WRITE DBEDIT POLICY AND CSV
#---------------------------------------------------------------------------------------------------

	print LASTRASH "##RULE_TYPE,SOURCE,DESTINATION,VPN,SERVICE,ACTION,TRACK,INSTALL_ON,TIME,COMMENT\n";
	print LASTRASH "rulebase_header,$destrulebase\n";
	my $newnum = 0;
	print DBEDIT "update_all\n";
	print DBEDIT "create policies_collection $destrulebase\n";
	print DBEDIT "modify policies_collections $destrulebase comments Created_by_Dan_Martin_With_360-FAAR\n";
	print DBEDIT "update policies_collections $destrulebase\n";
	print DBEDIT "create firewall_policy ##$destrulebase\n";
	print DBEDIT "modify fw_policies ##$destrulebase collection policies_collections:$destrulebase\n";

	foreach my $lastnum (sort numerically keys %{$lastrashprintbase_ref}) {
		my ($rsrc, $rdst, $rport, $origrnum) = split (/\,/, $lastrashprintbase_ref->{$lastnum}) ;
		my $lastnum = $lastnum - 1;
		my @origrulenums	;
		my @origrulecomments	;
		my @origruleheaders 	;
		my @srcouts		;
		my @dstouts		;
		my @srvcouts		;
		print DBEDIT "addelement fw_policies ##$destrulebase rule security_rule\n";

		my @srcs = split (';', $rsrc); 
		foreach my $srctest (@srcs) { 
			if (exists $netobjxlates{$srctest}) {
				#print "TEST SRC: $srctest $netobjxlates{$srctest}{'xlate'}\n";
				push(@srcouts, $netobjxlates{$srctest}{'xlate'});
				next if $srctest =~ /^Any$|^any$|^ANY$|^any4$/;
				#print "SRC ARRAY @srcouts\n";
				print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:src:'' network_objects:$netobjxlates{$srctest}{'xlate'}\n";
			} else {
				push(@srcouts, $srctest);
				next if $srctest =~ /^Any$|^any$|^ANY$|^any4$/;
				print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:src:'' network_objects:$srctest\n";
			}

		}
		my $src = join (';', @srcouts);

		my @dsts = split (';', $rdst);
		foreach my $dsttest (@dsts) { 
			if (exists $netobjxlates{$dsttest}) {
				#print "TEST DST: $dsttest $netobjxlates{$dsttest}{'xlate'}\n";
				push(@dstouts, $netobjxlates{$dsttest}{'xlate'});
				next if $dsttest =~ /^Any$|^any$|^ANY$|^any4$/;
				#print "DST ARRAY @dstouts\n";
				print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:dst:'' network_objects:$netobjxlates{$dsttest}{'xlate'}\n";
			} else {
				push(@dstouts, $dsttest);
				next if $dsttest =~ /^Any$|^any$|^ANY$|^any4$/;
				print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:dst:'' network_objects:$dsttest\n";
			}
		}
		my $dst = join (';', @dstouts);
		print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:through:'' globals:Any\n";

		my @ports = split (';', $rport); 	
		foreach my $porttest (@ports) {
			if ($porttest eq "") {
				print "  ## WARNING:  EMPTY SERVICE FOUND IN NEW RULE $newnum ORIG NUM $lastnum\n";
			} elsif (exists $srvcobjxlates{$porttest}) {
				#print "TEST SRVC: $porttest $srvcobjxlates{$porttest}{'xlate'}\n";
				push(@srvcouts, $srvcobjxlates{$porttest}{'xlate'});
				next if $porttest =~ /^Any$|^any$|^ANY$|^any4$/;
				#print "SRVC ARRAY @srvcouts\n";
				print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:services:'' services:$srvcobjxlates{$porttest}{'xlate'}\n";
			} else {
				push(@srvcouts, $porttest);
				next if $porttest =~ /^Any$|^any$|^ANY$/;
				print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:services:'' services:$porttest\n";
			}
		}
		my $ports = join (';', @srvcouts);


		my $action;
		my $actioncsv;

		if ($logparsetype eq 'normal') {
			$action    = 'Accept';
			$actioncsv = 'accept';
		} else {
			$action    = 'Deny';
			$actioncsv = 'deny';
		}

		my $actionout = $action;

		print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:action " . $actionout . "_action:" . $actionout . "\n";
		print DBEDIT "rmbyindex fw_policies ##$destrulebase rule:$newnum:track 0\n";
		print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:track tracks:Log\n";
		print DBEDIT "addelement fw_policies ##$destrulebase rule:$newnum:install:'' globals:Any\n";

		if ($ruleoutswitch eq 'STANDARD') {
			my $description;
			my $sectionhead;
			@origrulenums = split (';', $origrnum) ;
			foreach my $rlnum (sort @origrulenums) {

				if (exists $srcbundle_ref->{'rules'}{$rlnum}{'comment'}) {
					$description = $srcbundle_ref->{'rules'}{$rlnum}{'comment'};
					$description =~ s'"''g;
					$description =~ s',''g;
				} else {
					$description = ' ';
				}
				if (exists $srcbundle_ref->{'rules'}{$rlnum}{'header'}) {
					$sectionhead = $srcbundle_ref->{'rules'}{$rlnum}{'header'};
					$sectionhead =~ s'"''g;
					$sectionhead =~ s',''g;
				} else {
					$sectionhead = ' ';
				}
				push (@origrulecomments, "OrigRuleDesc:$srcbundle_ref->{'rules'}{$rlnum}{'rbnum'}:$description ");
				push (@origruleheaders, "OrigSecHed:$srcbundle_ref->{'rules'}{$rlnum}{'rbnum'}:$sectionhead ");
			}
		} elsif ($ruleoutswitch eq 'keepcomments') {
			push (@origrulecomments, $origrnum);
			push (@origruleheaders, ' ');
		}
		print LASTRASH "security_rule,$src,$dst,Any,$ports,$actioncsv,Log,Any,Any,@origrulecomments@origruleheaders\n";
		print DBEDIT "modify fw_policies ##$destrulebase rule:$newnum:comments \"@origrulecomments@origruleheaders\"\n";
		print DBEDIT "update fw_policies ##$destrulebase\n";
		$newnum++;
	}
	print "\n\n-----------------------------------------------------------------------------------------\n";
	print "  	FILE: $filename WRITTEN  	!!*%*%*-HURRAY-*%*%*!!\n";
	print "-----------------------------------------------------------------------------------------\n\n";
	print "-----------------------------------------------------------------------------------------\n";
	print " DBEDIT FILE: $rulefile WRITTEN  	!!*%*%*-SWEEET-*%*%*!!\n";
	print "-----------------------------------------------------------------------------------------\n\n";
	close LASTRASH	;
	close DBEDIT	;
	print "\n\n";
}

#=============================================================================================
# OUTPUT NETSCREEN ScreenOS-6 format config to FILE
#=============================================================================================

sub output_netscreen {

	my ($srcbundle_ref, 
	$dstbundle_ref, 
	$srcconfigobjs_ref, 
	$srcconfigsrvcs_ref, 
	$srcconfiggroups_ref, 
	$srcconfigsrvcgroups_ref, 
	$lastrashprintbase_ref,
	$errormessages_ref,
	$ruleoutswitch) 	= @_ ;

	my %zonemappings;
	my %rangemappings;
	my %netobjxlates;
	my %srvcobjxlates;
	my %multinetobjs;
	my %netobjzones;
	my $nsfilename;

	my %sourceobjprint = ();

	$zonemappings{''}{'zone'} = '360-FAAR-DefaultZone-CHANGE-ME';

	my $option_header =<<HERE;
-----------------------------------------------------------------------------------------
     NETSCREEN SCREENOS-6 OUTPUT:

	Define route to zone mappings in the format:
	ZONE IP MASKLENGTH
	type '.' to finish zone input

HERE
	zonemappings_include_exclude(
		$option_header,
		\%zonemappings);


	if ($logparsetype eq 'normal') {
		$option_header = "\n	Enter the NAME of the NETSCREEN ScreenOS-8 file to be SAVED:"		;
	} else {
		$option_header = "\n	Enter the NAME of the NETSCREEN ScreenOS-8 file to be SAVED:\n	(the string 'DROPS-' will be prepended to the name you choose)\n\n"		;
	}

	choose_output_file_name(
		$option_header,
		\$nsfilename);

	if ($logparsetype ne 'normal') {
		$nsfilename = "DROPS-$nsfilename";
	}

	open (NETRASH, ">$nsfilename") or warn "WARNING: Cannot open FILE: $nsfilename\n";	

	print "\n";
	
	my @rbnums;
	foreach my $globalrule (keys %{$dstbundle_ref->{'rules'}}) {
		push (@rbnums, $dstbundle_ref->{'rules'}{$globalrule}{'rbnum'});
	}
	my $maxrbnum = 0;
	#$maxrbnum    = pop(@rbnums);
	foreach my $testnum (@rbnums) {
		$maxrbnum = $testnum if $testnum > $maxrbnum;
	}

	my $override;

	$option_header = "\n	MAX Existing RULE NUM: $maxrbnum

	Enter a NUMBER to OVERRIDE the above RULE COUNT  - or '.' to ACCEPT DEFAULT: \n\n";

	input_string_or_skip(
		$option_header,
		\$override);

	if (defined($override) && ($override =~ /^\d+$/)) {
		$maxrbnum = $override;
	}

	#print "\n-----------------------------------------------------------------------------------------\n";
	print "\n	Building: OBJECT ZONES FROM DEST CONFIG INFO:\n";

#---------------------------------------------------------------------------------------------------
# NOTE: DEVINE ZONES
#---------------------------------------------------------------------------------------------------

# NOTE: Working out best zones to put objects into
	
	my $zonecount       = 0;
	my $zonecountholder = 0;
	foreach my $objn (keys %{$srcbundle_ref->{'netobjects'}}) {
		foreach my $srcipbin (keys %{$srcbundle_ref->{'netobjects'}{$objn}{'ipbin'}}) {

		# NOTE: assign zone from object details

			my $workingsrcbin = $srcipbin;
			until (exists $dstbundle_ref->{'ips'}{$workingsrcbin} || $workingsrcbin eq "") {
				chop $workingsrcbin;
			}
			if ($workingsrcbin ne "" && exists $dstbundle_ref->{'ips'}{$workingsrcbin} && exists $dstbundle_ref->{'ips'}{$workingsrcbin}{'zone'}) {
				if (exists $netobjzones{$objn} && exists $netobjzones{$objn}{'zone'} && ($netobjzones{$objn}{'zone'} ne $dstbundle_ref->{'ips'}{$workingsrcbin}{'zone'})) {
					print "   MULTIPLE OBJECT ZONES FOUND FOR: $objn, USING: $netobjzones{$objn}{'zone'}, DISCARDING: $dstbundle_ref->{'ips'}{$workingsrcbin}{'zone'}\n";
				} else {
					#print "ASSIGNED ZONE $dstbundle_ref->{'ips'}{$workingsrcbin}{'zone'} TO OBJ $objn FROM NET OBJECTS DEFFINITION\n";
					$netobjzones{$objn}{'zone'} = $dstbundle_ref->{'ips'}{$workingsrcbin}{'zone'};
				}
			} else {

			# NOTE: assign zone from zone details in destination configuration

				my $workingzonebin = $srcipbin;
				until (exists $dstbundle_ref->{'zones'}{$workingzonebin} || $workingzonebin eq "") {
					chop $workingzonebin;
				}
				if (($workingzonebin ne "") && exists $netobjzones{$objn} && exists $netobjzones{$objn}{'zone'} && ($netobjzones{$objn}{'zone'} ne $dstbundle_ref->{'zones'}{$workingzonebin}{'zone'})) {
					print "   MULTIPLE OBJECT ZONES FOUND FOR: $objn, USING: $netobjzones{$objn}{'zone'}, DISCARDING ROUTE ZONE: $dstbundle_ref->{'zones'}{$workingsrcbin}{'zone'}\n";

			# NOTE: assign zone from zone details here if not default route - else use zone mappings - and finally if no zone mappings were entered use the default

				} elsif (($workingzonebin ne "") && exists $dstbundle_ref->{'zones'}{$workingzonebin}) {
					#print "ASSIGNED ZONE $dstbundle_ref->{'zones'}{$workingzonebin}{'zone'} TO OBJ $objn FROM ROUTE DEFFINITION, ANY EXCLUDED\n";
					$netobjzones{$objn}{'zone'} = $dstbundle_ref->{'zones'}{$workingzonebin}{'zone'};
				} elsif (1 <= (scalar keys %zonemappings)) {

				# NOTE: assign zone from zone details in destination configuration

					my $workingmapbin = $srcipbin;
					until (exists $zonemappings{$workingmapbin} || $workingmapbin eq "") {
						chop $workingmapbin;
					}
					if (exists $netobjzones{$objn} && exists $netobjzones{$objn}{'zone'} && ($netobjzones{$objn}{'zone'} ne $zonemappings{$workingmapbin}{'zone'})) {
						print "   MULTIPLE OBJECT ZONES FOUND FOR: $objn, USING: $netobjzones{$objn}{'zone'}, DISCARDING MANUAL MAP ZONE: $zonemappings{$workingmapbin}{'zone'}\n";
