	my %serviceouts;
	foreach my $srvcname (sort keys %{$srcconfigsrvcs_ref}) {
		foreach my $proto (sort keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}}) {
			foreach my $port (sort keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}}) {
				my $srvcnameout;
				my $destobjstring = ' ';
				my $description   = 'Migrated';
				my $colour   	  = 'black';
				if (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}) {
					$destobjstring = "Matching object name in dest config: $srvcname";
					unless ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'type'} eq $dstbundle_ref->{'srvcobjects'}{$srvcname}{'type'}) {
						$destobjstring = "$destobjstring TYPE MISMATCH: src $srcbundle_ref->{'srvcobjects'}{$srvcname}{'type'} dst $dstbundle_ref->{'srvcobjects'}{$srvcname}{'type'}";
					}
					unless ((exists $dstbundle_ref->{'srvcobjects'}{$srvcname}) && (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}) && (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}{$port})) {
						$destobjstring = "$destobjstring PORT MISMATCH: src $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} dst $dstbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto}";
					}
				#} else {
				#	$destobjstring = " ";
				}
				if ((exists $dstbundle_ref->{'ports'}{$proto}) && (exists $dstbundle_ref->{'ports'}{$proto}{$port}) && ($srvcname ne $dstbundle_ref->{'ports'}{$proto}{$port}{'name'})) {
					my $destobjname = $dstbundle_ref->{'ports'}{$proto}{$port}{'name'} ;
					if ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} eq $dstbundle_ref->{'srvcobjects'}{$destobjname}{'port'}{$proto}) {
						$srvcobjxlates{$srvcname}{'xlate'} = $destobjname; 
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname and has been EXACTLY TRANSLATED";
					} elsif ((scalar keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}}) == (scalar keys %{$dstbundle_ref->{'srvcobjects'}{$destobjname}{'ports'}{$proto}})) {
						$srvcobjxlates{$srvcname}{'xlate'} = $destobjname; 
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname and has been TRANSLATED";
					} else {
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname not xlated ";
					}
				} elsif ((exists $dstbundle_ref->{'ports'}{$proto}) && (exists $dstbundle_ref->{'ports'}{$proto}{$port}) && ($srvcname eq $dstbundle_ref->{'ports'}{$proto}{$port}{'name'})) {
					$destobjstring = "$destobjstring EXACTLY";
				}
				if (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'}) {
					$description = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'};
					$description =~ s'"''g;
					$description =~ s',''g;
				}
				if (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'colour'}) {
					$colour = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'colour'};
				}
				if (exists $srvcobjxlates{$srvcname}) {
					$srvcnameout = $srvcobjxlates{$srvcname}{'xlate'};
				} else {
					$srvcnameout = $srvcname;
				}
				my $portout = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto};

				unless (defined($portout)) { print "   WARNING:  Service: $srvcname - has a bad PROTO definition in $proto - SERVICE TRANSLATION USING Proto: $proto SKIPPED\n"; next; }

				if ($portout =~ /^\<\d+$/) {
					$portout =~ s/^\<//;
					$portout = "0\-$portout";
				} elsif ($portout =~ /^\>\d+$/) {
					$portout =~ s/^\>//;
					$portout = "$portout\-65535";
				} elsif ($portout =~ /^\d+$/) {
					$portout = "$portout\-$portout";
				} elsif ($portout =~ /^\d+\-\d+$/) {
					# DO NOTHING
				} else { 
					#print "OUTPORT BAD $portout\n";
				}
				$serviceouts{"set service \"$srvcnameout\" protocol $proto src-port 0-65535 dst-port $portout"}{"## $destobjstring $description"}++;
			}
		}
	}

	# NOTE: Add unknown ports to services to be output

	foreach my $errorservice (keys %{$errormessages_ref}) {

		if ($errorservice =~ /^Known Proto but Unknown Service Used:/) {

			$errorservice =~ s/^Known Proto but Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$serviceouts{"set service \"$proto-$port\" protocol $proto src-port 0-65535 dst-port $port"}{"## Unknown Port Used In Logfiles"}++;
		}

		elsif ($errorservice =~ /^Unknown Service Used: /) {

			$errorservice =~ s/^Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$serviceouts{"set service \"$proto-$port\" protocol $proto src-port 0-65535 dst-port $port"}{"## Unknown Service Used In Logfiles"}++;
		}

		elsif ($errorservice =~ /^Named but Unknown Service Used: /) {

			$errorservice =~ s/^Named but Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$serviceouts{"set service \"$proto-$port\" protocol $proto src-port 0-65535 dst-port $port"}{"## Unknown Named Service Used In Logfile"}++;
		}

		elsif ($errorservice =~ /^Unknown Named Servce Used: /) {

			$errorservice =~ s/^Unknown Named Servce Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			$serviceouts{"set service \"$proto-$port\" protocol $proto src-port 0-65535 dst-port $port"}{"## Unknown Named Service Used In Logfile"}++;
		}
	}

	foreach my $outservice (sort keys %serviceouts) {
		foreach my $outstring (sort keys %{$serviceouts{$outservice}}) {
			print NETRASH "$outstring\n";
		}
		print NETRASH "$outservice\n";
	}




