	print "\n	Writing: NETSCREEN ADDRESS GROUPS...\n";

	%sourceobjprint = ();
	foreach my $ruleobj (sort keys %{$srcconfiggroups_ref}) {
		my $destobjstring = ' ';
		if (exists $srcbundle_ref->{'netgroups'}{$ruleobj}) {

			my $groupmiss = 0;
			my $grouphit  = 0;
			if (exists $dstbundle_ref->{'netgroups'}{$ruleobj}) {

				# NOTE: check if group with the same name exists 

				$destobjstring = "Matching group name in dest config: $ruleobj";
				my @srcnetgroup = keys %{$srcbundle_ref->{'netgroupobjs'}{$ruleobj}};
				my @dstnetgroup = keys %{$dstbundle_ref->{'netgroupobjs'}{$ruleobj}} ;

				if (compare_arrays(\@srcnetgroup, \@dstnetgroup)) {

					# NOTE: check if the all the objects are the same names and if the objects ips are the same

					my @srcbingroup = sort keys %{$srcbundle_ref->{'bingroups'}{$ruleobj}} ;                                                
					my @dstbingroup = sort keys %{$dstbundle_ref->{'bingroups'}{$ruleobj}} ;
					 

					if (compare_arrays(\@srcbingroup, \@dstbingroup)) {
						$destobjstring = "$destobjstring GROUP MATCH: object names and IPs correct";
						$grouphit++;
					} else {
						$destobjstring = "$destobjstring GROUP MATCH: all object names exactly correct but IPs differ";
						$groupmiss++;
					}
				} else {
					#print "@srcnetgroup TINNNNNNGS: @dstnetgroup\n";

				}
			} else {
				# NOTE: get the source config group binary ips and check it against each of the destination configs groups

				my @srcbingroup = sort keys %{$srcbundle_ref->{'bingroups'}{$ruleobj}} ;                                                

				foreach my $dstgrp (keys %{$dstbundle_ref->{'bingroups'}}) {
					next if $dstgrp eq $ruleobj;
					my @dstbingroup = sort keys %{$dstbundle_ref->{'bingroups'}{$dstgrp}} ;
					if (compare_arrays(\@srcbingroup, \@dstbingroup)) {
						$destobjstring = "$destobjstring GROUP MATCH: IPs correct but object names differ $ruleobj TRANSLATED";
						$netobjxlates{$ruleobj}{'xlate'} = $dstgrp;
						$grouphit++;
					} else {
					}
				}

			}
			
			my $objcount	= scalar keys %{$srcbundle_ref->{'netgroups'}{$ruleobj}};
			my @groupobjs	= keys %{$srcbundle_ref->{'netgroupobjs'}{$ruleobj}};
			#my ($grpobj) 	= keys %{$srcbundle_ref->{'netgroupobjs'}{$ruleobj}};
			#my $zone 	= $netobjzones{$grpobj}{'zone'};

			my $zone;
			foreach my $grpobj (keys %{$srcbundle_ref->{'netgroupobjs'}{$ruleobj}}) {
				$zone 	= $netobjzones{$grpobj}{'zone'};
				if (defined($zone)) { last; }
			}


			$netobjzones{$ruleobj}{'zone'} = $zone;

			foreach my $groupobj (@groupobjs) {
				my $ruleobjx = $ruleobj;

			# NOTE: translate the group name if a match was found

				if (exists $netobjxlates{$ruleobj}) {
					$ruleobjx = $netobjxlates{$ruleobj}{'xlate'};
				} 

			# NOTE: translate the group MEMBER name if a match was found and ready output

				if (exists $netobjxlates{$groupobj}) {
					$groupobj = $netobjxlates{$groupobj}{'xlate'};
					$sourceobjprint{"set group address \"$zone\" \"$ruleobjx\" add \"$groupobj\""}++;
				} else {
					unless(defined($zone)) { print "   WARNING: NO ZONE for $ruleobjx while adding $groupobj\n"; next;}
					$sourceobjprint{"set group address \"$zone\" \"$ruleobjx\" add \"$groupobj\""}++;
				}
			}
			foreach my $printline (sort keys %sourceobjprint) {
				print NETRASH "$printline\n";
			} 

		# NOTE: translate the group name if a match was found

			my $ruleobjcoment = $ruleobj;
			if (exists $netobjxlates{$ruleobj}) {
				$ruleobjcoment = $netobjxlates{$ruleobj}{'xlate'};
			} 
			print NETRASH "set group address \"$zone\" \"$ruleobjcoment\" comment \"$destobjstring\"\n";

			%sourceobjprint = ();

		} else {
			print "GROUP GONE ARRY!! $ruleobj\n";
		}
	}

