# NOTE: output rules

	#print "\n-----------------------------------------------------------------------------------------\n";
	print "\n	Writing: NETSCREEN RULE DEFINITIONS...\n";

	foreach my $num (sort numerically keys %{$lastrashprintbase_ref}) {
		my ($rsrc, $rdst, $rport, $origrnum) = split (/\,/, $lastrashprintbase_ref->{$num}) ;
		my ($firstsrc, @srcs) 		= split (';', $rsrc) ;
		my ($firstdst, @dsts) 		= split (';', $rdst) ;
		my ($firstsrvc, @services) 	= split (';', $rport) ;
		my ($firstsrcout, $firstdstout);
		my @origrulecomments	;
		my @origruleheaders 	;
		my @origrulenums	;

		if ($ruleoutswitch eq 'STANDARD') {
			@origrulenums 		= sort numerically split (';', $origrnum) ;
			foreach my $rlnum (@origrulenums) {
				push (@origrulecomments, "Rulebase $srcbundle_ref->{'rules'}{$rlnum}{'rulegroup'}: Rule $srcbundle_ref->{'rules'}{$rlnum}{'rbnum'}: $srcbundle_ref->{'rules'}{$rlnum}{'comment'} ");
				push (@origruleheaders, "Rulebase $srcbundle_ref->{'rules'}{$rlnum}{'rulegroup'}: Rule $srcbundle_ref->{'rules'}{$rlnum}{'rbnum'}: Section Title: $srcbundle_ref->{'rules'}{$rlnum}{'header'} ");
			}
		} elsif ($ruleoutswitch eq 'keepcomments') {
			push (@origrulecomments, $origrnum);
			push (@origruleheaders, ' ');
		}


		if (exists $netobjxlates{$firstsrc} ) {
			$firstsrcout = $netobjxlates{$firstsrc}{'xlate'};
		} else {
			$firstsrcout = $firstsrc;
		}

		if (exists $netobjxlates{$firstdst} ) {
			$firstdstout = $netobjxlates{$firstdst}{'xlate'};
		} else {
			$firstdstout = $firstdst;
		}

		if (exists $srvcobjxlates{$firstsrvc}) {
			$firstsrvc = $srvcobjxlates{$firstsrvc}{'xlate'};
		}

		if ($num =~ /^\d+\.\d+$/) {
			$maxrbnum++;
		}

		my $outnum;
		if (defined ($maxrbnum)) {
			$outnum = $num + $maxrbnum;
		} else {
			$outnum = $num;
		}

		if ($outnum =~ /^\d+\.\d+$/) {
			my $dummy;
			($outnum, $dummy) = split (/\./, $outnum);
		}

		my $action;
		if ($logparsetype eq 'normal') {
			$action    = 'permit';
		} else {
			$action    = 'deny';
		}

		my $actionout = $action;

		print NETRASH "set policy id $outnum from \"$netobjzones{$firstsrc}{'zone'}\" to \"$netobjzones{$firstdst}{'zone'}\" \"$firstsrcout\" \"$firstdstout\" \"$firstsrvc\" $actionout log\n";     #@origrulecomments,@origruleheaders\n";
		print NETRASH "set policy id $outnum\n";

		foreach my $src (sort @srcs) {
			my $srcout = $src;
			if (exists $netobjxlates{$src} ) {
				$srcout = $netobjxlates{$src}{'xlate'};
			}
			print NETRASH "set src-address \"$srcout\"\n"; 
			#print NETRASH "set src-address \"$srcout\" zone $netobjzones{$src}{'zone'}\n";
		}
		foreach my $dst (sort @dsts) {
			my $dstout = $dst;
			if (exists $netobjxlates{$dst} ) {
				$dstout = $netobjxlates{$dst}{'xlate'};
			}
			print NETRASH "set dst-address \"$dstout\"\n"; 
			#print NETRASH "set dst-address \"$dstout\" zone $netobjzones{$dst}{'zone'}\n";
		}
		foreach my $service (sort @services) {
			if (exists $srvcobjxlates{$service}) {
				$service = $srvcobjxlates{$service}{'xlate'};
			}
			print NETRASH "set service \"$service\"\n";
		}
		print NETRASH "set log session-init\n";
		print NETRASH "set name \"@origrulecomments @origruleheaders\" \n";
		print NETRASH "exit\n\n";
	}
	print "\n\n-----------------------------------------------------------------------------------------\n";
	print "   NETSCREEN ScreenOS-6 FILE: $nsfilename WRITTEN  	!!*%*%*-SUPER-*%*%*!!\n";
	print "-----------------------------------------------------------------------------------------\n";
	print "\n\n";
}

#=============================================================================================
# OUTPUT Cisco ASA format config to FILE
#=============================================================================================

sub output_cisco_and_csv_file {

	my ($srcbundle_ref, 
	$dstbundle_ref, 
	$srcconfigobjs_ref, 
	$srcconfigsrvcs_ref, 
	$srcconfiggroups_ref, 
	$srcconfigsrvcgroups_ref, 
	$lastrashprintbase_ref, 
	$errormessages_ref,
	$ruleoutswitch) = @_;

	my $filename			;
	my $rulefile = 'cisco.cisco'	;
	my $destrulebase		;
	my %netobjxlates		;
	my %multinetobjs		;
	my %srvcobjxlates		;
	my $csfilename			;
	my $option_header		;

	if ($logparsetype eq 'normal') {

		$option_header = <<HERE;
-----------------------------------------------------------------------------------------
    OUTPUT CISCO ASA CMD TEXT TO FILE:

	Enter the NAME of the Cisco ASA 8.4+ FILE to be SAVED:

HERE

	} else {

		$option_header = <<HERE;
-----------------------------------------------------------------------------------------
    OUTPUT CISCO ASA CMD TEXT TO FILE:

	Enter the NAME of the Cisco ASA 8.4+ FILE to be SAVED:
	(the string 'DROPS-' will be prepended to the name you choose)

HERE
	}

	choose_output_file_name(
		$option_header,
		\$csfilename);

	if ($logparsetype ne 'normal') {
		$csfilename = "DROPS-$csfilename";
	}

	open (CISCORASH, ">$csfilename") or warn "WARNING: Cannot open FILE: $csfilename\n";	


	if ($logparsetype eq 'normal') {

		$option_header = <<HERE;
	Enter the NAME of the ACCESS-LIST to write RULES to:

HERE
	} else {

		$option_header = <<HERE;
	Enter the NAME of the ACCESS-LIST to write RULES to:
	(the string 'DROPS-' will be prepended to the name you choose)

HERE
	}

	input_string(
		$option_header,
		\$destrulebase);

	print "\n\n"								;

	if ($logparsetype ne 'normal') {
		$destrulebase = "DROPS-$destrulebase";
	}

	my %sourceobjprint = ()							;
	my %ciscoobjprint = ()							;
	my %ciscosrvcprint = ()							;

#---------------------------------------------------------------------------------------------------
# NOTE: OUTPUT NETWOURK OBJECTS
#---------------------------------------------------------------------------------------------------

	foreach my $ruleobj (sort keys %{$srcconfigobjs_ref}) {
		foreach my $ipbin (sort keys %{$srcbundle_ref->{'netobjects'}{$ruleobj}{'ipbin'}}) {
			my $ruleobjout;
			my $destobjstring = ' ';
			my $description = ' ';
			my $colour = 'blue';

		# NOTE: check if the object name exists in the destination config and note it if the ip matches, no transation needed objects is the same

		# NOTE: check if its a range or translate and print

			if ($srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq 'range') {
				my $rangecount = 0;
				my $ipstart 		= $srcbundle_ref->{'netobjects'}{$ruleobj}{'rangestart'};
				my $ipend 		= $srcbundle_ref->{'netobjects'}{$ruleobj}{'rangeend'};
				if (exists $dstbundle_ref->{'netobjects'}{$ruleobj} && ($dstbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq 'range')) {
					if (($srcbundle_ref->{'netobjects'}{$ruleobj}{'rangestart'} eq $dstbundle_ref->{'netobjects'}{$ruleobj}{'rangestart'}) && 
					    ($srcbundle_ref->{'netobjects'}{$ruleobj}{'rangeend'}   eq $dstbundle_ref->{'netobjects'}{$ruleobj}{'rangeend'}  )) {
						$destobjstring = "$destobjstring TRANSLATED Range Object: $ruleobj matches the RANGE of $dstbundle_ref->{'netobjects'}{$ruleobj}{'type'} $ruleobj EXACTLY";
					} 
				}
				if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'} && defined($srcbundle_ref->{'netobjects'}{$ruleobj}{'description'})) {
					$description = $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'};
					$description =~ s'"''g;
					$description =~ s',''g;
				}
				$ciscoobjprint{"object network $ruleobj\n range $ipstart $ipend\n description $description $colour $destobjstring"}++;
				$sourceobjprint{"$ruleobj,$srcbundle_ref->{'netobjects'}{$ruleobj}{'type'},$ipstart,$ipend,$srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'},,,,$description $destobjstring"}++; 
				next;

			} elsif (exists $dstbundle_ref->{'netobjects'}{$ruleobj}) {
				$destobjstring = "Matching object name in dest config: $ruleobj";
				unless ($srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq $dstbundle_ref->{'netobjects'}{$ruleobj}{'type'}) {
					$destobjstring = "$destobjstring TYPE MISMATCH: src $srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} dst $dstbundle_ref->{'netobjects'}{$ruleobj}{'type'}";
				}
				unless (exists $dstbundle_ref->{'netobjects'}{$ruleobj}{'ipbin'}{$ipbin}) {
					$destobjstring = "$destobjstring IP MISMATCH: src $srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'} dst $dstbundle_ref->{'netobjects'}{$ruleobj}{'ip'}";
				}

		# NOTE: translation  based on IP

			} elsif ((exists $dstbundle_ref->{'ips'}{$ipbin}) && ($ruleobj ne $dstbundle_ref->{'ips'}{$ipbin}{'name'})) {
				my $destobjname = $dstbundle_ref->{'ips'}{$ipbin}{'name'};
				$netobjxlates{$ruleobj}{'xlate'} = $destobjname;
				$destobjstring = "$destobjstring TRANSLATED Object: $ruleobj matches the IP of $dstbundle_ref->{'netobjects'}{$destobjname}{'type'} $destobjname";
			} elsif (exists $dstbundle_ref->{'ips'}{$ipbin}) {
				my $destobjname = $dstbundle_ref->{'ips'}{$ipbin}{'name'};
				$netobjxlates{$ruleobj}{'xlate'} = $destobjname;
				$destobjstring = "$destobjstring TRANSLATED LOOSE Object: $ruleobj matches the IP of $dstbundle_ref->{'netobjects'}{$destobjname}{'type'} $destobjname";
			}

			if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'} && defined($srcbundle_ref->{'netobjects'}{$ruleobj}{'description'})) {
				$description = $srcbundle_ref->{'netobjects'}{$ruleobj}{'description'};
				$description =~ s'"''g;
				$description =~ s',''g;
			}
			if (exists $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'}) {
				$colour = $srcbundle_ref->{'netobjects'}{$ruleobj}{'colour'};
			}
			if (exists $netobjxlates{$ruleobj}) {
				$ruleobjout = $netobjxlates{$ruleobj}{'xlate'};
			} else {
				$ruleobjout = $ruleobj;
			}
			$sourceobjprint{"$ruleobjout,$srcbundle_ref->{'netobjects'}{$ruleobj}{'type'},$srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'},$srcbundle_ref->{'netobjects'}{$ruleobj}{'nm'},$colour,,,,$description $destobjstring"}++;
			if ($srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq 'host') {
				$ciscoobjprint{"name $srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'} $ruleobjout description $description $colour $destobjstring"}++;
				$ciscoobjprint{"object network $ruleobjout\n host $srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'}\n description $description $colour $destobjstring"}++;
			} elsif ($srcbundle_ref->{'netobjects'}{$ruleobj}{'type'} eq 'range') {
				$ciscoobjprint{"object network $ruleobjout\n range $srcbundle_ref->{'netobjects'}{$ruleobj}{'rangestart'} $srcbundle_ref->{'netobjects'}{$ruleobj}{'rangeend'}\n description $description $colour $destobjstring"}++;
			} else {
				$ciscoobjprint{"object network $ruleobjout\n subnet $srcbundle_ref->{'netobjects'}{$ruleobj}{'ip'} $srcbundle_ref->{'netobjects'}{$ruleobj}{'nm'}\n description $description $colour $destobjstring"}++;
				#$multinetobjs{$ruleobjout}{'translated'}++;
#			} else {
#				print "   WARNING: Object $ruleobj has been missed by the Cisco ASA object writer\n";
			}
		}
	}
	foreach my $printline (sort keys %sourceobjprint) {
		#print LASTRASH "$printline\n";
	} 
	foreach my $printline (sort keys %ciscoobjprint) {
		print CISCORASH "$printline\n";
	} 
	foreach my $multiobj (sort keys %multinetobjs) {
		if (exists $multinetobjs{$multiobj}{'netobjs'}) {
			print CISCORASH "object-group network $multiobj\n";
			my $description = 'Migrated';
			if (exists $srcbundle_ref->{'netobjects'}{$multiobj}{'description'} && $srcbundle_ref->{'netobjects'}{$multiobj}{'description'} ne "") {
				$description = $srcbundle_ref->{'netobjects'}{$multiobj}{'description'};
				$description =~ s/\"//g;
				$description =~ s',''g;
				print CISCORASH " description $description\"\n"; 
			}
			foreach my $netobj (sort keys %{$multinetobjs{$multiobj}{'netobjs'}}) {
				print CISCORASH " network-object host $netobj\n"; 
			}
		}
	}

#---------------------------------------------------------------------------------------------------
# NOTE: OUTPUT SERVICES 
#---------------------------------------------------------------------------------------------------

	%sourceobjprint = ();
	my %multisrvcobjs;
	foreach my $srvcname (sort keys %{$srcconfigsrvcs_ref}) {
		if ($srvcname =~ /^any$|^Any$/) { next ;}
		if ($srvcname eq "") { print "   ## WARNING: EMPTY SERVICE FOUND\n";}
		unless (defined($srvcname)) { print "   ## WARNING: EMPTY SERVICE UNDEFINED\n"; next;}
		foreach my $proto (sort keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}}) {
			foreach my $port (sort keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}}) {
				my $srvcnameout;
				my $destobjstring = ' ';
				my $description   = 'Migrated';
				my $colour   	  = 'black';

			# NOTE: check if this service name exists in the destination config bundle, and weather its type and ports exist in the object with the same name

				if (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}) {
					$destobjstring = "Matching object name in dest config: $srvcname";
					unless ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'type'} eq $dstbundle_ref->{'srvcobjects'}{$srvcname}{'type'}) {
						$destobjstring = "$destobjstring TYPE MISMATCH: src $srcbundle_ref->{'srvcobjects'}{$srvcname}{'type'} dst $dstbundle_ref->{'srvcobjects'}{$srvcname}{'type'}";
					}
					unless ((exists $dstbundle_ref->{'srvcobjects'}{$srvcname}) && (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}) && (exists $dstbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}{$port})) {
						$destobjstring = "$destobjstring PORT MISMATCH: src $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} dst $dstbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto}";
					}
				}

			# NOTE: translate port based on proto and port as well as checking that the destination object has the same number of ports

				if ((exists $dstbundle_ref->{'ports'}{$proto}) && (exists $dstbundle_ref->{'ports'}{$proto}{$port}) && ($srvcname ne $dstbundle_ref->{'ports'}{$proto}{$port}{'name'})) {
					my $destobjname = $dstbundle_ref->{'ports'}{$proto}{$port}{'name'} ;
					if ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} eq $dstbundle_ref->{'srvcobjects'}{$destobjname}{'port'}{$proto}) {
						$srvcobjxlates{$srvcname}{'xlate'} = $destobjname; 
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname and has been EXACTLY TRANSLATED";
					} elsif ((scalar keys %{$srcbundle_ref->{'srvcobjects'}{$srvcname}{'ports'}{$proto}}) == (scalar keys %{$dstbundle_ref->{'srvcobjects'}{$destobjname}{'ports'}{$proto}})) {
						$srvcobjxlates{$srvcname}{'xlate'} = $destobjname; 
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname and has been TRANSLATED";
					} else {
						$destobjstring = "$destobjstring Object: $srvcname matches the PORT of $dstbundle_ref->{'srvcobjects'}{$destobjname}{'type'} $destobjname not xlated ";
					}
				} elsif ((exists $dstbundle_ref->{'ports'}{$proto}) && (exists $dstbundle_ref->{'ports'}{$proto}{$port}) && ($srvcname eq $dstbundle_ref->{'ports'}{$proto}{$port}{'name'})) {
					$destobjstring = "$destobjstring EXACTLY";
				}

			# NOTE: copy description and colour

				if (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'} && defined($srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'})) {
					$description = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'description'};
					$description =~ s'"''g;
					$description =~ s',''g;
				}
				if (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'colour'}) {
					$colour = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'colour'};
				}
			# NOTE: translate object if it was matched sufficiently in the destination config

				if (exists $srvcobjxlates{$srvcname}) {
					$srvcnameout = $srvcobjxlates{$srvcname}{'xlate'};
				} else {
					$srvcnameout = $srvcname;
				}
				if ($srvcnameout eq "") { print "   ## WARNING: EMPTY SSERVICE OUT ORIG SERVICE: $srvcname\n"; }
				unless (defined($srvcnameout)) { print "   ## WARNING: UNDEFINED SSERVICE OUT ORIG SERVICE: $srvcname\n"; next; }
				if (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} && ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} =~ m/^\d+\-\d+$/)) {
					my ($rangestart, $rangeend) = split ('-', $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto});
					$ciscosrvcprint{"object service $srvcnameout\n service $proto destination range $rangestart $rangeend\n description $description $colour $destobjstring"}++;
					#$multisrvcobjs{$srvcnameout}{'translated'}++;
				} elsif (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} && ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} =~ m/^\<\d+$/)) {
					my ($dummy, $origport) = split ('<', $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto});
					$ciscosrvcprint{"object service $srvcnameout \n service $proto destination lt $origport\n description $description $colour $destobjstring"}++;
					#$multisrvcobjs{$srvcnameout}{'translated'}++;
				} elsif (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} && ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} =~ m/^\>\d+$/)) {
					my ($dummy, $origport) = split ('>', $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto});
					$ciscosrvcprint{"object service $srvcnameout\n service $proto destination gt $origport\n description $description $colour $destobjstring"}++;
					#$multisrvcobjs{$srvcnameout}{'translated'}++;
				} elsif (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} && ($srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto} =~ m/^\d+$/)) {
					my $portout = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto};
					$ciscosrvcprint{"object service $srvcnameout\n service $proto destination eq $portout\n description $description $colour $destobjstring"}++;
					#$multisrvcobjs{$srvcnameout}{'translated'}++;
					#next;
				} elsif (exists $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto}) {
					my $portout = $srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto};
					$ciscosrvcprint{"object service $srvcnameout $proto\n port-object eq $portout\n description $description $colour $destobjstring"}++;
					#$multisrvcobjs{$srvcnameout}{'translated'}++;
				} else {
					print "   PORT-INFO:  $srvcname references a protocol ($proto) in its 'ports' tree, for port ($port), that does not exists in its original 'port' definition\n";
					next;
				}
				$sourceobjprint{"$srvcnameout,$proto,$srcbundle_ref->{'srvcobjects'}{$srvcname}{'port'}{$proto},,$colour,,,,$description $destobjstring"}++;
			}
		}
	}

	# NOTE: Add unknown ports to services to be output

	foreach my $errorservice (keys %{$errormessages_ref}) {

		if ($errorservice =~ /^Known Proto but Unknown Service Used:/) {

			$errorservice =~ s/^Known Proto but Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			#$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Port Used In Logfiles"}++;
			$ciscosrvcprint{"object service $proto-$port\n service $proto destination eq $port\n description Unknown Port Used In Logfiles"}++;
		}

		elsif ($errorservice =~ /^Unknown Service Used: /) {

			$errorservice =~ s/^Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			#$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Service Used In Logfiles"}++;
			$ciscosrvcprint{"object service $proto-$port\n service $proto destination eq $port\n description Unknown Service Used In Logfiles"}++;
		}

		elsif ($errorservice =~ /^Named but Unknown Service Used: /) {

			$errorservice =~ s/^Named but Unknown Service Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			#$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Named Service Used In Logfile"}++;
			$ciscosrvcprint{"object service $proto-$port\n service $proto destination eq $port\n description Unknown Named Service Used In Logfile"}++;
		}

		elsif ($errorservice =~ /^Unknown Named Servce Used: /) {

			$errorservice =~ s/^Unknown Named Servce Used: //;
			my ($proto, $port) = split (', ', $errorservice);
			#$sourceobjprint{"$proto-$port,$proto,$port,,,,,,Unknown Named Service Used In Logfile"}++;
			$ciscosrvcprint{"object service $proto-$port\n service $proto destination eq $port\n description Unknown Named Service Used In Logfile"}++;
		}
	}

	foreach my $printline (sort keys %sourceobjprint) {
		#print LASTRASH "$printline\n";
	} 
	foreach my $printline (sort keys %ciscosrvcprint) {
		print CISCORASH "$printline\n";
	} 

#---------------------------------------------------------------------------------------------------
# NOTE: OUTPUT NETWORK GROUPS
#---------------------------------------------------------------------------------------------------

	%sourceobjprint = ();
	foreach my $ruleobj (sort keys %{$srcconfiggroups_ref}) {
		my $destobjstring = ' ';
		if (exists $srcbundle_ref->{'netgroups'}{$ruleobj}) {
			my $groupmiss = 0;
			my $grouphit  = 0;
			if (exists $dstbundle_ref->{'netgroups'}{$ruleobj}) {

				# NOTE: check if group with the same name exists 

				$destobjstring = "Matching group name in dest config: $ruleobj";
				my @srcnetgroup = keys %{$srcbundle_ref->{'netgroupobjs'}{$ruleobj}};
				my @dstnetgroup = keys %{$dstbundle_ref->{'netgroupobjs'}{$ruleobj}} ;

				if (compare_arrays(\@srcnetgroup, \@dstnetgroup)) {

					# NOTE: check if the all the objects are the same names and if the objects ips are the same

					my @srcbingroup = sort keys %{$srcbundle_ref->{'bingroups'}{$ruleobj}} ;                                                
					my @dstbingroup = sort keys %{$dstbundle_ref->{'bingroups'}{$ruleobj}} ;
					 
					#print "FOO FOO: @srcbingroup \nMOO MOO: @dstbingroup\n";

					if (compare_arrays(\@srcbingroup, \@dstbingroup)) {
						$destobjstring = "$destobjstring GROUP MATCH: object names and IPs correct";
						#print "$destobjstring WOOOOWOOOWOOO!!!\n";
						$grouphit++;
					} else {
						$destobjstring = "$destobjstring GROUP MATCH: all object names exactly correct but IPs differ";
						$groupmiss++;
					}
				} else {
					# NOTE: else find out whats missing, src and dst being configs not traffic
				}
			} else {
				# NOTE: get the source config group binary ips and check it against each of the destination configs groups

				my @srcbingroup = sort keys %{$srcbundle_ref->{'bingroups'}{$ruleobj}} ;                                                

