#---------------------------------------------------------------------------------------------------
# NOTE: Subroutines for output to user and user STRING input
#---------------------------------------------------------------------------------------------------

sub input_string_or_skip {

	my $option_text = shift;
	my $string_sref = shift;

	print $option_text;

	while (<STDIN>) {
		chomp;
		if ($_ eq '') {
			print "\n	ERROR: Enter a STRING or '.' to SKIP\n\n";
			next;
		} elsif ($_ eq '.') {
			print "\n	SKIPPED String INPUT\n\n";	
			last;
		} else {
			$$string_sref = $_;
			last;
		}
	}
}

sub input_string {

	my $option_text = shift;
	my $string_sref = shift;

	print $option_text;

	while (<STDIN>) {
		chomp;
		if (($_ eq '') || ($_ eq '.')) {
			print "\n	ERROR: Enter a non empty String that isn't '.'\n\n";
			next;
		} else {
			$$string_sref = $_;
			last;
		}
	}
}


#---------------------------------------------------------------------------------------------
# NOTE: Subroutines for output to user and INPUT / OUTPUT TO FILE
#---------------------------------------------------------------------------------------------

sub choose_output_file_name {

	my $option_text		= shift;
	my $outputfilename_sref = shift;

	print $option_text;

	while (<STDIN>) {
		chomp($_);
		if ($_ eq '') {
			print "\n 	ERROR: type a filename\n";

		} elsif (-e "$_") {
			print "\n	ERROR: file exists, choose another file name\n";
		} else {
			$$outputfilename_sref = $_;
			last;
		}
	}
}

#---------------------------------------------------------------------------------------------
# NOTE: Subroutines for output to user and ZONE MAPPING CAPTURE
#---------------------------------------------------------------------------------------------

sub zonemappings_include_exclude {

	my $option_text      = shift;
	my $zonemappings_ref = shift;

	print $option_text;

       NETOUTCHECK:
	while (<STDIN>) {
		chomp($_);
		last if $_ eq '.' ;
		my ($zone, $ip, $masklength) 	= split (/\s+/, $_);
		unless (defined($zone) && ($zone =~ /\w/) && defined($ip) && is_ip($ip) && defined($masklength) && ($masklength =~ /\d+/) && ($masklength < 33)) {
			print "		INPUT FORMAT ERROR: enter: ZONENAME IPADDR MASKLENGTH\n";
			next NETOUTCHECK;
		}
		my $ipbin 			= ip_to_bin($ip) 		;
		my ($maskedbits) 		= substr($ipbin, 0, $masklength);
		$zonemappings_ref->{$maskedbits}{'zone'} = $zone		;
		print " 	Resolved ZONE to Binary Match: $maskedbits\n"	;
	}
}

