# NOTE: Build Filtered Binary Match Table

sub rule_net_obj_ungrouper {
	my ($snrulenum, $snsrcdst, $netobjects_ref, $netgroupobjs_ref, $rules_ref) = @_	;
	my (@snallobjs)									;
	my (@snruleobj) = keys %{$rules_ref->{$snrulenum}{$snsrcdst}}			;
	#print "NUM $snrulenum $snsrcdst\n"						;
	foreach my $snrlobj (@snruleobj) {
		if (exists ($netgroupobjs_ref->{$snrlobj})) {
			foreach my $snsubrlobj (keys (%{$netgroupobjs_ref->{$snrlobj}})) {
				push (@snallobjs, $snsubrlobj) 				;
			}
		} elsif (exists ($netobjects_ref->{$snrlobj})) {
			push (@snallobjs, $snrlobj) 					;
		} else {
			push (@snallobjs, $snrlobj) 					;
			#print "GROAPER $snrlobj\n"					;
		}
	}
	#print "ALL OBJS @snallobjs\n"							;
	return @snallobjs								;
}

sub rule_srvc_obj_ungrouper {
	my ($ssrulenum, $srvcobjects_ref, $srvcgroupobjs_ref, $rules_ref) = @_		;
	my (@ssallobjs)									;
	my (@ssruleobj) = keys %{$rules_ref->{$ssrulenum}{'service'}}			;
	#print "SNUM $ssrulenum\n"							;
	foreach my $ssrlobj (@ssruleobj) {
		if (exists ($srvcgroupobjs_ref->{$ssrlobj})) {
			foreach my $sssubrlobj (keys (%{$srvcgroupobjs_ref->{$ssrlobj}})) {
				push (@ssallobjs, $sssubrlobj) 				;
			}
		} elsif (exists ($srvcobjects_ref->{$ssrlobj})) {
			push (@ssallobjs, $ssrlobj) 					;
		} else {
			push (@ssallobjs, $ssrlobj) 					;
			#print "SROAPER $ssrlobj\n"					;
		}
	}
	#print "SALL OBJS @ssallobjs\n"							;
	return @ssallobjs								;
}

sub rule_bin_proc_add {
	my ($srrulenum,$srrulesrc,$srsrcbin,$srruledst,$srdstbin,$srruleproto,$srrulesrvc,$srruleport,$natrulecount,$rulebincount_ref,$rulebincountquick_ref,$rulebincountholder_ref,$netobjects_ref,$srvcobjects_ref,$rules_ref,$nats_ref,$rashrules_ref,$binrules_ref) = @_;
	#$rashrules_ref->{"$srruleproto~$srruleport"}{$srdstbin}{$srsrcbin}++	;
	#$binrules_ref->{$srdstbin}{$srsrcbin}{$srruleproto}{$srruleport}{$srrulenum}++	;
	$netobjects_ref->{$srrulesrc}{'rulesrcs'}{$srrulenum}++	;
	$netobjects_ref->{$srruledst}{'ruledsts'}{$srrulenum}++	;
	$srvcobjects_ref->{$srrulesrvc}{'rule'}{$srrulenum}++	;

	my $rule_ref = $rules_ref->{$srrulenum}	;

	$rule_ref->{'rulesrcs'}{$srrulesrc}++	;
	$rule_ref->{'ruledsts'}{$srruledst}++	;
	$rule_ref->{'srcbins'}{$srsrcbin}++	;
	$rule_ref->{'dstbins'}{$srdstbin}++	;
	$rule_ref->{'allsrvcobjs'}{$srrulesrvc}++;
	$rule_ref->{'allsrvcports'}{"$srruleproto~$srruleport"}++;
	if ($rule_ref->{'type'} =~ /sec_nat_rule/) {

		my $natrule_ref = $nats_ref->{$srrulenum + $natrulecount};

		$natrule_ref->{'enabled'} = 'yes';
		$natrule_ref->{'installon'} = 'Any';
		$natrule_ref->{'comment'} = "NAT RULE defined from POLICY NAT rule: $srrulenum";
		$natrule_ref->{'origsrc'}{$srrulesrc}++;
		$natrule_ref->{'origdst'}{$srruledst}++;
		$natrule_ref->{'origsrvc'}{$srrulesrvc}++;
		$natrule_ref->{'origsrcbins'}{$srsrcbin}++;
		$natrule_ref->{'origdstbins'}{$srdstbin}++;
		$natrule_ref->{'origsrvcports'}{$srruleproto}{$srruleport}++;
		if (exists $rule_ref->{'natdstip'}) {
			$natrule_ref->{'natdst'}  = $rule_ref->{'natdstip'};
			$netobjects_ref->{$srruledst}{'natdst'}{$rule_ref->{'natdstip'}} = $srrulenum;
		}
		if (exists $rule_ref->{'natdstdip'}) {
			$natrule_ref->{'natdst'}  = $rule_ref->{'natdstdip'};
			$netobjects_ref->{$srruledst}{'natdst'}{$rule_ref->{'natdstdip'}} = $srrulenum;
		}
		if (exists $rule_ref->{'natsrc'}) {
			$natrule_ref->{'natsrc'}  = 'SRC_INT';
			$netobjects_ref->{$srrulesrc}{'natsrc'}{"SRC_INT"} = $srrulenum;
		}
		if (exists $rule_ref->{'natsrcdip'}) {
			$natrule_ref->{'natsrc'}  = $rule_ref->{'natsrcdip'};
			$netobjects_ref->{$srrulesrc}{'natsrc'}{$rule_ref->{'natsrcdip'}} = $srrulenum;
		}
		if (exists $rule_ref->{'natsrcip'}) {
			$natrule_ref->{'natsrc'}  = $rule_ref->{'natsrcip'};
			$netobjects_ref->{$srrulesrc}{'natsrc'}{$rule_ref->{'natsrcip'}} = $srrulenum;
		}


		unless (exists $natrule_ref->{'natsrc'}) {
			$natrule_ref->{'natsrc'}  = 'ORIGINAL';
			$netobjects_ref->{$srrulesrc}{'natsrc'}{"ORIGINAL"} = $srrulenum;
		}
		unless (exists $natrule_ref->{'natdst'}) {
			$natrule_ref->{'natdst'}  = 'ORIGINAL';
			$netobjects_ref->{$srruledst}{'natdst'}{"ORIGINAL"} = $srrulenum;
		}
		unless (exists $natrule_ref->{'natsrvc'}) {
			$natrule_ref->{'natsrvc'} = 'ORIGINAL';
			$netobjects_ref->{$srrulesrc}{'natsrvc'}{"ORIGINAL"} = $srrulenum;
			$netobjects_ref->{$srruledst}{'natsrvc'}{"ORIGINAL"} = $srrulenum;
		}
	} 
	
	$$rulebincount_ref++;
	if ($$rulebincount_ref == ($$rulebincountquick_ref + 5000)) {
		printf ".";
		$$rulebincountquick_ref = $$rulebincount_ref;
	}
	if ($$rulebincount_ref == ($$rulebincountholder_ref + 250000)) {
		print ".$$rulebincount_ref	matches processed\n";
		$$rulebincountholder_ref = $$rulebincount_ref;
	}
}

sub filter_rule_net_obj_ungrouper {
