sub build_merge_to_rulebase {
	my ($srrulenum,
	$srrulesrc,
	$srsrcbin,
	$srruledst,
	$srdstbin,
	$srruleproto,
	$srrulesrvc,
	$srruleport,
	$rules_ref,
	$rashrulegroups_ref,
	$mergetodrops_ref,
	$mergetorulebases_ref,
	$rulebincount,
	$rulebincountquick_ref,
	$rulebincountholder,
	$verbose) 		= @_	;

	my $rule_ref 		= $rules_ref->{$srrulenum};

# NOTE: handle drop rules - first check that the drop rule traffic is not allowed already

	if ($rule_ref->{'action'} =~ m/^deny$|^Deny$|^drop$|^Drop$|^reject$|^Reject$/) {
		my ($hitmatch) = (0);
		my $checkdst = $srdstbin;
		for (my $i = 32 ; $i >= 0 ; $i--) {
			if (exists $mergetorulebases_ref->{$checkdst}) {
				my $checksrc = $srsrcbin;
				for (my $ix = 32 ; $ix >= 0 ; $ix--) {
					if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}) {
						if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{$srruleproto}) {
							if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}) {
								$hitmatch++;
								#print "DROP MATCHED PREV ACCEPT RULE: src $checksrc dst $checkdst proto $srruleproto port $srruleport\n";
							} elsif (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{'any'}) {
								if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{'any'}{'any'} || exists $mergetorulebases_ref->{$checkdst}{$checksrc}{'any'}{'Any'}) {
									$hitmatch++;
									#print "DROP MATCHED PREV ACCEPT RULE: src $checksrc dst $checkdst proto Any port Any\n";
								}
							}
						}
					}
		 			chop $checksrc;
				}
			}
	 		chop $checkdst;
		}
		if ($hitmatch > 0) {
			if ($verbose eq 'yes') {
				print "MERGE DROP RULE MATCHED PREVIOUS DROP RULE:			{$srdstbin}{$srsrcbin}{$srrulesrvc}{$srruleport}\n";
			}
			return '';
		} else {
			#print "MERGE TO added --- DROPS:	{$srdstbin}{$srsrcbin}{$srrulesrvc}{$srruleport}\n";
			$mergetodrops_ref->{$srdstbin}{$srsrcbin}{$srrulesrvc}{$srruleport}++ ;
			return '';
		}
	} else {

	# NOTE: check if rules other than drop rules matche previously expanded drop rules

		my $dropmatch = 0;
		my $checkdst = $srdstbin;
		for (my $i = 32 ; $i >= 0 ; $i--) {
			if (exists $mergetodrops_ref->{$checkdst}) {
				my $checksrc = $srsrcbin;
				for (my $ix = 32 ; $ix >= 0 ; $ix--) {
					if (exists $mergetodrops_ref->{$checkdst}{$checksrc}) {
						if (exists $mergetodrops_ref->{$checkdst}{$checksrc}{$srruleproto}) {
							if (exists $mergetodrops_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}) {
								$dropmatch++;
								#print "DROP MATCHED: src $checksrc dst $checkdst proto $srruleproto port $srruleport\n";
							}
						} elsif (exists $mergetodrops_ref->{$checkdst}{$checksrc}{'any'}) {
							if (exists $mergetodrops_ref->{$checkdst}{$checksrc}{'any'}{'any'} || exists $mergetodrops_ref->{$checkdst}{$checksrc}{'any'}{'Any'}) {
								$dropmatch++;
								#print "DROP MATCHED: src $checksrc dst $checkdst proto Any port Any\n";
							}
						}
					}
		 			chop $checksrc;
				}
			}
 			chop $checkdst;
		}
		if ($dropmatch > 0 ) {
			if ($verbose eq 'yes') {
				print "DROP RULE MATCH:		$srrulenum\n";
			}
			return '';
		}
	}

# NOTE: add rules to merge to rulebase

	if ($rule_ref->{'action'} !~ m/^drop$|^Drop$|^reject$|^Reject$|^deny$|^Deny$/) {
		$mergetorulebases_ref->{$srdstbin}{$srsrcbin}{$srruleproto}{$srruleport}{$srrulenum}++			;
		#print "ADDED 	".$rule_ref->{'action'}."	SRC: $srsrcbin, 		DST: $srdstbin,   	SERVC: $srruleproto~$srruleport\n";
	} else {
		if ($verbose eq 'yes') {
			print "DROPPED 	".$rule_ref->{'action'}."	SRC: $srsrcbin, 		DST: $srdstbin,   	SERVC: $srruleproto~$srruleport\n";
		}
	}

# print dots

	$$rulebincount++	;
	if ($$rulebincount == ($$rulebincountquick_ref + 2000)) {
		print "."	;
		$$rulebincountquick_ref = $$rulebincount;
	}
	if ($$rulebincount == ($$rulebincountholder + 100000)) {
		print ".$$rulebincount	Merge to Rbase matches built\n"	;
		$$rulebincountholder = $$rulebincount	;
	}
}

