sub rulegroup_bin_and_subnet_proc_add {
	my ($srrulenum,
	$srrulesrc,
	$srsrcbin,
	$srruledst,
	$srdstbin,
	$srruleproto,
	$srrulesrvc,
	$srruleport,
	$incconobjs,
	$rules_ref,
	$netobjects_ref,
	$ips_ref,
	$srvcstree_ref,
	$includeips_ref,
	$excludeips_ref,
	$rashrulegroups_ref,
	$rashlogfilter_ref,
	$drops_ref,
	$mergetorulebases_ref,
	$nats_ref,
	$natrules_ref,
	$transrules_ref,
	$rulebincount_ref,
	$rulebincountquick_ref,
	$rulebincountholder_ref,
	$filterwithlog_ref,
	$translatewithnats_ref,
	$matchprevrules,
	$filtertype,
	$filterunloggedrulewithlog,
	$verbose) 		= @_;

	my ($srcaddyes, $srcaddno, $dstaddyes, $dstaddno, $inccount, $excount) = (0,0,0,0,0,0);
	$inccount = keys %{$includeips_ref};
	$excount  = keys %{$excludeips_ref};

# NOTE: handle drop rules - first check that the drop rule traffic is not allowed already

	my $rule_ref = $rules_ref->{$srrulenum};

	if ($rule_ref->{'action'} =~ m/^drop$|^Drop$|^reject$|^Reject$|^deny$|^Deny$/) {
		my ($hitmatch) = (0);
		my $checkdst = $srdstbin;
		for (my $i = 33 ; $i >= 1 ; $i--) {
			if (exists $rashrulegroups_ref->{$checkdst}) {
				my $checksrc = $srsrcbin;
				for (my $ix = 33 ; $ix >= 1 ; $ix--) {
					if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}) {
						if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{$srruleproto}) {
							if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}) {
								$hitmatch++;
								#print "DROP RULE MATCHED PREV RULE\n";
							}
						} elsif (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{'any'}) {
							if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{'any'}{'any'} || exists $rashrulegroups_ref->{$checkdst}{$checksrc}{'any'}{'Any'}) {
								$hitmatch++;
								#print "DROP RULE MATCHED PREV ANY RULE\n";
							}
						}
					}
		 			chop $checksrc;
				}
			}
	 		chop $checkdst;
		}
		if ($hitmatch > 0) {
			if ($verbose eq 'yes') {
				print "DROP RULE MATCHED PREV ACCEPT RULE: $srrulenum 	$ips_ref->{$srdstbin}{'name'}	$ips_ref->{$srsrcbin}{'name'}	$srruleproto	$srruleport\n";
			}
			return '' if ($logparsetype eq 'normal');

		} elsif ($logparsetype eq 'normal') {

			# NOTE: add drop rule

			$drops_ref->{$srdstbin}{$srsrcbin}{$srruleproto}{$srruleport}++ ;
			return '';
		}
	} else {

# NOTE: check if rules other than drop rules matche previously expanded drop rules

		my $dropmatch = 0;
		my $checkdst = $srdstbin;
		for (my $i = 33 ; $i >= 1 ; $i--) {
			if (exists $drops_ref->{$checkdst}) {
				my $checksrc = $srsrcbin;
				for (my $ix = 33 ; $ix >= 1 ; $ix--) {
					if (exists $drops_ref->{$checkdst}{$checksrc}) {
						if (exists $drops_ref->{$checkdst}{$checksrc}{$srruleproto}) {
							if (exists $drops_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}) {
								$dropmatch++;
								#print "DROP RULEBASE MATCH\n";
							}
						} elsif (exists $drops_ref->{$checkdst}{$checksrc}{'any'}) {
							if (exists $drops_ref->{$checkdst}{$checksrc}{'any'}{'any'} || exists $drops_ref->{$checkdst}{$checksrc}{'any'}{'Any'}) {
								$dropmatch++;
								#print "DROP RULEBASE any MATCH\n";
							}
						}
					}
		 			chop $checksrc;
				}
			}
 			chop $checkdst;
		}
		if ($dropmatch > 0 ) {
			if ($verbose eq 'yes') {
				print "ACCEPT RULE MATCHED PREV DROP RULE: $srrulenum	$ips_ref->{$srdstbin}{'name'}	$ips_ref->{$srsrcbin}{'name'}	$srruleproto	$srruleport\n";
			}
			return '';
		}
	}

# NOTE: check if the rule matches previous connectivity expaneded that is set to log

	if ($matchprevrules eq 'yes') {
		my ($hitmatch) = (0);
		my $checkdst = $srdstbin;
		for (my $i = 33 ; $i >= 1 ; $i--) {
			if (exists $rashrulegroups_ref->{$checkdst}) {
				my $checksrc = $srsrcbin;
				for (my $ix = 33 ; $ix >= 1 ; $ix--) {
					if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}) {
						if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{$srruleproto}) {
							if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}) {
								#print "PREV RULE MATCH   	{$checkdst}{$checksrc}{$srruleproto}{$srruleport}\n";
								$hitmatch++;
							}
						} elsif (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{'any'}) {
							if (exists $rashrulegroups_ref->{$checkdst}{$checksrc}{'any'}{'any'} || exists $rashrulegroups_ref->{$checkdst}{$checksrc}{'any'}{'Any'}) {
								#print "PREV RULE ANY MATCH	$checkdst}{$checksrc}{$srruleproto}{$srruleport}\n";
								$hitmatch++;
							}
						}
					}
		 			chop $checksrc;
				}
			}
			chop $checkdst;
		}
		if ($hitmatch > 0) {
			if ($verbose eq 'yes') {
				print "ACCEPT MATCHED PREV ACCEPT RILE: $srrulenum 	$ips_ref->{$srdstbin}{'name'}	$ips_ref->{$srsrcbin}{'name'}	$srruleproto	$srruleport\n";
			}
			return '';
		}

# NOTE: check if the rule matches previous connectivity expaneded that is set NOT to log, so was added directly to the filterbase

		($hitmatch) = (0);
		$checkdst = $srdstbin;
		for (my $i = 33 ; $i >= 1 ; $i--) {
			if (exists $rashlogfilter_ref->{$checkdst}) {
				my $checksrc = $srsrcbin;
				for (my $ix = 33 ; $ix >= 1 ; $ix--) {
					if (exists $rashlogfilter_ref->{$checkdst}{$checksrc}) {
						if (exists $rashlogfilter_ref->{$checkdst}{$checksrc}{"$srruleproto~$srruleport"}) {
							$hitmatch++;
						} elsif (exists $rashlogfilter_ref->{$checkdst}{$checksrc}{'any~any'} || exists $rashlogfilter_ref->{$checkdst}{$checksrc}{'any~Any'}) {
							$hitmatch++;
						}
					}
		 			chop $checksrc;
				}
			}
			chop $checkdst;
		}
		if ($hitmatch > 0) {
			if ($verbose eq 'yes') {
				print "ACCEPT MATCHED PREV unlogged ACCEPT RILE: $srrulenum 	$ips_ref->{$srdstbin}{'name'}	$ips_ref->{$srsrcbin}{'name'}	$srruleproto	$srruleport\n";
			}
			return '';
		}
	}

# NOTE: all filter types - check merge from rules for match in merge to rulebase

	my ($matchtobasematch) = 0;
	my $checkdst = $srdstbin;
	for (my $i = 33 ; $i >= 1 ; $i--) {
		if (exists $mergetorulebases_ref->{$checkdst}) {
			my $checksrc = $srsrcbin;
			for (my $ix = 33 ; $ix >= 1 ; $ix--) {
				if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}) {
					if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{$srruleproto}) {
						if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}) {
							$matchtobasematch++;
							#print "MERGETO RULEBASE MATCH: $srrulenum		{$checkdst}{$checksrc}{$srruleproto}{$srruleport}\n";
						}
					} elsif (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{'any'}) {
						if (exists $mergetorulebases_ref->{$checkdst}{$checksrc}{'any'}{'any'} || exists $mergetorulebases_ref->{$checkdst}{$checksrc}{'any'}{'Any'}) {
							$matchtobasematch++;
							#print "MERGETO RULEBASE any MATCH: $srrulenum	{$checkdst}{$checksrc}{$srruleproto}{$srruleport}\n";
						}
					}
				}
	 			chop $checksrc;
			}
		}
 		chop $checkdst;
	}
	if ($matchtobasematch > 0 ) {
		if ($verbose eq 'yes') {
			print "MERGETO RULEBASE MATCH: $srrulenum  	$ips_ref->{$srsrcbin}{'name'}	$ips_ref->{$srdstbin}{'name'}	$srruleproto	$srruleport\n";
		}
		return '';
	}

# NOTE: translate destination nats only

	my ($oldsrcbin, $olddstbin) ;
	my @natrules;
	if ($$translatewithnats_ref eq 'yes') {
		my $checkdst = $srdstbin;
		for (my $i = 33 ; $i >= 1 ; $i--) {
			if (exists $nats_ref->{$checkdst}) {
				my $checksrc = $srsrcbin;
				for (my $ix = 33 ; $ix >= 1 ; $ix--) {
					if (exists $nats_ref->{$checkdst}{$checksrc}) {
						if (exists $nats_ref->{$checkdst}{$checksrc}{$srruleproto}) {
							if (exists $nats_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}) {
								foreach my $natrule (keys %{$nats_ref->{$checkdst}{$checksrc}{$srruleproto}{$srruleport}}) {
									if (($natrules_ref->{$natrule}{'natdst'} ne 'ORIGINAL') && is_netobj_name($natrules_ref->{$natrule}{'natdst'}, $netobjects_ref)) {
										push(@natrules, $natrule);
										$olddstbin = $srdstbin;
										if (is_range($natrules_ref->{$natrule}{'natdst'}, $netobjects_ref)) {
											$srdstbin  = ip_to_bin($netobjects_ref->{$natrules_ref->{$natrule}{'natdst'}}{'rangestart'}) ;
										} else {
