		$rashlogfilter_ref->{$srdstbin}{$srsrcbin}{"$srruleproto~$srruleport"}{$srrulenum}++ ;
		$rashrulegroups_ref->{$srdstbin}{$srsrcbin}{$srruleproto}{$srruleport}{$srrulenum}++ ;
