# NOTE: Subroutines for sort

sub numerically    { $a <=> $b }
sub rnumerically   { $b <=> $a }
sub alphabetically { lc $a cmp lc $b }

#---------------------------------------------------------------------------------------------
# NOTE: Subroutines to compair speciffic things 
#---------------------------------------------------------------------------------------------

sub compare_arrays {
	my ($first, $second) = @_				;
	return 0 unless @$first == @$second			;
	for (my $i = 0; $i < @$first; $i++) {
		return 0 if $first->[$i] ne $second->[$i]	;
	}
	return 1						;
}
#---------------------------------------------------------------------------------------------
# NOTE: Subroutines to convert speciffic things 
#---------------------------------------------------------------------------------------------

sub ip_to_bin {
        my (@ip) = split (/\./, "$_[0]")  						;
        my ($ipbin) = unpack ( "B32", pack ("CCCC", $ip[0], $ip[1], $ip[2], $ip[3]))	;
        return $ipbin									;
}
sub netmask_to_bin {
	my ($masklength)				;
        my ($maskbin) = ip_to_bin($_[0])		;
        my ($maskbits) = $maskbin 			;
	if ($maskbin =~ /0+/) {
        	$masklength = index("$maskbin", 0 )	;
	} else {
		$masklength = 32			;
	}
        return ($maskbin, $maskbits, $masklength)	;
}

#---------------------------------------------------------------------------------------------
# NOTE: Subroutines to convert from names or IP addresses and netmasks to ip's or ip mask pairs or binary ips
#---------------------------------------------------------------------------------------------

# NOTE: used only for single HOST entires where all 32 bits are required (in cisco mostly)

sub name_or_ip_to_ip {
	my ($nameorip, $netobjects_ref, $ips_ref) = @_	;

	if (is_ip($nameorip) && address_is_known($nameorip, $ips_ref)) {

		return $nameorip; 		# is a known ip

	} elsif (is_netobj_name($nameorip, $netobjects_ref)) {

		my $ip = $netobjects_ref->{$nameorip}{'ip'};

		return $ip; 			# is a name translated to just its ip

	} elsif (is_ip($nameorip)) {

		#print "  WARNING: Unknown IP: $nameorip used in name_or_ip_to_ip\n";

		return $nameorip; 		# is an unknown ip
	
	} else {	
		print "  WARNING: $nameorip, used in NAME_OR_IP_TO_IP is not an IP or a known name\n";
		return $nameorip;
	}
}
sub name_or_ip_to_ipbin {
	my ($nameorip, $netobjects_ref, $ips_ref) = @_;
	my $ip 		= name_or_ip_to_ip($nameorip, $netobjects_ref, $ips_ref);
	my $ipbin 	= ip_to_bin($ip);
	return $ipbin;
}

# NOTE: used for networks  -  name_or_ip,netmask pairs

sub name_or_net_to_ip_nm {
	my ($nameornet, $nm, $netobjects_ref, $ips_ref) = @_	;

	if (is_ip($nameornet) && is_netmask($nm) && network_is_known($nameornet, $nm, $ips_ref)) {

		return ($nameornet, $nm); 				# is a known net

	} elsif (is_netobj_name($nameornet, $netobjects_ref)) {

		my $ip = $netobjects_ref->{$nameornet}{'ip'};
		#   $nm = $netobjects_ref->{$nameornet}{'nm'};		# NOTE: this should be disabled at the moment as its only being used in the cisco build section

		return ($ip, $nm); 					# is a name translated to its ip with the netmask supplied

	} elsif (is_ip($nameornet) && is_netmask($nm)) {

		#print "  WARNING: Unknown Net: $nameornet $nm used in name_or_net_to_ip_nm, this is usually ok though\n";

		return ($nameornet, $nm); 				# is an unknown net
	
	} else {	
		print "  WARNING: $nameornet , $nm , used in NAME_OR_NET_TO_IP_NM is NOT a known network, ip or name\n";
		return $nameornet;
	}
}
sub name_or_net_to_ipbin {
	my ($nameornet, $nm_in, $netobjects_ref, $ips_ref) = @_;

	my ($ip, $nm) 				= name_or_net_to_ip_nm($nameornet, $nm_in, $netobjects_ref, $ips_ref)	;
	my $ipbin 				= ip_to_bin($ip)			;
	my ($maskbin, $maskbits, $masklength)	= netmask_to_bin($nm)			;
	my ($maskedipbin) 			= substr($ipbin, 0, $masklength)	;

	return $maskedipbin;
}
sub name_or_net_to_ipbin_nmln {
	my ($nameornet, $nm_in, $netobjects_ref, $ips_ref) = @_;

	my ($ip, $nm) 				= name_or_net_to_ip_nm($nameornet, $nm_in, $netobjects_ref, $ips_ref)	;
	my $ipbin 				= ip_to_bin($ip)			;
	my ($maskbin, $maskbits, $masklength)	= netmask_to_bin($nm)			;
	my ($maskedipbin) 			= substr($ipbin, 0, $masklength)	;

	return ($maskedipbin, $masklength);
}

#---------------------------------------------------------------------------------------------
# NOTE: Subroutines to convert from names or IP addresses and netmasks to ip's or ip mask pairs or binary ips
#---------------------------------------------------------------------------------------------

sub ipbin_to_name {
	my ($ipbin, $ips_ref) = @_				;
	if (exists $ips_ref->{$ipbin}) {
		if (exists ($ips_ref->{$ipbin}{'name'})) {
			my $name = $ips_ref->{$ipbin}{'name'}	;
			return $name				;
		} else {
			print "   WARNING: no name found for $ipbin in IPBIN_TO_NAME, returned TEXTBIN IP use hbin to ranslate output back to name\n";
			return $ipbin				;
		}
	} else {
		print "   WARNING: $ipbin not found in IPBIN_TO_NAME, returned TEXTBIN IP use hbin to ranslate output back to name\n";
		return $ipbin					;
	}
}
sub net_to_name {
	my ($netip, $nm, $netobjects_ref, $ips_ref) = @_	;

	if (is_ip($netip) && is_netmask($nm) && network_is_known($netip, $nm, $ips_ref)) {
		my $maskedipbin 	= name_or_net_to_ipbin($netip, $nm, $netobjects_ref, $ips_ref)	;
		my $name 		= ipbin_to_name($maskedipbin, $ips_ref)				;
		return $name; 							# is a known net

	} elsif (is_netobj_name($netip, $netobjects_ref)) {

		return $netip; 							# is a name already

	} elsif (is_ip($netip) && is_netmask($nm)) {

		#print "  WARNING: Unknown Net: $netip $nm used in net_to_name\n";

		return $netip; 				
		
		# NOTE: is an unknown net using its IP as a name - potentially this could cause name conflicts with networks - so I'm considering adding a mask length
	
	} else {	
		print "  WARNING: $netip , $nm , used in NAT_TO_NAME is NOT a known network, ip or hostname\n";
	
		return $netip;
	}
}
sub ip_to_name {
	my ($ip, $netobjects_ref, $ips_ref) = @_;
	my $nm	 = '255.255.255.255'		;
	my $name = net_to_name($ip, $nm, $netobjects_ref, $ips_ref)  ;
	return $name				;
}
sub proto_port_to_srvc_name {
	my ($proto, $port, $ports_ref) = @_;
	if (port_is_known($proto,$port,$ports_ref)) {
		my $srvcname = $ports_ref->{$proto}{$port}{'name'};
		return $srvcname;
	} else {
		return $port;
	}
}

sub res_ip_to_name {

	my ($ip, $nmln) = @_;

	my $namereply;
	my $whoisreply;

	$nmln = 32 unless defined($nmln);

	my $res = Net::DNS::Resolver->new;

	my $reverse_ip = join ".", reverse split m/\./, $ip;
	$reverse_ip .= ".in-addr.arpa";

	my $socket = $res->bgsend($reverse_ip, 'PTR');
	my $wait   = 0;

	until ($res->bgisready($socket)) {
		print "waiting for $ip\n" if $wait > 0;
		sleep 1 + $wait;
		$wait++;
	}

	my $packet = $res->bgread($socket);
	my @rr ;

	if (defined($packet)) {
		@rr     = $packet->answer;

		for my $rr (@rr) {
			my $name = $rr->string;
			$name =~ s/\r|\n//g;
			$name =~ s/\(|\)//g;
			my @repstring = split (/\s+/, $name);
			my $revnameout = $repstring[4];
			$revnameout =~ s/\.$//;
			$namereply = $revnameout;
		}
	}

	if (defined($namereply)) {
		#print "WOOP: $namereply\n";
		return $namereply;

	} else {

		my $wipresp;
		#  $wipresp = whoisip_query($ip); 

		if (defined($wipresp) && exists $wipresp->{'NetName'}) {
			$whoisreply = $wipresp->{'NetName'}; 
		}

		if (defined($whoisreply)) {
			
			#print "WOOiP: $whoisreply\n";
			return "$whoisreply";

		} else {

			return undef;
		}
	}
}

