sub add_srvc {
	my ($name,$proto,$port, $orderedports_ref, $srvcobjects_ref, $ports_ref) = @_;
	my $type = $proto;
	my $descrip = 'Simple Service';
	my $colour = 'green';
	if ($proto =~ /\w+\-\w+/) {
		my @protos = split (/\-/, $proto);
		foreach my $protos (@protos) {
			add_srvcobject ($type,$name,$protos,$port,$descrip,$colour, $orderedports_ref, $srvcobjects_ref, $ports_ref);
		}
	} else {
		add_srvcobject ($type,$name,$proto,$port,$descrip,$colour, $orderedports_ref, $srvcobjects_ref, $ports_ref);
	}
}

sub add_srvcobject {
	my ($type,$name,$proto,$port,$descrip,$colour, $orderedports_ref, $srvcobjects_ref, $ports_ref) = @_;
	$srvcobjects_ref->{$name}{'port'}{$proto} 	= $port		;
