	$ports_ref->{$proto}{$port}{'name'} 		= $name		;
	$srvcobjects_ref->{$name}{'description'} 	= $descrip		;
	$srvcobjects_ref->{$name}{'colour'} 		= $colour		;
	push(		@{$orderedports_ref}, 		  $name)		;
}

