sub address_is_known { 
	my ($ip, $ips_ref) = @_	;
	if (is_ip($ip)) {
		my ($ipbin) 	= ip_to_bin($ip)	;
		if (exists ($ips_ref->{$ipbin})) {
			return 1			;
		} else {
			return 0			;
		}
	} else {
		return 0;
	}
}
sub address_isnt_known { 
	my ($ip, $ips_ref) = @_	;
	if (is_ip($ip)) {
		my ($ipbin) 	= ip_to_bin($ip)	;
		if (exists ($ips_ref->{$ipbin})) {
			return 0			;
		} else {
			return 1			;
		}
	} else {
		return 0;
	}
}
sub network_is_known { 
	my ($ip, $nm, $ips_ref) = @_;
	if (is_ip($ip) && is_netmask($nm)) {
		my ($ipbin) 	= ip_to_bin($_[0])				;
		my ($maskbin, $maskbits, $masklength) = netmask_to_bin($_[1])	;
		my ($maskedbits) = substr($ipbin, 0, $masklength)		;
		#print "ML $masklength\n";
		if (exists($ips_ref->{$maskedbits})) {
			return 1						;
		} else {
			return 0						;
		}
	} else {
		return 0;
	}
}
