		} else {
			return 0			;
		}
	}
}

#---------------------------------------------------------------------------------------------
# NOTE: Subroutines to find things and their supernets
#---------------------------------------------------------------------------------------------

sub find_net_object {
	my ($object,$netobjects_ref,$ips_ref) = @_ 	;
        if (exists ($netobjects_ref->{$object})) {
                return ($object)			;
        } else {
                my ($ipbin) = ip_to_bin($object)	;
		until (exists ($ips_ref->{$ipbin}) || $ipbin eq "") {
                        chop ($ipbin)			;
                }
                return ($ips_ref->{$ipbin}{'name'}) 		;
        }
}
sub find_supernets_and_duplicates {
	my @names;
	my @duplnames;
	my @subnames;
	my @hostnames;
	my ($ipbin, $ips_ref, $duplips_ref) = @_;
	my $workbin = $ipbin;
	until ($workbin eq "") {
		chop ($workbin);
		if (exists $ips_ref->{$workbin}) {
			my $obname = $ips_ref->{$workbin}{'name'};
			next if $obname eq 'Any';
			next if $obname eq 'any';
			next if $obname eq 'ANY';
			push (@names, $obname);
		}
	}
	my $dupworkbin = $ipbin;
	if (exists $duplips_ref->{$dupworkbin}) {
		foreach my $dupli (sort keys %{$duplips_ref->{$dupworkbin}}) {
			push (@duplnames, $dupli);
		}
	}
	#@hostnames = ('Range_To_Large_For_Meaningful_Host_List');
	#@subnames = ('Range_To_Large_To_Process_Timely_Supernet_List');

	return (\@names, \@duplnames, \@subnames, \@hostnames);
}
sub find_supernets_duplicates_and_subnets {
	my @names;
	my @duplnames;
	my @subnames;
	my @hostnames;
	my ($ipbin, $ips_ref, $duplips_ref) = @_;
	my $workbin = $ipbin;
	until ($workbin eq "") {
		chop ($workbin);
		if (exists $ips_ref->{$workbin}) {
			my $obname = $ips_ref->{$workbin}{'name'};
			next if $obname eq 'Any';
			next if $obname eq 'any';
			next if $obname eq 'ANY';
			push (@names, $obname);
		}
	}
	my $dupworkbin = $ipbin;
	if (exists $duplips_ref->{$dupworkbin}) {
		foreach my $dupli (sort keys %{$duplips_ref->{$dupworkbin}}) {
			push (@duplnames, $dupli);
		}
	}
	my $binlen = length($ipbin);
	my $subworkbin = $ipbin;
	foreach my $testbin (keys %{$ips_ref}) {
		next if $testbin eq $subworkbin;
		my $testlen = length($testbin);
		my $testlenorig = length($testbin);
		my $testworkbin = $testbin;
		if ($testlen > $binlen) {
			#print "FIRST TEST: $testlen, $binlen, $testworkbin\n";
			until ( $testlen < $binlen) {
				last if $binlen == 0 ;
				#print "UNTIL TEST: $testlen, $binlen, $testworkbin\n";
				if ($testworkbin eq $subworkbin) {
					if (($testlenorig == 32) && ($binlen < 18)) { 
						@hostnames = ('Net_To_Large_For_Meaningful_Host_List');
					} elsif (($testlenorig == 32)) { 
						my $hostobname = $ips_ref->{$testbin}{'name'};
						#print "MADEIT HOST TEST: $testlen, $binlen, $testworkbin, $subobname\n";
						push (@hostnames, $hostobname);
					} else {
						my $subobname = $ips_ref->{$testbin}{'name'};
						#print "MADEIT NET TEST: $testlen, $binlen, $testworkbin, $subobname\n";
						push (@subnames, $subobname);
					}
				}
				chop ($testworkbin);
				$testlen = length($testworkbin);
			}
		}
	}
	return (\@names, \@duplnames, \@subnames, \@hostnames);
}
sub find_net_object_and_supernets_and_duplicates {
	my @names;
	my ($ipbin, $ips_ref, $duplips_ref) = @_;
	my $workbin = $ipbin;
	for (my $i = 0; $i <= 32; $i++) {
		if (exists $ips_ref->{$workbin}) {
			my $obname = $ips_ref->{$workbin}{'name'};
			next if $obname eq 'Any';
			push (@names, $obname);
		}
		chop ($workbin);
	}
	my $dupworkbin = $ipbin;
	for (my $i = 0; $i <= 32; $i++) {
		if (exists $duplips_ref->{$dupworkbin}) {
			foreach my $dupli (sort keys %{$duplips_ref->{$dupworkbin}}) {
				next if $dupli eq 'Any';
				push (@names, $dupli);
			}
		}
		chop ($dupworkbin);
	}
	return @names;
}

