	$logports{'tcp'}{'8774'}{'name'}   	= '8774' ;  	# Compute (nova) endpoints publicurl and adminurl
	$logports{'tcp'}{'8773'}{'name'}   	= '8773' ;  	# Compute API (nova-api)
	$logports{'tcp'}{'8775'}{'name'}   	= '8775' ;  	# Compute VNC proxy for browsers ( openstack-nova-novncproxy)
	$logports{'tcp'}{'6080'}{'name'}   	= '6080' ;  	# Compute VNC proxy for traditional VNC clients (openstack-nova-xvpvncproxy)
	$logports{'tcp'}{'6081'}{'name'}   	= '6081' ;  	# Proxy port for HTML5 console used by Compute service
