	$logports{'tcp'}{'9191'}{'name'}   	= '9191' ;  	# Image Service registry
	$logports{'tcp'}{'9696'}{'name'}   	= '9696' ;  	# Networking (neutron)	publicurl and adminurl
	$logports{'tcp'}{'6000'}{'name'}   	= '6000' ;  	# Object Storage (swift)
	$logports{'tcp'}{'6001'}{'name'}   	= '6001' ;  	# Object Storage (swift)
	$logports{'tcp'}{'6002'}{'name'}   	= '6002' ;  	# Object Storage (swift)
	$logports{'tcp'}{'8004'}{'name'}   	= '8004' ;  	# Orchestration (heat) endpoint publicurl and adminurl
	$logports{'tcp'}{'8000'}{'name'}   	= '8000' ;  	# Orchestration AWS CloudFormation-compatible API (openstack-heat-api-cfn)
	$logports{'tcp'}{'8003'}{'name'}   	= '8003' ;  	# Orchestration AWS CloudWatch-compatible API (openstack-heat-api-cloudwatch)
	$logports{'tcp'}{'8777'}{'name'}   	= '8777' ;  	# Telemetry (ceilometer) publicurl and adminurl
	$logports{'tcp'}{'5672'}{'name'}   	= '5672' ;  	# Message Broker (AMQP traffic) OpenStack Block Storage, Networking, Orchestration, and Compute.

	foreach my $proto (keys %{$ports_ref}) {
		foreach my $port (keys %{$ports_ref->{$proto}}) {

			my $srvcname = $ports_ref->{$proto}{$port}{'name'};

			next if exists $srvcexceptions_ref->{$srvcname};

			if ($proto eq 'tcp') {

				#print "GOTERE $proto, $port\n";

				unless (exists $logports{'udp'}{$port}) {
					$logports{'udp'}{$port}{'name'}  = $srvcname;
				}

				$logports{$proto}{$port}{'name'} = $srvcname;

			} elsif ($proto eq 'udp') {

				unless (exists $logports{'tcp'}{$port}) {
					$logports{'tcp'}{$port}{'name'}  = $srvcname;
				}

				$logports{$proto}{$port}{'name'} = $srvcname;

			} else {

				$logports{$proto}{$port}{'name'} = $srvcname;
			}
		}
	}

	#print "LOG PORTS  TREE         	\n############################################################################\n\n". Dumper(%logports) . "\n\n"		;
	return \%logports;
}

